=Spirometry_PrebronchodilatorSVC]\');\n  	PostBroncSVC = $(\'input[name=Spirometry_PostbronchodilatorSVC]\');\n  \n  	fevFvcRatio = $(\'input[name=Spirometry_FEV1OverFVC]\');\n  	PredFvcPercent = $(\'input[name=Spirometry_PercentPredictedFVC]\');\n  	PredFev1Percent = $(\'input[name=Spirometry_PercentPredictedFEV1]\');\n  	\n  	MaximumEffort = $(\'input[name=Spirometry_MaximumEffort]:checked\');\n  \n  	messageOption = \'\';\n  \n  	if (PreBroncFev1.val() != \'\' && (PreBroncFVC.val() != \'\' || PreBroncSVC.val() != \'\')){\n  		preBroncFilled = 1;\n  	} else {\n  		preBroncFilled = 0;\n  	}\n  \n  	if (PostBroncFev1.val() != \'\' && (PostBroncFVC.val() != \'\' || PostBroncSVC.val() != \'\')){\n  		postBroncFilled = 1;\n  	} else {\n  		postBroncFilled = 0;\n  	}  \n  \n  	if (postBroncFilled + preBroncFilled == 1){\n  \n  		if (fevFvcRatio.val() < 70){\n  		   \n  			if(preBroncFilled == 1) {\n  				messageOption = \'E\';\n  			}    \n  			if(postBroncFilled == 1) {\n  				messageOption = \'D\';\n  			}\n  		 \n  		} else if (PredFvcPercent.val() < 80){\n  		  \n  			 messageOption = \'C\';\n  		 \n  		} else {\n  			  \n  			if (postBroncFilled == 1) {\n  				messageOption = \'B\';\n  			}\n  			if (preBroncFilled == 1) {\n  				messageOption = \'A\';\n  			}   \n  			\n  		}\n  \n  	}\n  \n  	if (PreBroncFev1.val() != \'\' && PostBroncFev1.val()!=\'\'){\n  		changeInFev1 = PostBroncFev1.val() - PreBroncFev1.val();\n  		changeInFev1Percent = (PostBroncFev1.val() - PreBroncFev1.val())/PreBroncFev1.val() * 100;\n  	}\n  \n  	if (postBroncFilled + preBroncFilled == 2){	 \n  \n  		preBroncFvcComb = Math.max((PreBroncFVC.val() || PreBroncSVC.val()),(PreBroncSVC.val() || PreBroncFVC.val()));\n  		postBroncFvcComb = Math.max((PostBroncFVC.val() || PostBroncSVC.val()),(PostBroncSVC.val() || PostBroncFVC.val()));\n  \n  		preBroncRatio = PreBroncFev1.val()/preBroncFvcComb;\n  		postProncRatio = PostBroncFev1.val()/postBroncFvcComb;\n  \n  		if (parseFloat(postProncRatio) < 0.7 || parseFloat(preBroncRatio) < 0.7){\n  			if(changeInFev1 > 0.4 && changeInFev1Percent > 12.0){\n  				messageOption = \'Ha\';\n  			} else if(changeInFev1 > 0.2){\n  				messageOption = \'Hb\';\n  			} else {\n  				messageOption = \'Hc\';\n  			}\n  \n  		} else if (PredFvcPercent.val() < 80){\n  			//messageOption = \'G\'; //CR - changed as this is also restrictive, as per Mike\'s email / Skype conversation\n  			//messageOption = \'C\';\n			\n			if(changeInFev1 > 0.4 && changeInFev1Percent > 12.0){\n  				messageOption = \'G\';\n  			} else {\n  				messageOption = \'C\';\n  			}\n			\n  		} else {\n  			messageOption = \'F\';\n  		}\n  \n  	} \n  \n  	message = \'\';\n  	Fev1PercentCategory = \'\';\n  \n  	if(PredFev1Percent.val() != \'\'){\n  \n  		if(PredFev1Percent.val() < 75){\n  			Fev1PercentCategory = \'not acceptable\'\n  		} else if (PredFev1Percent.val() < 85){\n  			Fev1PercentCategory = \'acceptable\' \n  		} else {\n  			Fev1PercentCategory = \'good\'  \n  		}\n  		\n  	}\n  \n  	switch (messageOption) {\n  		\n  		case \'A\':\n  			message = \'This patient\\\'s spirometry is normal today. This is reassuring, but asthma remains possible. You can proceed but will need other information about symptom history and response to confirm the diagnosis of asthma. There is no point in performing bronchodilation test today.\' ;\n  			break;\n  		case \'B\':\n  			message = \'This patient\\\'s spirometry is normal today after a bronchodilator. This is reassuring, but asthma remains possible. You can proceed but will need other information about symptom history and response to confirm the diagnosis of asthma.\';\n  			break;\n  		case \'C\':\n  			message = \'This patient has a normal ratio but with a reduced lung volume which is indicative of a restrictive pattern. This is not typical of asthma and you should consider specialist referral to investigate the reasons for the reduced lung volumes. Do not proceed with an asthma assessment today. Save the data already entered, and re consider for asthma management or not after the referral has been reported back.\';\n  			break;\n  		case \'D\':\n  			message = \'This patient has an obstructive pattern that is compatible with asthma. The FEV1 is \' +  PredFev1Percent.val() +\'% of predicted after a bronchodilator which is \'+Fev1PercentCategory+\'. You will be reminded of this value when selecting therapy later\';\n  			break;\n  		case \'E\':\n  			message = \'If you want to do a bronchodilator challenge now you can continue with the program while the drug takes effect and come back to this page later. An FEV1 value of \'+PredFev1Percent.val()+\'% of predicted would be \'+Fev1PercentCategory+\'.\';\n  			break;\n  		case \'F\':\n  			message = \'This patient\\\'s spirometry is normal today. This is reassuring, but asthma remains possible.  You can proceed but will need other information about symptom history and response to confirm the diagnosis of asthma. There is no point in performing bronchodilation test today.\';\n  			break;\n  		case \'G\':\n  			message = \'This is not typical of asthma but there has been a significant increase in FEV1 of \'+changeInFev1.toFixed(1)+\'l (\'+changeInFev1Percent.toFixed(1)+\'%) which is highly suggestive of asthma. It is possible the pre bronchodilation test was submaximal or was terminated early.\';\n  			break;\n  		case \'Ha\':\n  			message = \'This patient has an obstructive pattern that is compatible with asthma. The best FEV1 value is \' + PredFev1Percent.val() +\'% predicted which is \'+ Fev1PercentCategory+\'. The improvement in FEV1 after bronchodilator is \'+changeInFev1.toFixed(1)+\'l (\'+changeInFev1Percent.toFixed(1)+\'%) which is diagnostic of asthma. You will be reminded of these values when selecting therapy later\';\n  			break; \n  		case \'Hb\':\n  			message = \'This patient has an obstructive pattern that is compatible with asthma. The best FEV1 value is \' + PredFev1Percent.val() +\'% predicted which is \'+ Fev1PercentCategory+\'. The improvement in FEV1 after bronchodilator is \'+changeInFev1.toFixed(1)+\'l (\'+changeInFev1Percent.toFixed(1)+\'%) which is supportive but not diagnostic of asthma. You will be reminded of these values when selecting therapy later\';\n  			break; \n  		case \'Hc\':\n  			message = \'This patient has an obstructive pattern that is compatible with asthma. The best FEV1 value is \' + PredFev1Percent.val() +\'% predicted which is \'+ Fev1PercentCategory+\'. The improvement in FEV1 after bronchodilator is \'+changeInFev1.toFixed(1)+\'l (\'+changeInFev1Percent.toFixed(1)+\'%) which is not significant but does not exclude asthma on one visit. You will be reminded of these values when selecting therapy later\';\n  			break;\n  		default: \n  		message = \'\';\n  \n  	}\n  	\n  	$(\'input[name=Spirometry_Message]\').val(messageOption);\n  \n  	if(MaximumEffort.val() == \'Y\'){		\n  		$(\'#text-39\').html(message);\n  		agc_calc_LungFunctionPerformedOutcome();\n  	} else if (MaximumEffort.val() == \'N\') {\n  		$(\'input[name=Spirometry_Message]\').val(\'Exit\');\n  		$(\'#text-39\').html(\'Patients who have difficulty performing satisfactory spirometry are often challenging in other ways and it is likely to be better to have a specialist input (with access to more measurements) than to persist on high dose therapy without objective monitoring available.\');\n  		agc_calc_LungFunctionPerformedOutcome();\n  		\n  		/*$(\'input[name=Spirometry_PrebronchodilatorFEV1]\').val(\'\');\n  		$(\'input[name=Spirometry_PostbronchodilatorFEV1]\').val(\'\');\n  		$(\'input[name=Spirometry_PrebronchodilatorFVC]\').val(\'\');\n  		$(\'input[name=Spirometry_PostbronchodilatorFVC]\').val(\'\');\n  		$(\'input[name=Spirometry_PrebronchodilatorSVC]\').val(\'\');\n  		$(\'input[name=Spirometry_PostbronchodilatorSVC]\').val(\'\');\n  		$(\'input[name=Spirometry_FEV1OverFVC]\').val(\'\');\n  		$(\'input[name=Spirometry_PercentPredictedFVC]\').val(\'\');\n  		$(\'input[name=Spirometry_PercentPredictedFEV1]\').val(\'\');*/\n  		\n  	} else {\n  		\n  	}\n  	\n }\n  \n $(\'input[name=Spirometry_MaximumEffort]\').on(\'ifChanged\',function(){agc_calc_messageType();});\n $(\'input[name=Spirometry_PrebronchodilatorFVC]\').change(function(){agc_calc_messageType();});\n $(\'input[name=Spirometry_PostbronchodilatorFVC]\').change(function(){agc_calc_messageType();});\n $(\'input[name=Spirometry_PrebronchodilatorSVC]\').change(function(){agc_calc_messageType();});\n $(\'input[name=Spirometry_PostbronchodilatorSVC]\').change(function(){agc_calc_messageType();});  \n $(\'input[name=Spirometry_PrebronchodilatorFEV1]\').change(function(){agc_calc_messageType();});\n $(\'input[name=Spirometry_PostbronchodilatorFEV1]\').change(function(){agc_calc_messageType();});\n $(\'input[name=Spirometry_PostbronchodilatorFEV1]\').change(function(){agc_calc_messageType();});\n $( document ).ready(function(){agc_calc_messageType();});\n ',NULL,NULL,'TextBox',NULL,NULL,0,NULL,NULL),(397,NULL,'CurrentMedication','IcsBdpEquivIncUse','Char(1)','Calc','\nfunction agc_calc_BDPEquivalent_ICS() {\n    \n	DrugSelected = $(\'select[name=CurrentMedication_CurrentDrugICSNewDrug] option:selected\');\n   	Usage = $(\'select[name=CurrentMedication_CurrentDrugICSNewUsage] option:selected\');\n   	      \n 	Multipliers = Array();\n \n   	if (Usage.val().indexOf(\'-\') > -1)\n 	{\n 		Multipliers = Usage.val().split(\'-\');		\n 	}\n 	else\n 	{\n 		Multipliers.push(Usage.val());\n 	}\n     \n 	totalMultiplier = 1;\n 	\n 	$.each(Multipliers, function(i,Multiplier){\n\n 		if ($.isNumeric(Multiplier))\n 		{\n 			totalMultiplier = totalMultiplier * parseFloat(Multiplier);\n 		} 		\n \n 	});\n 	 \n	if (DrugSelected.attr(\'data-agcbdpequivvalue\') >= 0) {\n	 finalDose = totalMultiplier * DrugSelected.attr(\'data-agcbdpequivvalue\');\n	} else {\n	 finalDose = \'\';           \n	}\n	\n\n	$(\'input[name=CurrentMedication_IcsBdpEquivIncUse]\').val(finalDose);\n}\n\n$(\'select[name=CurrentMedication_CurrentDrugICSNewDrug]\').on(\'change\', function(){agc_calc_BDPEquivalent_ICS();});\n$(\'select[name=CurrentMedication_CurrentDrugICSNewUsage]\').on(\'change\',function(){agc_calc_BDPEquivalent_ICS();});\n',NULL,NULL,'Hidden','N',NULL,0,'CurrentMedication_IcsBdpEquivIncUse',NULL),(398,NULL,'CurrentMedication','ComboBdpEquivIncUse','Char(1)','Calc','\n function agc_calc_BDPEquivalent_Comb() {\n     \n 	DrugSelected = $(\'select[name=CurrentMedication_CurrentDrugCombNewDrug] option:selected\');\n     Usage = $(\'select[name=CurrentMedication_CurrentDrugCombNewUsage] option:selected\');     	 \n \n    	Multipliers = Array();\n    \n     if (Usage.val().indexOf(\'-\') > -1)\n    	{\n    		Multipliers = Usage.val().split(\'-\');		\n    	}\n    	else\n    	{\n    		Multipliers.push(Usage.val());\n    	}   \n   \n   	isSmart = 0;\n    	totalMultiplier = 1;\n    	\n    	$.each(Multipliers, function(i,Multiplier){\n    		if ($.isNumeric(Multiplier))\n    		{\n    			totalMultiplier = totalMultiplier * parseFloat(Multiplier);\n    		}\n   		\n   		if(Multiplier.toUpperCase() == \'SMART\'){\n   			isSmart = 1;\n   		}   		\n    \n    	});\n    	 \n 	if (isSmart == 1) {\n 		finalDose = \'SMART\'\n 	} else if (DrugSelected.attr(\'data-agcbdpequivvalue\') >= 0){\n 		finalDose = totalMultiplier * DrugSelected.attr(\'data-agcbdpequivvalue\');\n 	} else {\n 	   finalDose = \'\';           \n 	}\n 	  \n 	$(\'input[name=CurrentMedication_ComboBdpEquivIncUse]\').val(finalDose);\n 	\n }\n $(\'select[name=CurrentMedication_CurrentDrugCombNewDrug]\').change(function(){agc_calc_BDPEquivalent_Comb();});\n $(\'select[name=CurrentMedication_CurrentDrugCombNewUsage]\').change(function(){agc_calc_BDPEquivalent_Comb();});\n $(\'#CurrentMedication_CurrentDrugICSRemoveNewMeds\').click(function(){$(\'input[name=CurrentMedication_ComboBdpEquivIncUse]\').val(\'\');console.log(\'running\');});\n ',NULL,NULL,'Hidden','N',NULL,0,'CurrentMedication_ComboBdpEquivIncUse',NULL),(400,NULL,'CurrentMed