sit for asthma? */ (newOrKnown.val() == \'New\' || currentMedicationLevel.val() == 0){\n  		outputString = \'Required\';\n  		message = \'As this is the patient\\\'s first visit to the Lung Health software, please proceed to the Clinical Examination\';\n  	} else if /* Or RCP Score >= 2 */ (\n  			(difficultySleeping.val() == \'Y\' && usualAsthmaSymptoms.val() == \'Y\' && interferedWithUsualActivities.val() == \'N\')\n  		|| 	(difficultySleeping.val() == \'Y\' && usualAsthmaSymptoms.val() == \'N\' && interferedWithUsualActivities.val() == \'Y\')\n  		|| 	(difficultySleeping.val() == \'N\' && usualAsthmaSymptoms.val() == \'Y\' && interferedWithUsualActivities.val() == \'Y\')\n  		|| 	(difficultySleeping.val() == \'Y\' && usualAsthmaSymptoms.val() == \'Y\' && interferedWithUsualActivities.val() == \'Y\')\n  		){\n  		outputString = \'Required\';\n  		message = \'As this patient is describing significant symptoms today, please proceed to the Clinical Examination\';\n  	} else if /* Or Diagnostic Doubts */ (diagnosticDoubts == \'NoEvidence\' || diagnosticDoubts == \'Possible\'){\n  		outputString = \'Required\';\n  		message = \'As earlier questions have raised some doubts about this patients asthma diagnosis, please proceed to the Clinical Examination\';\n  	} else if /* Or GP says Clinical Exam is required */ (clinicalExamRequired.val() == \'Requested\'){\n  		outputString = \'Requested\';\n  		message = \'As you have requested a Clinical Examination, please proceed\';\n  	} else {\n  		outputString = \'Not Required\';\n  		message = \'A Clinical Examination is not required today\';\n  	}\n  \n  	if(typeof difficultySleeping.val() != \'undefined\' && typeof usualAsthmaSymptoms.val() != \'undefined\' && typeof interferedWithUsualActivities.val() != \'undefined\'){\n  		$(\'input[name=FirstAssessment_ClinicalExamRequired45]\').val(outputString);\n  		$(\'#text-2120\').html(message);\n  	}\n  \n  }\n  \n  $( document ).ready(function(){agc_calc_ClinicalExamRequired45();});\n  $(\'input[name=CurrentControl_InterferedWithUsualActivities]\').on(\'ifChanged\',function(){agc_calc_ClinicalExamRequired45();});\n  $(\'input[name=CurrentControl_DifficultySleeping]\').on(\'ifChanged\',function(){agc_calc_ClinicalExamRequired45();});\n  $(\'input[name=CurrentControl_UsualAsthmaSymptoms]\').on(\'ifChanged\',function(){agc_calc_ClinicalExamRequired45();});\n  $(\'input[name=FirstAssessment_ClinicalExamRequired]\').on(\'ifChanged\',function(){agc_calc_ClinicalExamRequired45();});\n  \n \n',NULL,NULL,'Hidden','N',NULL,0,'FirstAssessment_ClinicalExamRequired45',NULL),(2137,NULL,'Audit','Flow3001Result','Int',NULL,'fn_Exacerbation1EFFlow(\"Exacerbation,ProfessionalJudgement\",20000,4001)',NULL,NULL,'Hidden',NULL,NULL,0,NULL,NULL),(2138,2082,'Exacerbation','ChestSymptomsWorse','Char(1)',NULL,'\"Y\",\"N\"','\"Yes\",\"No\"',NULL,'RadioButton','Y',NULL,0,NULL,NULL),(2139,2083,'Exacerbation','WakingAtNight','Char(1)',NULL,'\"Y\",\"N\"','\"Yes\",\"No\"',NULL,'RadioButton','Y',NULL,0,NULL,NULL),(2140,2084,'Exacerbation','InterferingWithUsualActivities','Char(1)',NULL,'\"Y\",\"N\"','\"Yes\",\"No\"',NULL,'RadioButton','Y',NULL,0,NULL,NULL),(2141,2085,'Exacerbation','UsingRelieverMoreThanUsual','Char(1)',NULL,'\"Y\",\"N\"','\"Yes\",\"No\"',NULL,'RadioButton','Y',NULL,0,NULL,NULL),(2142,2086,'Exacerbation','PeakFlowLessThanUsual','Char(1)',NULL,'\"Y\",\"N\"','\"Yes\",\"No\"',NULL,'RadioButton','Y',NULL,0,NULL,NULL),(2143,NULL,'Audit','Flow4002Result','Int',NULL,'fn_PlaceholderExitFlow(4004)',NULL,NULL,'Hidden',NULL,NULL,0,NULL,NULL),(2144,2087,'Exacerbation','CompleteSentences','Char(1)',NULL,'\"Y\",\"N\"','\"Yes\",\"No\"',NULL,'RadioButton','Y',NULL,0,NULL,NULL),(2148,2091,'Exacerbation','CurrentSaO2','Float','Range','0-100',NULL,NULL,'TextBox','N',NULL,0,NULL,NULL),(2150,2093,'Exacerbation','ResponseToTreatment','Varchar(50)',NULL,'\"Limited\",\"Dramatic\"','\"Limited Response\",\"Dramatic Response\"',NULL,'RadioButtonVert','Y',NULL,0,NULL,NULL),(2151,NULL,