=\'ClinicalExam_BreathSounds\']\")) != null) {\n 		\n 		if (((HR.val() >= 200 || HR.val() < 50) && PulseConfirmedNormalByGP.val() == \'Abnormal\') || ((RR.val() >= 50 || RR.val() < 8) && RRConfirmedNormalByGP.val() == \'Abnormal\')) {\n 			outputString = \'HR / RR Abnormality\';\n 			$(\'input[name=ClinicalExam_ClinicalExamOutcome]\').val(outputString);\n 		\n 		} else {\n   	\n 			if (RR.val() >= 25 || HR.val() >= 110) {\n 				outputString = \'Raised HR or RR\';\n 			}\n 			else if (AccessoryMuscles.val() == \'Y\' || CentrallyCyanosed.val() == \'Y\' || TracheaPos.val() != \'C\' || Percussion.val() == \'D\' || (BreathSounds.val() == \'A\' && Wheeze.val() != \'Y\')){\n 				outputString = \'Other Abnormality\';\n 			}\n 			else if (AccessoryMuscles.val() == \'N\' && CentrallyCyanosed.val() == \'N\' && TracheaPos.val() == \'C\' && Percussion.val() != \'D\' && (BreathSounds.val() != \'A\' || (BreathSounds.val() == \'A\' && Wheeze.val() == \'Y\'))){\n 				outputString = \'No Alarm\';\n 			}\n 			else {\n 				outputString = \'Error\';\n 			}\n  	\n 			$(\'input[name=ClinicalExam_ClinicalExamOutcome]\').val(outputString);\n 		\n 		}\n  \n  	} else {\n  \n  	$(\'input[name=ClinicalExam_ClinicalExamOutcome]\').val(\'Undefined\');\n  	\n  	}\n  \n }\n    \n $(\'input[name=ClinicalExam_RespiratoryRate]\').change(function(){agc_calc_ClinicalExamOutcomes();});\n $(\'input[name=ClinicalExam_PulseBpm]\').change(function(){agc_calc_ClinicalExamOutcomes();});\n $(\'input[name=ClinicalExam_AccessoryMusclesForBreathing]\').on(\'ifChanged\',function(){agc_calc_ClinicalExamOutcomes();});\n $(\'input[name=ClinicalExam_CentrallyCyanosed]\').on(\'ifChanged\',function(){agc_calc_ClinicalExamOutcomes();});\n $(\'input[name=ClinicalExam_TracheaPos]\').on(\'ifChanged\',function(){agc_calc_ClinicalExamOutcomes();});\n $(\'input[name=ClinicalExam_Percussion]\').on(\'ifChanged\',function(){agc_calc_ClinicalExamOutcomes();});\n $(\'input[name=ClinicalExam_BreathSounds]\').on(\'ifChanged\',function(){agc_calc_ClinicalExamOutcomes();});\n $(\'input[name=ClinicalExam_Wheeze]\').on(\'ifChanged\',function(){agc_calc_ClinicalExamOutcomes();});\n $(\'input[name=ClinicalExam_PulseConfirmedNormalByGP]\').on(\'ifChanged\',function(){agc_calc_ClinicalExamOutcomes();});\n $(\'input[name=ClinicalExam_RRConfirmedNormalByGP]\').on(\'ifChanged\',function(){agc_calc_ClinicalExamOutcomes();});\n \n',NULL,NULL,'Hidden','N',NULL,1,NULL,NULL),(2229,2126,'CurrentControl','Last12MonthsAedOrHospDate','Date','Date','TODAY- 1 YEAR|TODAY',NULL,NULL,'DatePickerMonth','N',NULL,0,'',NULL),(2230,66,'CurrentControl','Last12MonthsAedOrHospLast3MonthsCodeAttached','Char(1)','Calc','function agc_set_DatePicker()\r {\r   	last3Months = $(\'input[name=CurrentControl_Last12MonthsAedOrHospLast3Months]:checked\');\r 	var d = new Date();\r 	var s1 = new Date();\r 	var s2 = new Date();\r 	s1 = new Date(s1.setMonth(s1.getMonth() - 3));\r 	s2 = new Date(s2.setMonth(s2.getMonth() - 12));\r \r 	if (	last3Months.val() != \'\' \r 		&&	last3Months != null \r 		&&	typeof last3Months !== \'undefined\'\r 		&&	agc_getInputValue($(\":input[name=\'CurrentControl_Last12MonthsAedOrHospLast3Months\']\"))!= null){\r  	\r 		if (last3Months.val() == \'Y\') {\r 			$(\'#CurrentControl_Last12MonthsAedOrHospDate-datepicker\').datepicker(\'remove\'); \r 			$(\'#CurrentControl_Last12MonthsAedOrHospDate-datepicker\').datepicker({ \r 			 format: \'mm/yyyy\', \r 			 startView: 2, \r 			 minViewMode: 1, \r 			 startDate: s1, \r 			 endDate: d, \r 			 autoclose: true \r 			 });\r 		}\r 		else {\r 			$(\'#CurrentControl_Last12MonthsAedOrHospDate-datepicker\').datepicker(\'remove\'); \r 			$(\'#CurrentControl_Last12MonthsAedOrHospDate-datepicker\').datepicker({ \r 			 format: \'mm/yyyy\', \r 			 startView: 2, \r 			 minViewMode: 1, \r 			 startDate: s2, \r 			 endDate: s1, \r 			 autoclose: true \r 			 });\r 		}\r 	} 	\r }\r   \r $(\'input[name=CurrentControl_Last12MonthsAedOrHospLast3Months]\').on(\'ifChanged\',function(){agc_set_DatePicker();});\r',NULL,NULL,'Hidden','N',NULL,0,'',NULL),(2231,2127,'NonPharmaRx','DiseaseEducationDownloadDate','Date','Calc','function agc_SetDownloadDate_Disease()\r {\r 	function pad(s) { return (s < 10) ? \'0\' + s : s; }\r 	d = new Date();\r 	dString = pad(d.getDate()) + \'/\' + pad(d.getMonth() +1) + \'/\' + d.getFullYear()\r   	$(\'input[name=NonPharmaRx_DiseaseEducationDownloadDate]\').val(dString);\r }\r   \r $(\"#LinkDiseaseEducation\").click(function(){agc_SetDownloadDate_Disease();});\r',NULL,NULL,'TextBox','N',NULL,1,'NonPharmaRx_DiseaseEducationDownloadDate',NULL),(2232,2128,'NonPharmaRx','MedicationEducationDownloadDate','Date','Calc','function agc_SetDownloadDate_Medication()\r {\r 	function pad(s) { return (s < 10) ? \'0\' + s : s; }\r 	d = new Date();\r 	dString = pad(d.getDate()) + \'/\' + pad(d.getMonth() +1) + \'/\' + d.getFullYear()\r   	$(\'input[name=NonPharmaRx_MedicationEducationDownloadDate]\').val(dString);\r }\r   \r $(\"#LinkMedicationEducation\").click(function(){agc_SetDownloadDate_Medication();});\r',NULL,NULL,'TextBox','N',NULL,1,'NonPharmaRx_MedicationEducationDownloadDate',NULL),(2233,2129,'NonPharmaRx','PersonalActionPlanDownloadDate','Date','Calc','function agc_SetDownloadDate_PersonalActionPlan()\r {\r 	function pad(s) { return (s < 10) ? \'0\' + s : s; }\r 	d = new Date();\r 	dString = pad(d.getDate()) + \'/\' + pad(d.getMonth() +1) + \'/\' + d.getFullYear()\r   	$(\'input[name=NonPharmaRx_PersonalActionPlanDownloadDate]\').val(dString);\r }\r   \r $(\"#LinkPersonalActionPlan\").click(function(){agc_SetDownloadDate_PersonalActionPlan();});\r',NULL,NULL,'TextBox','N',NULL,1,'NonPharmaRx_PersonalActionPlanDownloadDate',NULL),(2235,2016,'FirstAssessment','FastOrStandardTrack','Varchar(50)','Calc',' \nfunction agc_calc_FastOrStandardTrack()\n{\n \n  	if(strScreenName == \'AH\' || strScreenName == \'HS1\' || strScreenName == \'C1\' || strScreenName == \'C1FT\'){\n 	\n 		AssessmentType = agc_getInputValue($(\'input[name=AssessmentDetails_AssessmentType]\')); //76\n 		NewOrKnown = $(\'input[name=FirstAssessment_NewOrKnown]:checked\');\n  		CurrentMedicationLevel = $(\'input[name=CurrentMedication_CurrentMedicationLevel]\');\n  		MedicationLevelAtStartOfLastVisit = $(\'input[name=CurrentMedication_MedicationLevelAtStartOfLastVisit]\'); //2548\n  \n  		if (agc_getInputValue($(\'input[name=CurrentMedication_CurrentMedicationLevel]\')) != null) {\n  		\n 			// First Assessment\n 			if (AssessmentType == \'1A\') {\n 				// New patient, no medication, or Step 4-5\n 				if (NewOrKnown.val() == \'New\' || CurrentMedicationLevel.val() == 0 || CurrentMedicationLevel.val() == 4 || CurrentMedicationLevel.val() == 5) {\n 					outputString = \'Standard Track\';\n 				// Known patient Step 1-3\n 				} else if (NewOrKnown.val() == \'Known\' && CurrentMedicationLevel.val() >= 1 && CurrentMedicationLevel.val() <= 3) {\n 					outputString = \'Fast Track\';\n 				// Error\n 				} else {\n 					outputString = \'Error1\';\n 				}\n 			// Follow-up or Annual Review\n 			} else if (AssessmentType == \'FU\' || AssessmentType == \'AR\') {\n 				// No medication (and Step 1-3 last time)\n 				if (CurrentMedicationLevel.val() == 0 && MedicationLevelAtStartOfLastVisit.val() >= 1 && MedicationLevelAtStartOfLastVisit.val() <= 3) {\n 					outputString = \'Fast Track\';\n 				// Step 1-3\n 				} else if (CurrentMedicationLevel.val() >= 1 && CurrentMedicationLevel.val() <= 3) {\n 					outputString = \'Fast Track\';\n 				// Step 4-5\n 				} else if (CurrentMedicationLevel.val() == 4 || CurrentMedicationLevel.val() == 5) {\n 					outputString = \'Standard Track\';\n 				// Error\n 				} else {\n 					outputString = \'Error2\';\n 				}\n 			// Error\n 			} else {\n 				outputString = \'Error3\';\n 			}\n  		\n  			$(\'input[name=FirstAssessment_FastOrStandardTrack]\').val(outputString);\n  \n  		} else {\n 			$(\'input[name=FirstAssessment_FastOrStandardTrack]\').val(\'Error4\'); 		\n  		}\n 		\n  	}\n 	\n}\n$(\'input[name=CurrentMedication_CurrentMedicationLevel]\').on(\'ifChanged\',function(){agc_calc_FastOrStandardTrack();});\n$(\'input[name=FirstAssessment_NewOrKnown]\').on(\'ifChanged\',function(){agc_calc_FastOrStandardTrack();});\n$( document ).ready(function(){agc_calc_FastOrStandardTrack();});\n',NULL,NULL,'TextBox','N',NULL,0,NULL,NULL),(2236,NULL,'FirstAssessment','NewPatientFirstVisit','Char(1)','Calc',' \nfunction agc_calc_NewPatientFirstVisit()\n{\n	assessmentType = agc_getInputValue($(\'input[name=AssessmentDetails_AssessmentType]\')); //76\n	newOrKnown = $(\'input[name=FirstAssessment_NewOrKnown]:checked\');\n	step13OrNew = $(\'input[name=FirstAssessment_Step13OrNew]:checked\');\n	currentMedication = $(\'input[name=CurrentMedication_CurrentMedicationLevel]\');\n\n	if (assessmentType == \'1A\' && (newOrKnown.val() == \'New\' || step13OrNew.val() == \'New\' || currentMedication.val() == 0)) {\n		outputString = \'Y\';\n	} else if (assessmentType != \'1A\' || (newOrKnown.val() != \'New\' && step13OrNew.val() != \'New\') || currentMedication.val() != 0 ) {\n		outputString = \'N\';\n	} else {\n		outputString = \'E\';\n	}\n\n	$(\'input[name=FirstAssessment_NewPatientFirstVisit]\').val(outputString);\n\n}\n$( document ).ready(function(){agc_calc_NewPatientFirstVisit();});\n',NULL,NULL,'TextBox','N',NULL,0,NULL,NULL),(2238,2131,'FirstAssessment','SecondaryCareAsthmaReferral','Char(1)',NULL,'\"Y\",\"N\"','\"Yes\",\"No\"',NULL,'RadioButton','Y',NULL,0,'FirstAssessment_SecondaryCareAsthmaReferralLastTime',NULL),(2239,2132,'FirstAssessment','SecondaryCareAsthmaReferralDetails','Varchar(255)',NULL,NULL,NULL,NULL,'TextBox','Y',NULL,0,'FirstAssessment_SecondaryCareAsthmaReferralDetailsLastTime',NULL),(2240,NULL,'FirstAssessment','DiagnosticConfirmation45','Varchar(50)',NULL,NULL,NULL,NULL,'TextBox','N',NULL,0,'FirstAssessment_DiagnosticConfirmation45',NULL),(2241,2135,'FirstAssessment','NextReviewWeeks','Varchar(50)','Calc','\nfunction agc_calc_NextReviewWeeks(){\n  	\n	/*\n	RULE 1 - NEW PATIENT ON FIRST ASSESSMENT STARTING THERAPY FOR THE FIRST TIME - 4 WEEKS\n	RULE 2 - ANNUAL REVIEW OR FOLLOW-UP RE-STARTING THERAPY - 4 WEEKS\n	STEP 1-3:\n		RULE 3 - STARTING SMART THERAPY - 3 MONTHS\n		RULE 4 - WHAT IS THE LEVEL OF RECORDED CONTROL?  		\n			GOOD = 1 YEAR\n			PARTIAL = 6 MONTHS\n			POOR = 3 MONTHS	\n	STEP 4-5:\n		RULE 5 - EXACERBATION IN LAST 3 MONTHS - 3 MONTHS	\n		RULE 6 - WHAT IS THE LEVEL OF RECORDED CONTROL?  		\n			GOOD = 1 YEAR\n			PARTIAL = 6 MONTHS\n			POOR = 3 MONTHS	\n	*/\n    \n	//CHECK THERAPY CHANGES\n    agc_calc_TherapyChanges.call();\n	\n	var AssessmentType = $(\'input[name=AssessmentDetails_AssessmentType]:checked\'); //76\n	var FastOrStandardTrack = $(\'input[name=FirstAssessment_FastOrStandardTrack]\'); //2235	\n	var therapyStream = $(\'input[name=Therapy_TherapyStream]\');	\n	var asthmaReferral = $(\'input[name=FirstAssessment_SecondaryCareAsthmaReferral]:checked\'); //2238\n	var asthmaNoReferralReason = $(\'select[name=FirstAssessment_ReasonForNoReferral] option:selected\'); //2722	\n	var currentMedicationLevel = $(\'input[name=CurrentMedication_CurrentMedicationLevel]\'); //400\n	\n	// THERAPY CHANGES\n	var therapyChanges = $(\'input[name=MedicationReview_TherapyChanges]\');\n	var therapyChanged = \'\';	\n	\n	if(therapyChanges.val() == 0){\n		therapyChanged = \'N\';\n	} else if(therapyChanges.val() == 1){\n		therapyChanged = \'1\';\n	} else {\n		therapyChanged = \'>1\';\n	}  \n  	\n  	// S(MART) THERAPY\n  	var comboNewUsage = obj_agc_Review.MedicationReview_ReviewDrugCombNewUsage;\n  	var smartTherapy;\n  	\n	if(comboNewUsage != null){\n		if(comboNewUsage.indexOf(\'mart\') >= 1){\n			smartTherapy = \'Y\';\n		}\n	}\n    	\n  	// EXACERBATIONS\n  	var recentExacerbation1 = $(\'input[name=CurrentControl_Last12MonthsOralSteroidsLast3Months]:checked\');\n	var recentExacerbation2 = $(\'input[name=CurrentControl_Last12MonthsAntibioticsLast3Months]:checked\');\n	var recentExacerbation3 = $(\'input[name=CurrentControl_Last12MonthsCallOutLast3Months]:checked\');\n	var recentExacerbation4 = $(\'input[name=CurrentControl_Last12MonthsAedOrHospLast3Months]:checked\');\n  	var recentExacerbation;\n  	\n	if(recentExacerbation1.val() == \'Y\' || recentExacerbation2.val() == \'Y\' || recentExacerbation3.val() == \'Y\' || recentExacerbation4.val() == \'Y\'){\n		recentExacerbation = \'Y\';\n	}\n  	\n  	// CURRENT CONTROL\n  	var currentControl13 = $(\'input[name=FirstAssessment_CurrentControl13]\');\n    var currentControl45 = $(\'input[name=FirstAssessment_CurrentControl45]\');\n  	var currentControl = \'\';\n	\n	if (FastOrStandardTrack.val() == \'Fast Track\') {\n		currentControl = currentControl13.val();\n	} else if (FastOrStandardTrack.val() == \'Standard Track\') {\n		currentControl = currentControl45.val();\n	} else {	\n		currentControl = currentControl45.val() || currentControl13.val();\n	}\n	\n	// TEXT VARIABES\n	var reviewWeeks;\n	var messageOption;\n	\n    var defaultReviewWeeks = 52;\n	var defaultMessageOption = \'Z\';\n	\n  	var reviewWeeksText = \'\';	\n  	var message = \'\';	\n  	\n  	// RULE 1: NEW PATIENT ON FIRST ASSESSMENT STARTING THERAPY FOR THE FIRST TIME\n  	if(currentMedicationLevel.val() == 0 && AssessmentType.val() == \'1A\'){\n  		reviewWeeks = 4;\n  		messageOption = \'A\';\n	// RULE 2: ANNUAL REVIEW OR FOLLOW-UP RE-STARTING THERAPY\n	} else if (currentMedicationLevel.val() == 0 && AssessmentType.val() != \'1A\'){\n  		reviewWeeks = 4;\n  		messageOption = \'B\';\n  	// Step 1-3\n  	} else if(currentMedicationLevel.val() >= 1 && currentMedicationLevel.val() <= 3) {\n  		// RULE 3: STARTING SMART THERAPY  \n		if (smartTherapy == \'Y\') {\n			reviewWeeks = 13;\n			messageOption = \'C\';\n		// RULE 4: WHAT IS THE LEVEL OF RECORDED CONTROL?\n  		} else if (smartTherapy != \'Y\') {\n			switch(currentControl){\n  				case \'Good\':\n  					reviewWeeks = 52;\n  					messageOption = \'D\';\n  					break;\n  				case \'Partial\':\n  					reviewWeeks = 26;\n  					messageOption = \'E\';\n  					break;\n  				case \'Poor\':\n  					reviewWeeks = 13;\n  					messageOption = \'F\';\n  					break;\n				default:\n					reviewWeeks = defaultReviewWeeks;\n					messageOption = defaultMessageOption;\n  			}\n		// DEFAULT\n		} else {\n			reviewWeeks = defaultReviewWeeks;\n			messageOption = defaultMessageOption;\n		}\n  	// Step 4-5\n  	} else if(currentMedicationLevel.val() >= 4 && currentMedicationLevel.val() <= 5) {\n  		// RULE 5: EXACERBATION IN LAST 3 MONTHS\n  		if(recentExacerbation == \'Y\'){\n  			reviewWeeks = 13;\n  			messageOption = \'G\';\n		// RULE 6: WHAT IS THE LEVEL OF RECORDED CONTROL? 	\n  		} else if (recentExacerbation != \'Y\') {\n  			switch(currentControl){\n  				case \'Good\':\n  					reviewWeeks = 52;\n  					messageOption = \'D\';\n  					break;\n  				case \'Partial\':\n  					reviewWeeks = 26;\n  					messageOption = \'E\';\n  					break;\n  				case \'Poor\':\n  					reviewWeeks = 13;\n  					messageOption = \'F\';\n  					break;\n				default:\n					reviewWeeks = defaultReviewWeeks;\n					messageOption = defaultMessageOption;\n  			}\n  		// DEFAULT\n		} else {\n			reviewWeeks = defaultReviewWeeks;\n			messageOption = defaultMessageOption;\n		}\n	// DEFAULT\n  	} else {\n  		reviewWeeks = defaultReviewWeeks;\n		messageOption = defaultMessageOption;\n  	}\n	\n	switch(reviewWeeks) {\n		case 4:\n			reviewWeeksText = \'one month\';\n			break;\n		case 13:\n			reviewWeeksText = \'three months\';\n			break;\n		case 26:\n			reviewWeeksText = \'six months\';\n			break;\n		case 52:\n			reviewWeeksText = \'one year\';\n			break;\n	}\n	\n	// Set field\n  	$(\'input[name=FirstAssessment_NextReviewWeeks]\').val(reviewWeeksText);\n	\n	// THERAPY CHANGES SUPPLEMENTARY TEXT\n	if(therapyChanged == \'1\'){\n		message = \'<p><b>You have made a change to the medication regimen. The usual review would be at \' + reviewWeeksText + \'. Consider whether the change you have made justifies an earlier review.</b></p><p>\';\n	} else if(therapyChanged == \'>1\'){\n		message = \'<p><b>You have made some changes to the medication regimen. The usual review would be at \' + reviewWeeksText + \'. Consider whether the changes you have made justify an earlier review.</b></p><p>\';\n	}\n  	\n	// REFERRAL ALTERNATIVE TEXT (IS THIS STILL REQUIRED?)\n  	if((therapyStream.val() == \'STD8\' || therapyStream.val() == \'STD10\') && asthmaReferral.val() != \'Y\'){\n		message += \'<p>A referral to secondary care was recommended but not made, with the reason: <i>\"\' + asthmaNoReferralReason.text() + \'</i>\". The standard review would be in \' + reviewWeeksText + \' time. Do you wish to make this sooner?</p>\';\n		\n	// MAIN TEXT\n	} else {\n   		\n		  switch (messageOption) {\n			//NEW PATIENT ON FIRST ASSESSMENT STARTING THERAPY FOR THE FIRST TIME - 4 WEEKS\n			case \'A\':\n				message += \'As this patient is being started on asthma therapy for the first time, an early follow up is recommended so that a) their response to therapy can be assessed b) their use of medications checked and c) that their understanding of their condition is good. Suggested follow up: \' + reviewWeeksText + \'.\';\n				break;\n			//ANNUAL REVIEW OR FOLLOW-UP RE-STARTING THERAPY - 4 WEEKS\n			case \'B\':\n				message += \'As this patient is being re-started on asthma therapy following a withdrawal of previous therapy, an early follow up is recommended so that a) their response to therapy can be assessed b) their use of medications checked and c) that their understanding of their condition is good. Suggested follow up: \' + reviewWeeksText + \'.\';\n				break;\n			//STEP 1-3 STARTING SMART THERAPY - 3 MONTHS\n			case \'C\':\n				message += \'As the patient has just started a S(MART) therapy, it is suggested that a follow up appointment be scheduled for \' + reviewWeeksText + \' time to check response.\';\n			  break;\n			//GOOD CONTROL (1 YEAR)\n			case \'D\':\n				message += \'This patient has good asthma control and thus the next review should be scheduled as the next annual review.\';\n			  break;\n			//PARTIAL CONTROL (6 MONTHS)\n			case \'E\':\n				message += \'This patient has partial control of their asthma and so it may be wise to plan to review earlier than the next annual asthma review. Suggested follow up: \' + reviewWeeksText + \'.\';\n			  break;\n			//POOR CONTROL (3 MONTHS)\n			case \'F\':\n				message += \'This patient has poor control of their asthma and thus an early review is advised to see if any changes are working and if not to adjust therapy further. Suggested follow up: \' + reviewWeeksText + \'.\';\n			  break;\n			//STEP 4-5 EXACERBATION IN LAST 3 MONTHS - 3 MONTHS	\n			case \'G\':\n				message += \'This patient has been noted to have had a recent asthma exacerbation which means they are potentially at risk of another one regardless of level of control today. Thus an earlier follow up is recommended to ensure that control has been effectively established. Suggested follow up: \' + reviewWeeksText + \'.\';\n			  break;\n			//DEFAULT: NO CHANGE IN THERAPY, WELL CONTROLLED (12 MONTHS)\n			case \'Z\':\n				message += \'As there has been no increase in therapy and the patient is well controlled, it is suggested that a follow up appointment be scheduled for \' + reviewWeeksText + \'s time.\';\n				break;			  \n		}\n	\n	}\n	\n	message += \'</p>\';\n   	\n   	//Set text on page to message\n   	$(\'#text-2103\').html(message);\n   	\n   	//Set selected on dropdown\n   	//$(\'select[name=FirstAssessment_NextReviewWeeksHCP]\').val(newReviewWeeks);\n   	 \n}\n\n$( document ).ready(function(){agc_calc_NextReviewWeeks();});\n',NULL,NULL,'TextBox','N',NULL,0,NULL,NULL),(2242,NULL,'MedicationReview','TherapyChanges','Int','Calc','\nfunction agc_calc_TherapyChanges(){\n  \n  	var c1 = $(\'input[name=MedicationReview_ReviewDrugISABAChangeType]\').val();\n  	var c2 = $(\'input[name=MedicationReview_ReviewDrugICSChangeType]\').val();\n  	var c3 = $(\'input[name=MedicationReview_ReviewDrugILABAChangeType]\').val();\n  	var c4 = $(\'input[name=MedicationReview_ReviewDrugCombChangeType]\').val();\n  	var c5 = $(\'input[name=MedicationReview_ReviewDrugILAAChangeType]\').val();\n  	var c6 = $(\'input[name=MedicationReview_ReviewDrugLTRAChangeType]\').val();\n  	var c7 = $(\'input[name=MedicationReview_ReviewDrugTheophyllineChangeType]\').val();\n  	var c8 = $(\'input[name=MedicationReview_ReviewDrugPDE4InhibitorChangeType]\').val();\n  	var c9 = $(\'input[name=MedicationReview_ReviewDrugMucolyticChangeType]\').val();\n  	var c10 = $(\'input[name=MedicationReview_ReviewDrugISAAChangeType]\').val();\n  	var c11 = $(\'input[name=MedicationReview_ReviewDrugOBAChangeType]\').val();\n  	var c12 = $(\'input[name=MedicationReview_ReviewDrugNebSABAChangeType]\').val();\n  	var c13 = $(\'input[name=MedicationReview_ReviewDrugNebSAAChangeType]\').val();\n  	var c14 = $(\'input[name=MedicationReview_ReviewDrugCromolynsChangeType]\').val(); //2262\n  	var c15 = $(\'input[name=MedicationReview_ReviewDrugOralSteroidsChangeType]\').val();\n 	var c16 = $(\'input[name=MedicationReview_ReviewDrugInjectableBetaAgonistChangeType]\').val(); //2610\n 	var c17 = $(\'input[name=MedicationReview_ReviewDrugLABALAMAChangeType]\').val(); //2618\n 	var c18 = $(\'input[name=MedicationReview_ReviewDrugNebulisedSABASAMAChangeType]\').val(); //2626\n 	var c19 = $(\'input[name=MedicationReview_ReviewDrugLongActingInjectableSteroidsChangeType]\').val(); //2634\n  \n  	var therapyChangesArrray = [c1,c2,c3,c4,c5,c6,c7,c8,c9,c10,c11,c12,c13,c14,c15,c16,c17,c18,c19];\n  	var therapyChanges = 0;\n  \n  	for	(index = 0; index < therapyChangesArrray.length; index++){\n  		if(therapyChangesArrray[index] != \'\'){\n  			therapyChanges += 1;\n  		}\n  	}\n  	\n	$(\'input[name=MedicationReview_TherapyChanges]\').val(therapyChanges);  	\n}\n',NULL,NULL,'TextBox','N',NULL,0,NULL,NULL),(2243,2135,'FirstAssessment','NextReviewWeeksHCP','Int',NULL,'4,13,26,52','\"One Month\",\"Three Months\",\"Six Months\",\"One Year\"',NULL,'DropDown','Y',NULL,0,NULL,NULL),(2244,2136,'NonPharmaRx','BoneProphylaxis','Char(1)',NULL,'\"Y\",\"N\"','\"Yes\",\"No\"',NULL,'RadioButton','Y',NULL,0,NULL,NULL),(2245,NULL,'Audit','Flow5001Result','Int',NULL,'fn_LungFunctionPefOrFev1(\"Spirometry,SurgeryLast2weeksAbdominal\",\"Spirometry,SurgeryLast2weeksThoracic\", \"Spirometry,SurgeryLast2weeksEye\",\"Spirometry,PneumothoraxLast2Weeks\",\"Spirometry,SpirometryNotPerformedAnyOtherReason\",\"LungFunction,IsSpirometryAvailable\",5002,5003,20000)',NULL,NULL,'Hidden',NULL,NULL,0,NULL,NULL),(2246,NULL,'Audit','Flow5002Or2003Result','Int',NULL,'fn_SpiroOrPEFFlow(\"AssessmentDetails,AssessmentType\",\"LungFunction,LungFunctionOutcome\",\"Spirometry,MaximumEffort\",\"LungFunction,LungFunctionPerformed\",\"Exacerbation,PEFNotAvailable\",\"Spirometry,ReferSpiroRestrictiveReversable\",1008,5004,20000)',NULL,NULL,'Hidden',NULL,NULL,0,NULL,NULL),(2249,NULL,'LungFunction','LungFunctionPerformed','Varchar(255)',NULL,'fn_LungFunctionPerformed(\"Spirometry,SurgeryLast2weeksAbdominal\",\"Spirometry,SurgeryLast2weeksThoracic\", \"Spirometry,SurgeryLast2weeksEye\",\"Spirometry,PneumothoraxLast2Weeks\",\"Spirometry,SpirometryNotPerformedAnyOtherReason\",\"LungFunction,IsSpirometryAvailable\")',NULL,NULL,'Hidden','N',NULL,0,NULL,NULL),(2250,2137,'NonPharmaRx','CheckInhalerTechniqueNow','Char(1)',NULL,'\"Y\",\"N\"','\"Yes\",\"No\"',NULL,'RadioButton','Y',NULL,0,'NonPharmaRx_CheckInhalerTechniqueNowLastTime',NULL),(2251,NULL,'Audit','Flow1101Result','Int',NULL,'fn_TrackTypeFlow(\"FirstAssessment,NewOrKnown\",\"Exacerbation,PEFNotAvailable\",1003,1002,20000)',NULL,NULL,'Hidden',NULL,NULL,0,NULL,NULL),(2252,NULL,'Exacerbation','PEFMessage','Varchar(255)','Calc','\nfunction agc_calc_PEFMessage() {\n     \n  	currentPEF = $(\'input[name=PEF_CurrentPEFPctPredicted]\');\n  	predictedOrBest = $(\'input[name=PEF_BestOrPredicted]:checked\');\n    \n  	messageOption = \'\';\n     \n    if(currentPEF.val() == \'\' || currentPEF == null){\n  		messageOption = \'F\'\n  	} else if(currentPEF.val() < 50){\n  		messageOption = \'A\'\n  	} else if(currentPEF.val() >= 50 && currentPEF.val() < 60){\n  		messageOption = \'B\'\n  	} else if(currentPEF.val() >= 60 && currentPEF.val() < 70){\n  		messageOption = \'C\'\n  	} else if(currentPEF.val() >= 70 && currentPEF.val() < 85){\n  		messageOption = \'D\'\n  	} else if(currentPEF.val() >= 85){\n  		messageOption = \'E\'\n  	} else {\n  		messageOption = \'F\'\n  	}\n  	\n  	if(messageOption == \'A\' || messageOption == \'B\' || messageOption == \'C\' || messageOption == \'D\'){\n  		$(\'#Exacerbation_PeakFlowLessThanUsual_0\').iCheck (\'check\');\n  	} else if (messageOption == \'E\') {\n  		$(\'#Exacerbation_PeakFlowLessThanUsual_1\').iCheck (\'check\');\n  	}\n         \n    switch (messageOption) {\n       case \'A\':\n           message = \'PEF today is \' + currentPEF.val() + \'% of known \' + predictedOrBest.val() + \' which is suggests a possible need for hospitalisation.\';\n           break;\n       case \'B\':\n           message = \'PEF today is \' + currentPEF.val() + \'% of known \' + predictedOrBest.val() + \' which is markedly reduced.\';\n           break;\n       case \'C\':\n  		 message = \'PEF today is \' + currentPEF.val() + \'% of known \' + predictedOrBest.val() + \' which is significantly reduced.\';\n           break;\n       case \'D\':\n           message = \'PEF today is \' + currentPEF.val() + \'% of known \' + predictedOrBest.val() + \' which is slightly reduced.\';\n           break;\n       case \'E\':\n           message = \'PEF today is \' + currentPEF.val() + \'% of known \' + predictedOrBest.val() + \' which is in the normal range.\';\n           break;\n       case \'F\':\n           message = \'PEF has not currently been entered today; please do this on the next screen if possible.\';\n	default: \n	message = \'\';\n     \n    }\n        \n  	$(\'input[name=Exacerbation_PEFMessage]\').val(messageOption);\n  	$(\'#text-2105\').html(message);\n	\n}   \n$( document ).ready(function(){agc_calc_PEFMessage();});\n',NULL,NULL,'TextBox','N',NULL,0,NULL,NULL),(2253,2138,'Exacerbation','HomePeakFlows','Char(1)',NULL,'\"Y\",\"N\"','\"Yes\",\"No\"',NULL,'RadioButton','Y',NULL,0,NULL,NULL),(2254,2139,'NonPharmaRx','LastFluVaccinationDate','Date','Date','TODAY- 2 YEAR|TODAY',NULL,NULL,'DatePickerMonth','N',NULL,0,'NonPharmaRx_LastFluVaccinationDate',NULL),(2255,2139,'NonPharmaRx','LastFluVaccinationNever','Varchar(255)',NULL,NULL,'None in the Last 2 Years',NULL,'CheckBox','N',NULL,0,'NonPharmaRx_LastFluVaccinationNever',NULL),(2256,2140,'NonPharmaRx','LastPneumococcalVaccinationDate','Date','Date','TODAY- 50 YEAR|TODAY',NULL,NULL,'DatePickerMonth','N',NULL,0,'NonPharmaRx_LastPneumococcalVaccinationDate',NULL),(2257,2140,'NonPharmaRx','LastPneumococcalVaccinationNever','Varchar(255)',NULL,NULL,'None in the Last 5 Years',NULL,'CheckBox','N',NULL,0,'NonPharmaRx_LastPneumococcalVaccinationNever',NULL),(2258,NULL,'NonPharmaRx','BookPneumococcalVaccination','Char(1)',NULL,'\"T\",\"Y\",\"N\",\"X\"','\"Vaccinate patient today\",\"Book patient in for vaccination\",\"Patient declines to have pneumococcal vaccination\",\"Pneumococcal vaccination not currently available\"',NULL,'RadioButtonVert','Y',NULL,0,'NonPharmaRx_BookPneumococcalVaccinationLastTime',NULL),(2259,NULL,'NonPharmaRx','PneumococcalVaccineUpToDate','Char(1)',NULL,NULL,NULL,NULL,'TextBox','N',NULL,0,'NonPharmaRx_PneumococcalVaccineUpToDate',NULL),(2261,NULL,'MedicationReview','ReviewDrugCromolyns','Binary','DrugReview','false|bd - 1 puff,tds - 1 puff,qds - 1 puff,prn - 1 puff,bd - 2 puffs,tds - 2 puffs,qds - 2 puffs,prn - 2 puffs|Cromolyns','Change',NULL,'Button',NULL,NULL,0,'CurrentMedication_CurrentDrugCromolyns',2),(2262,NULL,'MedicationReview','ReviewDrugCromolynsChangeType','Varchar(255)',NULL,NULL,NULL,NULL,'TextBox',NULL,NULL,0,NULL,NULL),(2263,NULL,'MedicationReview','ReviewDrugCromolynsNewDrug','Varchar(255)','Data','Drugs,0',NULL,NULL,'ComboBox',