"CurrentControl,Last12MonthsAedOrHospMonth\",\"CurrentControl,Last12MonthsAedOrHospYear\",\"CurrentControl,Last12MonthsAedOrHospDetails\",\"PEF,CurrentPEFPctPredicted\",\"CurrentControl,AsthmaControlScore\",\"Spirometry,PercentPredictedFEV1\",\"LungFunction,LungFunctionPerformed\",\"CurrentMedication,CurrentMedicationLevel\",\"FirstAssessment,CurrentControl45\",\"FirstAssessment,CurrentControl13\",\"FirstAssessment,FastOrStandardTrack\",\"AssessmentDetails,AssessmentType\")',NULL,NULL,'Hidden','N',NULL,0,NULL,NULL),(2559,NULL,'Spirometry','UpdateSecondaryCareReferralCodeAttached','Int','Calc',' \nfunction agc_calc_UpdateSecondaryCareReferral()\n	{\n\n		/*var SummarySoFarOptions = $(\'input[name=Spirometry_SummarySoFarOptions]:checked\');\n		var OriginalReferralField = $(\'input[name=FirstAssessment_SecondaryCareAsthmaReferral]:checked\');\n\n		if(SummarySoFarOptions.val() == \'ReferralContinue\'){\n		$(\'#FirstAssessment_SecondaryCareAsthmaReferral_0\').iCheck (\'check\');\n		} else {\n		$(\'#FirstAssessment_SecondaryCareAsthmaReferral_1\').iCheck (\'check\');\n		}*/\n\n	}\n\n$( document ).ready(function(){agc_calc_UpdateSecondaryCareReferral();});\n$(\'input[name=Spirometry_SummarySoFarOptions]\').on(\'ifChanged\',function(){agc_calc_UpdateSecondaryCareReferral();});\n',NULL,NULL,'Hidden','N',NULL,0,NULL,NULL),(2560,NULL,'NonPharmaRx','VaccinationsCodeAttached','Int','Calc','\nvar bookFluVaccinationSet = 0;\nvar originalFluVaccinationDateString = $(\'input[name=NonPharmaRx_LastFluVaccinationDate]\').val();\n    \nfunction agc_calc_VaccinationCode_Flu() {\n    	   \n	//Date variables\n	var currentDate = new Date();\n	var currentMonth = currentDate.getMonth();\n	var currentYear = currentDate.getFullYear();\n	var currentDateString = (\'0\' + parseInt(currentMonth+1) + \'/\' + currentYear).slice(-7);\n	\n	//Flu variables\n	var fluVaccinationDateString = $(\'input[name=NonPharmaRx_LastFluVaccinationDate]\');\n	var fluVaccinationNever = $(\'input[name=NonPharmaRx_LastFluVaccinationNever]:checked\');\n	var fluBookFluVaccination = $(\'input[name=NonPharmaRx_BookFluVaccination]:checked\');\n	\n	var fluSeasonStartMonth = 7; //7 - August\n	var fluSeasonEndMonth = 11; //11 - December\n	var fluLastSeasonStartDate = new Date(currentYear-1,fluSeasonStartMonth);\n	\n	var fluVaccinationParts = fluVaccinationDateString.val().split(\'/\');\n	var fluVaccinationDate = new Date(fluVaccinationParts[1],fluVaccinationParts[0]-1);\n	\n	var messageOptionFlu = \'\';\n	var messageFlu = \'\';\n	var inFluSeason = \'\';\n	var disableVaccinateToday = \'\';\n	\n	/*********************************************************************/	\n	//	FLU\n	/*********************************************************************/	\n	\n	//Define flu Season\n	if(fluSeasonStartMonth < fluSeasonEndMonth){ //Does NOT span year end\n		var fluSeasonStartDate = new Date(currentYear,fluSeasonStartMonth);\n		var fluSeasonEndDate = new Date(currentYear,fluSeasonEndMonth+1);\n		fluSeasonEndDate.setDate(fluSeasonEndDate.getDate()-1);\n	} else if (fluSeasonStartMonth > fluSeasonEndMonth){ //DOES span year end\n		if(currentMonth > fluSeasonEndMonth){ //Past end of last flu season\n			var fluSeasonStartDate = new Date(currentYear,fluSeasonStartMonth);\n			var fluSeasonEndDate = new Date(currentYear+1,fluSeasonEndMonth+1);\n			fluSeasonEndDate.setDate(fluSeasonEndDate.getDate()-1);\n		} else { //NOT past end of last flu season\n			var fluSeasonStartDate = new Date(currentYear-1,fluSeasonStartMonth);\n			var fluSeasonEndDate = new Date(currentYear,fluSeasonEndMonth+1);\n			fluSeasonEndDate.setDate(fluSeasonEndDate.getDate()-1);\n		}\n	}\n	\n	//In flu season?\n	if(currentDate >= fluSeasonStartDate && currentDate <= fluSeasonEndDate){\n		inFluSeason = \'Y\';\n	} else {\n		inFluSeason = \'N\';\n	}\n \n	if(bookFluVaccinationSet != 1){\n\n		$(\'#layout-holder-2579\').show();\n		$(\'#layout-holder-2580\').show();\n		\n		//Flu Vaccine up to date this season (in season)\n		if(inFluSeason == \'Y\' && fluVaccinationDate >= fluSeasonStartDate){\n			messageOptionFlu = \'A\';\n			disableVaccinateToday = \'Y\';\n		//Flu Vaccine last season (in season)\n		} else if(inFluSeason == \'Y\' && fluVaccinationDate < fluSeasonStartDate && fluVaccinationDate >= fluLastSeasonStartDate){\n			messageOptionFlu = \'B\';\n		//Flu Vaccine not up to date (in season)\n		} else if(inFluSeason == \'Y\' && (fluVaccinationDate < fluLastSeasonStartDate || fluVaccinationNever.val() == \'Y\')){\n			messageOptionFlu = \'C\';\n		//Flu Vaccine up to date (out of season)\n		} else if (inFluSeason == \'N\' && fluVaccinationDate >= fluLastSeasonStartDate){\n			messageOptionFlu = \'D\';\n			disableVaccinateToday = \'Y\';\n		//Flu Vaccine not up to date (out of season)\n		} else if (inFluSeason == \'N\' && (fluVaccinationDate < fluLastSeasonStartDate || fluVaccinationNever.val() == \'Y\')){\n			messageOptionFlu = \'E\';\n		//Default\n		} else {\n			$(\'#layout-holder-2579\').hide();\n			$(\'#layout-holder-2580\').hide();\n		}\n		\n		switch (messageOptionFlu) {\n		  case \'A\':\n			  messageFlu = \'Based on the information provided, above, this patient\\\'s flu vaccination is up to date this season. Do you wish to book for a vaccination in the next autumn and put reminder in the appointments list for patient in this program?\';\n			  break;\n		  case \'B\':\n			  messageFlu = \'Based on the information provided, vaccination with current strain of flu vaccine is not up to date. Do you wish to vaccinate patient now or book for a vaccination in the next few days / weeks and put a reminder in the appointments list for patient in this program?\';\n			  break;\n		  case \'C\':\n			  messageFlu = \'Based on the information provided, vaccination with current strain of flu vaccine is not up to date. Do you wish to vaccinate patient now or book for a vaccination in the next few days / weeks and put a reminder in the appointments list for patient in this program?\';\n			  break;\n		  case \'D\':\n			  messageFlu = \'Based on the information provided, above, this patient\\\'s flu vaccination is up to date as the patient was vaccinated last season. Do you wish to book for a vaccination in the next autumn and put a reminder in the appointments list for patient in this program?\';\n			  break;\n		  case \'E\':\n			  messageFlu = \'Based on the information provided, vaccination with current strain of flu vaccine is not up to date. Do you wish to book for a vaccination in the next autumn and put a reminder in the appointments list for patient in this program?\';\n			  break;\n		  default:\n			  messageFlu = \'Error\';\n		}\n		\n		if(disableVaccinateToday == \'Y\'){\n			$(\'#NonPharmaRx_BookFluVaccination_0\').iCheck(\'disable\');\n		}else{\n			$(\'#NonPharmaRx_BookFluVaccination_0\').iCheck(\'enable\');\n		}\n	\n		messageFlu += \'</br>N.B. For this application, the vaccination season is considered to run between August and December each year.\';\n		\n		//Set message field and on screen\n		$(\'input[name=NonPharmaRx_FluVaccineUpToDate]\').val(messageOptionFlu);\n		$(\'#text-2108\').html(messageFlu);\n		\n	}\n	\n	//Disable / enable flu check box when valid date is added\n	if(fluVaccinationDate == \'Invalid Date\'){\n		$(\'#NonPharmaRx_LastFluVaccinationNever\').iCheck(\'enable\');\n	} else {\n		$(\'#NonPharmaRx_LastFluVaccinationNever\').iCheck(\'disable\');\n	}\n	\n	//Disable / enable flu date picker when \'none in last two years\' checkbox is checked\n	var calcStartDate = new Date();\n	var calcStartDate = new Date(calcStartDate.setMonth(calcStartDate.getMonth() - 24));\n	\n	if(fluVaccinationNever.val() != \'Y\' || typeof fluVaccinationNever.val() == \'undefined\'){\n		$(\'#NonPharmaRx_LastFluVaccinationDate\').prop(\'disabled\', false);\n		$(\'#NonPharmaRx_LastFluVaccinationDate-datepicker\').datepicker({ \n															 format: \'mm/yyyy\',\n															 startView: 2, \n															 minViewMode: 1, \n															 startDate: calcStartDate, \n															 endDate: 