tBox','N',NULL,1,'DiagnosisBasis_TestsSputumEosinophila',NULL),(2714,NULL,'DiagnosisBasis','TestsSputumEosinophilaLastTime','Char(1)',NULL,NULL,NULL,NULL,'TextBox','N',NULL,1,'DiagnosisBasis_TestsSputumEosinophilaLastTime',NULL),(2715,NULL,'DiagnosisBasis','SpirometryFEV1OverFVC','Char(1)',NULL,NULL,NULL,NULL,'TextBox','N',NULL,1,'DiagnosisBasis_SpirometryFEV1OverFVC',NULL),(2716,NULL,'DiagnosisBasis','SpirometryFEV1OverFVCLastTime','Char(1)',NULL,NULL,NULL,NULL,'TextBox','N',NULL,1,'DiagnosisBasis_SpirometryFEV1OverFVCLastTime',NULL),(2717,NULL,'CurrentMedication','CurrentOtherDrugsA','Char(1)',NULL,NULL,NULL,NULL,'Hidden','N',NULL,1,'CurrentMedication_CurrentOtherDrugsA',1),(2718,NULL,'CurrentMedicationLastVisit','CurrentOtherDrugsA','Char(1)',NULL,NULL,NULL,NULL,'Hidden','N',NULL,1,NULL,NULL),(2719,NULL,'CurrentMedication','CurrentOtherDrugsD','Char(1)',NULL,NULL,NULL,NULL,'Hidden','N',NULL,1,'CurrentMedication_CurrentOtherDrugsD',1),(2720,NULL,'CurrentMedicationLastVisit','CurrentOtherDrugsD','Char(1)',NULL,NULL,NULL,NULL,'Hidden','N',NULL,1,NULL,NULL),(2721,NULL,'FirstAssessment','BestPEFLastTime','Float',NULL,NULL,NULL,NULL,'Hidden','N',NULL,0,'FirstAssessment_BestPEFLastTime',NULL),(2722,NULL,'FirstAssessment','ReasonForNoReferral','Varchar(255)',NULL,'\"Manage Locally\",\"Under Specialist Clinic\",\"Patient Refused\"','\"I am happy to continue management locally\",\"The patient is already under the specialist clinic\",\"This patient does not wish to be referred to hospital clinic\"',NULL,'DropDown',NULL,NULL,0,NULL,NULL),(2723,NULL,'PEF','PEFCodeAttached','Varchar(255)','Calc','\nfunction agc_calc_PEF()\n{\n \n 	age = $(\'input[name=InitialPatientDetails_Age]\');\n 	sex = $(\'select[name=InitialPatientDetails_Sex]\');\n 	height = $(\'input[name=ClinicalExam_HeightM]\'); \n 	\n 	PEF1 = $(\'input[name=PEF_PreviousPEF1]\');\n    currentPef = $(\'input[name=PEF_CurrentPEF]\');\n 	bestPEFLastTime = $(\'input[name=FirstAssessment_BestPEFLastTime]\');\n 	\n 	bestOrPredicted = $(\'input[name=PEF_BestOrPredicted]:checked\');\n 	bestOrPredictedLastTime = $(\'input[name=PEF_BestOrPredictedLastTime]:checked\');\n 	bestPef = $(\'input[name=FirstAssessment_BestPEF]\');\n 	predPef = $(\'input[name=FirstAssessment_PredictedPEFValue]\');\n	\n	PEF_CurrentPEFPctPredicted = $(\'input[name=PEF_CurrentPEFPctPredicted]\');\n 	\n 	bestPEFCharts = $(\'input[name=TestsAndResults_PefCharts_BestPef]\');\n	\n	PEFNotAvailable = $(\'input[name=Exacerbation_PEFNotAvailable]:checked\'); //2724\n\n	//Disable PEF_CurrentPEFPctPredicted AND FirstAssessment_PredictedPEFValue field (workaround as doesn\'t disable normally as not \'Calc\' field)\n	//$(\'#PEF_CurrentPEFPctPredicted\').prop(\'disabled\', true);\n	//$(\'#FirstAssessment_PredictedPEFValue\').prop(\'disabled\', true);\n	\n	if (PEFNotAvailable.val() != \'Y\'){\n		\n		//Enable PEF_CurrentPEF field (if disabled)\n		$(\'#PEF_CurrentPEF\').prop(\'disabled\', false);\n		 \n		//Calculated Predicted PEF\n		if (age.val() !== \'\' && sex.val() !== \'\' && height.val() !== \'\' && strScreenName != \'E2\'){\n	 \n			if (parseInt(age.val()) < 16) {\n				predictedPef = 543.3794446 + (parseFloat(height.val()) * -415.1345996) + ((parseFloat(height.val()) * parseFloat(height.val())) * 665.7294331) + (Math.exp(-0.5087062 + parseFloat(height.val())) * -415.546444);\n			} else if (parseInt(age.val()) >= 16){\n				if(sex.val() == \'M\'){\n					predictedPef = (((parseFloat(height.val()) * 5.48) + 1.58) - (parseFloat(age.val()) * 0.041)) * 60;\n				} else if (sex.val() == \'F\'){\n					predictedPef = (((parseFloat(height.val()) * 3.72) + 2.24) - (parseFloat(age.val()) * 0.03)) * 60;    \n				} else {\n					predictedPef =  \'Error\';\n				}\n			} else {\n				predictedPef =  \'Error\';\n			}\n	 \n			$(\'input[name=FirstAssessment_PredictedPEFValue]\').val(predictedPef.toFixed(0));\n	 \n		}\n		 \n		//Calculate Best PEF	\n			if (PEF1.val() == \'\' || typeof PEF1.val() == \'undefined\') {\n				pef1val = 0;\n			} else {\n				pef1val = parseInt(PEF1.val());\n			}\n		\n			if (currentPef.val() == \'\' || typeof currentPef.val() == \'undefined\') {\n				currentPefVal = 0;\n			} else {\n				currentPefVal = parseInt(currentPef.val());\n			}\n		\n		if (bestPef.val() == \'\' || typeof bestPef.val() == \'undefined\') {\n				bestPefVal = 0;\n			} else {\n				bestPefVal = parseInt(bestPef.val());\n			}\n		\n		if (bestPEFLastTime.val() == \'\' || typeof bestPEFLastTime.val() == \'undefined\') {\n				bestPefLastTimeVal = 0;\n			} else {\n				bestPefLastTimeVal = parseInt(bestPEFLastTime.val());\n			}\n		  \n			if (pef1val == 0 == \'\' && currentPefVal == 0 && bestPefVal == 0 && bestPefLastTimeVal == 0){\n				best = \'\';\n			} else {\n				best = Math.max(pef1val,currentPefVal,bestPefVal,bestPefLastTimeVal);\n			}\n	  \n		if(best != \'\'){\n			$(\'input[name=FirstAssessment_BestPEF]\').val(best);\n		}\n	  \n		//Set Best or Predicted: if blank (i.e. new patient) default to Predicted, otherwise use previous answer\n		if (bestOrPredicted.val() == \'\' || bestOrPredicted.val() == null || typeof bestOrPredicted === \'undefined\'){\n			if (bestOrPredictedLastTime.val() == \'\' || bestOrPredictedLastTime.val() == null || typeof bestOrPredictedLastTime === \'undefined\'){\n				$(\'#PEF_BestOrPredicted_1\').iCheck (\'check\');\n				bestOrPredicted = $(\'input[name=PEF_BestOrPredicted]:checked\');\n			} else {\n				bestOrPredicted = bestOrPredictedLastTime;\n				if(bestOrPredictedLastTime.val() == \'Best\'){\n					$(\'#PEF_BestOrPredicted_0\').iCheck (\'check\');\n				} else {\n					$(\'#PEF_BestOrPredicted_1\').iCheck (\'check\');\n				}\n			}\n		}\n	 \n		//Calculate percentage of Best or Predicted\n		if (currentPef.val() != \'\' && bestOrPredicted.val() != \'\' && (bestPef.val() != \'\' || predPef.val() != \'\')){\n	 \n			if (bestOrPredicted.val() == \'Best\') {\n				percentPef = parseFloat(currentPef.val()) / parseFloat(bestPef.val()) * 100.0;\n			}\n			else if (bestOrPredicted.val() == \'Predicted\'){\n				percentPef = parseFloat(currentPef.val()) / parseFloat(predPef.val()) * 100.0;\n			}\n			else {\n				percentPef =  0;\n			}\n			\n			$(\'#PEF_CurrentPEFPctPredicted\').val(percentPef.toFixed(2));\n			\n			console.log(percentPef.toFixed(2));\n			\n		} else {\n			percentPef = \'\';\n			$(\'input[name=PEF_CurrentPEFPctPredicted]\').val(percentPef);\n		}\n		\n		if(strScreenName == \'PEF\'){\n			agc_calc_LungFunctionPerformedOutcome();\n		}\n		\n	} else if (PEFNotAvailable.val() == \'Y\'){\n		\n		//Disable PEF_CurrentPEF field (if enabled) and reset fields\n		$(\'#PEF_CurrentPEF\').prop(\'disabled\', true);\n		currentPef.val(\'\');\n		$(\'input[name=PEF_CurrentPEFPctPredicted]\').val(\'\');\n		\n	}\n 	\n}\n$(\'input[name=Exacerbation_PEFNotAvailable]\').on(\'ifChanged\',function(){agc_calc_PEF();});\n$(\'input[name=PEF_BestOrPredicted]\').on(\'ifChanged\',function(){agc_calc_PEF();});\n$(\'input[name=FirstAssessment_BestPEF]\').change(function(){agc_calc_PEF();});\n$(\'input[name=FirstAssessment_PredictedPEFValue]\').change(function(){agc_calc_PEF();});\n$(\'input[name=Exacerbation_PEFDeclined]\').on(\'ifChanged\',function(){agc_calc_PEF();});\n$(\'input[name=PEF_PreviousPEF1]\').change(function(){agc_calc_PEF();});\n$(\'input[name=PEF_CurrentPEF]\').change(function(){agc_calc_PEF();}); \n$(\'input[name=InitialPatientDetails_DateOfBirth]\').change(function(){agc_calc_PEF();});\n$(\'select[name=InitialPatientDetails_Sex]\').change(function(){agc_calc_PEF();});\n$(\'input[name=ClinicalExam_HeightM]\').change(function(){agc_calc_PEF();});\n$(document).ready(function(){agc_calc_PEF()});\n',NULL,NULL,'Hidden',NULL,NULL,0,NULL,NULL),(2724,NULL,'Exacerbation','PEFNotAvailable','Binary',NULL,NULL,'PEF declined by patient  / not available',NULL,'CheckBox','N',NULL,0,NULL,NULL),(2725,2193,'Exacerbation','ExacerbationRecommendations','Varchar(255)',NULL,'\"ContinueEarlyReview\",\"ContinuePlusAntibiotic\",\"IncreaseSteroidOrAddAnother\",\"OneOrMorePlusOralSteroid\"','\"Continue same medication for asthma but review earlier\",\"Keep regular medication unchanged but make a temporary change in steroid and / or add an antibiotic\",\"Add another asthma drug, increase inhaled steroid dosage and / or add an antibiotic\",\"One or more of above and also an oral steroid\"',NULL,'RadioButtonVert','Y',NULL,0,NULL,NULL),(2726,2194,'Exacerbation','ReviewWeeks','Int',NULL,'2,4,13,26','\"Two Weeks\",\"One Month\",\"Three Months\",\"Six Months\"',NULL,'DropDown','Y',NULL,0,NULL,NULL),(2727,2195,'Exacerbation','InhaledSteroid','Varchar(255)',NULL,NULL,NULL,NULL,'TextBox','N',NULL,0,NULL,NULL),(2728,2196,'Exacerbation','AsthmaDrug','Varchar(255)',NULL,NULL,NULL,NULL,'TextBox','N',NULL,0,NULL,NULL),(2729,2197,'Exacerbation','Antibiotic','Varchar(255)',NULL,NULL,NULL,NULL,'TextBox','N',NULL,0,NULL,NULL),(2730,NULL,'Exacerbation','AntibioticDays','Int','Range','0-28',NULL,NULL,'TextBox','N',NULL,0,NULL,NULL),(2731,2198,'Exacerbation','OralPrednisiloneMg','Float','Range','0-40',NULL,NULL,'TextBox','N',NULL,0,NULL,NULL),(2732,NULL,'Exacerbation','OralPrednisiloneDays','Int','Range','0-28',NULL,NULL,'TextBox','N',NULL,0,NULL,NULL),(2733,NULL,'Audit','Flow4004Result','Int',NULL,'fn_Exacerbation3Flow(\"Exacerbation,ManageAtHome\",\"Exacerbation,SymptomImproved50\",\"Exacerbation,SymptomImproved75\",\"Exacerbation,SeverityMessages\",\"Exacerbation,AlternativePathway4\",20000,4005)',NULL,NULL,'Hidden','N',NULL,0,NULL,NULL),(2734,NULL,'LungFunction','PreviousLungFunctionsReturned','Char(1)',NULL,NULL,NULL,NULL,'Hidden',NULL,NULL,0,NULL,NULL),(2735,2199,'TestsAndResults','EnterMoreTests','Char(1)',NULL,'\"Y\",\"N\"','\"Yes\",\"No\"',NULL,'RadioButton',NULL,NULL,0,NULL,NULL),(2736,NULL,'Spirometry','SuperSpiroProLaunch','Binary','SpiroCapture',NULL,'Do you want to enter any more values?',NULL,'Button',NULL,NULL,0,NULL,NULL),(2737,2200,'NonPharmaRx','ManagementPlanUnderstandTreatment','Char(1)',NULL,'\"Y\",\"N\"','\"Yes\",\"No\"',NULL,'RadioButton',NULL,NULL,0,NULL,NULL),(2738,2201,'NonPharmaRx','ManagementPlanWhyNotProvided','Varchar(255)',NULL,NULL,NULL,NULL,'TextBox','Y',NULL,0,NULL,NULL),(2739,NULL,'NonPharmaRx','ManagementPlanCodeAttached','Varchar(255)','Calc','\nfunction agc_calc_ManagementPlan(){\n 	\n 	bestOrPredicted = $(\'input[name=PEF_BestOrPredicted]:checked\');\n 	bestOrPredictedLastTime = $(\'input[name=PEF_BestOrPredictedLastTime]:checked\');\n 	\n 	predPef = $(\'input[name=FirstAssessment_PredictedPEFValue]\');\n 	\n 	PEF60 = 0;\n 	PEF80 = 0;\n 	\n 	PEF60 = Math.round((predPef.val() * 0.6) / 10) * 10\n 	PEF80 = Math.round((predPef.val() * 0.8) / 10) * 10\n 	\n 	//Set Best or Predicted: if blank use previous answer\n 	if (bestOrPredicted.val() == \'\' || bestOrPredicted.val() == null || typeof bestOrPredicted === \'undefined\'){\n 		bestOrPredicted = bestOrPredictedLastTime;\n 		if(bestOrPredictedLastTime.val() == \'Best\'){\n 			$(\'#PEF_BestOrPredicted_0\').iCheck (\'check\');\n 		} else {\n 			$(\'#PEF_BestOrPredicted_1\').iCheck (\'check\');\n 		}\n 	}\n 	\n 	message = \'<p>Please check they have a plan and understand the intervention thresholds. If it helps, 80% of \' + bestOrPredicted.val() + \' PEF is <b>\' + PEF80 + \'</b> L/min and 60% is <b>\' + PEF60 + \'</b> L/min.</br>The Asthma UK plan is available to download here in <a href=\"https://www.asthma.org.uk/globalassets/health-advice/adult-asthma-action-plan.pdf\" target=\"_blank\">English</a> or <a href=\"https://www.asthma.org.uk/globalassets/health-advice/resources/adults/yourasthmawelshactionplanfsv8_download.pdf\" target=\"_blank\">Welsh</a> languages. Please print and complete for the patient.</p>\';\n    	\n	//Set text on page to message\n	$(\'#text-2063\').html(message);\n    \n }\n \n //$(\'input[name=FirstAssessment_ManagementPlan]\').on(\'ifChanged\',function(){agc_calc_ManagementPlan();});\n //$(\'input[name=NonPharmaRx_ManagementPlanUnderstandTreatment]\').on(\'ifChanged\',function(){agc_calc_ManagementPlan();});\n$(document).ready(function(){agc_calc_ManagementPlan()});\n',NULL,NULL,'Hidden','N',NULL,0,NULL,NULL),(2740,NULL,'LungFunction','LungFunctionOutcome','Varchar(255)','Calc','\nfunction agc_calc_LungFunctionPerformedOutcome() {\n \n 	LungFunctionPerformed = $(\'input[name=LungFunction_LungFunctionPerformed]\'); //2249\n 	SpiroMessage = $(\'input[name=Spirometry_Message]\'); //396\n 	Pef = $(\'input[name=PEF_CurrentPEFPctPredicted]\');\n \n 	diagType = \'\';\n 	\n 	if (LungFunctionPerformed.val() == \'Previous results sufficient\') {\n 		diagType = \'Previous results sufficient\';\n    } else if (LungFunctionPerformed.val() == \'Not performed because of surgery or other reason\') {\n 		diagType = \'Not performed because of surgery or other reason\';\n 	} else if (LungFunctionPerformed.val() == \'Spirometry performed\') {\n 		if(SpiroMessage.val() == \'A\'){\n 			diagType = \'Spirometry performed - Not Diagnostic\';\n 		} else if (SpiroMessage.val() == \'B\'){\n 			diagType = \'Spirometry performed - Not Diagnostic\';\n 		} else if (SpiroMessage.val() == \'C\'){\n 			diagType = \'Spirometry performed - Restrictive\';\n 		} else if (SpiroMessage.val() == \'D\'){\n 			diagType = \'Spirometry performed - Diagnostic\';\n 		} else if (SpiroMessage.val() == \'E\'){\n 			diagType = \'Spirometry performed - Not Diagnostic\';\n 		} else if (SpiroMessage.val() == \'F\'){\n 			diagType = \'Spirometry performed - Not Diagnostic\';\n 		} else if (SpiroMessage.val() == \'G\'){\n 			diagType = \'Spirometry performed - Restrictive\';\n 		} else if (SpiroMessage.val() == \'Ha\'){\n 			diagType = \'Spirometry performed - Diagnostic\';\n 		} else if (SpiroMessage.val() == \'Hb\'){\n 			diagType = \'Spirometry performed - Not Diagnostic\';\n 		} else if (SpiroMessage.val() == \'Hc\'){\n 			diagType = \'Spirometry performed - Not Diagnostic\';\n 		} else {\n 			diagType = \'ErrorSpiro\';\n 		}		\n 		\n 	} else if (LungFunctionPerformed.val() == \'PEF Performed\') {\n 		if(Pef.val() >= 80){\n 			diagType = \'PEF performed - Not Diagnostic\';\n 		} else if (Pef.val() >= 60){\n 			diagType = \'PEF performed - Not Diagnostic\';\n 		} else if (Pef.val() < 60 && Pef.val() != \'\'){\n 			diagType = \'PEF performed - Diagnostic\';\n 		} else {\n 			diagType = \'ErrorPEF\';\n 		}\n 		\n 	}  else {\n 		diagType = \'ErrorLungFunctionPerformed\';\n 	} \n 	\n 	$(\'input[name=LungFunction_LungFunctionOutcome]\').val(diagType); //2740\n \n}\n$( document ).ready(function(){agc_calc_LungFunctionPerformedOutcome();});\n',NULL,NULL,'Hidden','N',NULL,0,NULL,NULL),(2741,NULL,'NonPharmaRx','SpacerAdded','Char(1)',NULL,'\"Y\",\"N\"','\"Yes\",\"No\"',NULL,'RadioButton','Y',NULL,0,NULL,NULL),(2742,NULL,'CurrentMedication','CurrentOtherDrugsBP','Char(1)',NULL,NULL,NULL,NULL,'Hidden','N',NULL,1,'CurrentMedication_CurrentOtherDrugsBP',1),(2743,2203,'LungFunction','SpirometryReferOrContinue','Varchar(255)',NULL,'\"refer\",\"continue\"','\"Refer for specialist advice and exit the package now\",\"Continue asthma care today in the practice, but exit the package now\"',NULL,'RadioButtonVert','Y',NULL,0,NULL,NULL),(2744,2192,'FirstAssessment','ReasonForNoReferralTextOnly','Varchar(255)',NULL,NULL,NULL,NULL,'TextBox','Y',NULL,0,NULL,NULL),(2745,NULL,'FirstAssessment','DisableOptionsCodeAttached','Char(1)','Calc',' \nfunction agc_calc_DisableOptions()\n{\n\n	currentMedicationLevel = $(\'input[name=CurrentMedication_CurrentMedicationLevel]\');\n	\n	if(currentMedicationLevel.val() == 0){\n		$(\'#CurrentControl_AsthmaControlRescueinhaler_0\').iCheck (\'disable\');\n		$(\'#CurrentControl_AsthmaControlRescueinhaler_1\').iCheck (\'disable\');\n		$(\'#CurrentControl_AsthmaControlRescueinhaler_2\').iCheck (\'disable\');\n		$(\'#CurrentControl_AsthmaControlRescueinhaler_3\').iCheck (\'disable\');\n		$(\'#CurrentControl_AsthmaControlRescueinhaler_4\').iCheck (\'disable\');\n		\n		$(\'#FirstAssessment_BeenOnInhalers_0\').iCheck (\'disable\');\n		\n		$(\'#CurrentControl_FrequencyRelieverInhalerLastWeek_0\').iCheck (\'disable\');