w.CurrentMedication_CurrentDrugICSNewDrug;\n	\n	console.log(\'CurrentDrugComb: \' + CurrentDrugComb);\n	console.log(\'CurrentDrugICS: \' + CurrentDrugICS);\n	\n	//Review drug change type\n	ReviewDrugCombChangeType = obj_agc_Review.MedicationReview_ReviewDrugCombChangeType || ChangeType || $(\'input[name=MedicationReview_ReviewDrugCombChangeType]:checked\').val();\n  	ReviewDrugICSChangeType = obj_agc_Review.MedicationReview_ReviewDrugICSChangeType || ChangeType || $(\'input[name=MedicationReview_ReviewDrugICSChangeType]:checked\').val();\n	\n	console.log(\'ReviewDrugCombChangeType: \' + ReviewDrugCombChangeType);\n	console.log(\'ReviewDrugICSChangeType: \' + ReviewDrugICSChangeType);\n\n 	//Review drugs	\n	ReviewDrugCombNewDrug = obj_agc_Review.MedicationReview_ReviewDrugCombNewDrug || $(\'#MedicationReview_ReviewDrugCombNewDrug.chosen-select\').chosen().val();\n  	ReviewDrugICSNewDrug = obj_agc_Review.MedicationReview_ReviewDrugICSNewDrug || $(\'#MedicationReview_ReviewDrugICSNewDrug.chosen-select\').chosen().val();\n	\n	console.log(\'ReviewDrugCombNewDrug: \' + ReviewDrugCombNewDrug);\n	console.log(\'ReviewDrugICSNewDrug: \' + ReviewDrugICSNewDrug);\n 	\n	//Combo 	\n	if((ReviewDrugCombChangeType != \'stop\' && CurrentDrugComb)||ReviewDrugCombNewDrug){\n  	 onComb = 1;\n  	} else {\n  	 onComb = 0;\n  	}\n	\n	console.log(\'onComb: \' + onComb);\n  	\n	//ICS\n	if((ReviewDrugICSChangeType != \'stop\' && CurrentDrugICS)||ReviewDrugICSNewDrug){\n  	 onICS = 1;\n  	} else {\n  	 onICS = 0;\n  	}\n	\n	console.log(\'onICS: \' + onICS);\n  	\n	//Total\n  	total = onComb + onICS;\n	\n	console.log(\'total: \' + total);	\n  	\n	//Set field to control visibility\n 	if(total == 0 && medicationStepLevel.val() >= 1 && medicationStepLevel.val() <= 5){\n 		$(\'input[name=MedicationReview_WarningDrugsWithoutICS]\').val(\'Y\');\n 	} else {\n 		$(\'input[name=MedicationReview_WarningDrugsWithoutICS]\').val(\'N\');\n 	}\n	\n	console.log($(\'input[name=MedicationReview_WarningDrugsWithoutICS]\').val());\n	\n	//agc_checkVisibilities();\n	agc_DialogConfirm();\n  \n}\n$(document).ready(function(){agc_calc_WarningDrugsWithoutICS();});\n',NULL,NULL,'Hidden','N',NULL,0,NULL,NULL),(2750,NULL,'ProgressReview','SummarySoFarVisibilities','Char(1)','Calc','\nfunction agc_calc_SummarySoFarVisibilities()\n{\n \n 	AssessmentType = $(\'input[name=AssessmentDetails_AssessmentType]:checked\');\n 	UnderHospitalCare = $(\'input[name=FirstAssessment_UnderHospitalCare]:checked\'); //2223\n 	SummarySoFarOptions = $(\'input[name=Spirometry_SummarySoFarOptions]:checked\');	\n 	CurrentMedicationLevel = $(\'input[name=CurrentMedication_CurrentMedicationLevel]\');\n 	MedicationLevelAtStartOfLastVisit = $(\'input[name=CurrentMedication_MedicationLevelAtStartOfLastVisit]\'); //2548\n 	HowLongOralSteroids = $(\'input[name=CurrentMedication_HowLongOralSteroids]:checked\');\n 	CurrentControl13 = $(\'input[name=FirstAssessment_CurrentControl13]\');\n 	CurrentControl45 = $(\'input[name=FirstAssessment_CurrentControl45]\');\n 	FastOrStandard = $(\'input[name=FirstAssessment_FastOrStandardTrack]\');\n 	HospitalReport = $(\'input[name=FirstAssessment_HospitalReport]:checked\');\n 	HospitalReportDiagnosisBasisLastTime = $(\'input[name=DiagnosisBasis_HospitalReportLastTime]\');\n 	SecondaryCareAsthmaReferral1A = $(\'input[name=FirstAssessment_SecondaryCareAsthmaReferral]:checked\');\n 	InhalerTechniqueAdequate = $(\'input[name=NonPharmaRx_InhalerTechniqueAdequate]:checked\');\n 	AdherenceToTherapyAdequate = $(\'input[name=ProgressReview_AdherenceToTherapyAdequate]:checked\');\n 	PresentControl3Months = $(\'input[name=ProgressReview_PresentControl3Months]:checked\');\n 	StepDownTherapyNow = $(\'input[name=ProgressReview_StepDownTherapyNow]:checked\');\n 	AcuteReason = $(\'input[name=FollowUp_AcuteReason]:checked\');\n 	ControlLastTime = $(\'input[name=CurrentControl_ControlLastTime]:checked\'); //2288\n 	DiagnosticConfirmation45 = $(\'input[name=FirstAssessment_DiagnosticConfirmation45]