e]\');\n 	PulseBpm = $(\'input[name=ClinicalExam_PulseBpm]\');\n 	Sa02Declined = $(\'input[name=Exacerbation_Sa02Declined]:checked\');\n 	CurrentSaO2 = $(\'input[name=Exacerbation_CurrentSaO2]\');\n 	\n 	GoodColour  = \'#00CC66\';\n	PartialColour  = \'#FFCC33\';\n	PoorColour =  \'#FF3333\';\n 	\n 	CurrentPEFColour = \'\';\n 	CompleteSentencesColour = \'\';\n 	RespiratoryRateColour = \'\';\n 	PulseBpmColour = \'\';\n 	CurrentSaO2Colour = \'\';\n 	\n 	if (PEFDeclined.val() == \'Y\' || CurrentPEFPctPredicted.val() < 50) {\n 		CurrentPEFColour = PoorColour;\n 	} else if (CurrentPEFPctPredicted.val() < 75) {\n 		CurrentPEFColour = PartialColour;\n 	} else {\n 		CurrentPEFColour = GoodColour;\n 	}\n 	\n 	if (CompleteSentences.val() == \'N\') {\n 		CompleteSentencesColour = PoorColour;\n 	} else {\n 		CompleteSentencesColour = GoodColour;\n 	}\n 	\n 	if (RespiratoryRate.val() >= 25) {\n 		RespiratoryRateColour = PoorColour;\n 	} else {\n 		RespiratoryRateColour = GoodColour;\n 	}\n 	\n 	if (PulseBpm.val() >= 110) {\n 		PulseBpmColour = PoorColour;\n 	} else {\n 		PulseBpmColour = GoodColour;\n 	}\n 	\n 	if (CurrentSaO2.val() != \'N\' && CurrentSaO2.val() <= 92) {\n 		CurrentSaO2Colour = PoorColour;\n 	} else {\n 		CurrentSaO2Colour = GoodColour;\n 	}\n 		\n 	Exacerbation2Message = \'<h3>Exacerbation Severity</h3><p>\';\n 	\n 	//PEF\n 	Exacerbation2Message += \'<span style=\\\'color:\'+CurrentPEFColour+\';\\\'>&bull;&nbsp;&nbsp;&nbsp;&nbsp;</span>\';\n 	if (PEFDeclined.val() == \'Y\') {\n 		Exacerbation2Message += \'PEF was not carried out today</p>\';\n 	} else {\n 		Exacerbation2Message += \'Today\\\'s PEF: <b>\' + parseFloat(CurrentPEF.val()).toFixed(0) + \'</b> (L/min) which is <b>\' + parseFloat(CurrentPEFPctPredicted.val()).toFixed(0) + \'%</b> of the patient\\\'s \' + BestOrPredicted.val().toLowerCase() + \' value of \';			\n 		if (BestOrPredicted.val() == \'Best\') {\n 			Exacerbation2Message += BestPEF.val() + \' (L/min)\';\n 		} else {\n 			Exacerbation2Message +=