cinationNever\').iCheck(\'enable\');\n	} else {\n		$(\'#NonPharmaRx_LastPneumococcalVaccinationNever\').iCheck(\'disable\');\n	}\n	\n	if(pneumococcalVaccinationNever.val() != \'Y\' || typeof pneumococcalVaccinationNever.val() == \'undefined\'){\n		$(\'#NonPharmaRx_LastPneumococcalVaccinationDate\').prop(\'disabled\', false);\n		$(\'#NonPharmaRx_LastPneumococcalVaccinationDate-datepicker\').datepicker({ \n															 format: \'mm/yyyy\',\n															 startView: 2, \n															 minViewMode: 1, \n															 //startDate: calcStartDate, \n															 endDate: currentDate, \n															 autoclose: true \n															 });\n	} else {\n		$(\'#NonPharmaRx_LastPneumococcalVaccinationDate-datepicker\').datepicker( \'remove\' );\n		$(\'#NonPharmaRx_LastPneumococcalVaccinationDate\').prop(\'disabled\', true);\n	}\n	\n	//Set pneumococcal vaccination date with today\'s date when \'Yes - Vaccinate patient today\' is selected	\n	if(pneumococcalBookVaccination.val() == \'T\' && bookPneumococcalVaccinationSet == 1){\n		$(\'#NonPharmaRx_LastPneumococcalVaccinationDate\').val(currentDateString);\n		$(\'#NonPharmaRx_LastPneumococcalVaccinationDate\').prop(\'disabled\', false);\n		$(\'#NonPharmaRx_LastPneumococcalVaccinationNever\').iCheck(\'uncheck\');\n		$(\'#NonPharmaRx_LastPneumococcalVaccinationNever\').iCheck(\'disable\');\n		bookPneumococcalVaccinationSet = 0;\n	} else if(pneumococcalBookVaccination.val() != \'T\' && bookPneumococcalVaccinationSet == 1) {\n		$(\'#NonPharmaRx_LastPneumococcalVaccinationDate\').val(originalPneumococcalVaccinationDateString);\n		if(originalPneumococcalVaccinationDateString == \'\'){\n			$(\'#NonPharmaRx_LastPneumococcalVaccinationDate\').prop(\'disabled\', true);\n			$(\'#NonPharmaRx_LastPneumococcalVaccinationNever\').iCheck(\'check\');\n			$(\'#NonPharmaRx_LastPneumococcalVaccinationNever\').iCheck(\'enable\');\n			bookPneumococcalVaccinationSet = 0;\n		} else {\n			$(\'#NonPharmaRx_LastPneumococcalVaccinationDate\').prop