alExamOutcomes();});\n $(\'input[name=ClinicalExam_PulseConfirmedNormalByGP]\').on(\'ifChanged\',function(){agc_calc_ClinicalExamOutcomes();});\n $(\'input[name=ClinicalExam_RRConfirmedNormalByGP]\').on(\'ifChanged\',function(){agc_calc_ClinicalExamOutcomes();});\n \n',NULL,NULL,'Hidden','N',NULL,1,NULL,NULL),(2229,2126,'CurrentControl','Last12MonthsAedOrHospDate','Date','Date',NULL,NULL,NULL,'DatePickerMonth','N',NULL,0,'',NULL),(2230,66,'CurrentControl','Last12MonthsAedOrHospLast3MonthsCodeAttached','Char(1)','Calc','function agc_set_DatePicker()\r {\r   	last3Months = $(\'input[name=CurrentControl_Last12MonthsAedOrHospLast3Months]:checked\');\r 	var d = new Date();\r 	var s1 = new Date();\r 	var s2 = new Date();\r 	s1 = new Date(s1.setMonth(s1.getMonth() - 3));\r 	s2 = new Date(s2.setMonth(s2.getMonth() - 12));\r \r 	if (	last3Months.val() != \'\' \r 		&&	last3Months != null \r 		&&	typeof last3Months !== \'undefined\'\r 		&&	agc_getInputValue($(\":input[name=\'CurrentControl_Last12MonthsAedOrHospLast3Months\']\"))!= null){\r  	\r 		if (last3Months.val() == \'Y\') {\r 			$(\'#CurrentControl_Last12MonthsAedOrHospDate-datepicker\').datepicker(\'remove\'); \r 			$(\'#CurrentControl_Last12MonthsAedOrHospDate-datepicker\').datepicker({ \r 			 format: \'mm/yyyy\', \r 			 startView: 2, \r 			 minViewMode: 1, \r 			 startDate: s1, \r 			 endDate: d, \r 			 autoclose: true \r 			 });\r 		}\r 		else {\r 			$(\'#CurrentControl_Last12MonthsAedOrHospDate-datepicker\').datepicker(\'remove\'); \r 			$(\'#CurrentControl_Last12MonthsAedOrHospDate-datepicker\').datepicker({ \r 			 format: \'mm/yyyy\', \r 			 startView: 2, \r 			 minViewMode: 1, \r 			 startDate: s2, \r 			 endDate: s1, \r 			 autoclose: true \r 			 });\r 		}\r 	} 	\r }\r   \r $(\'input[name=CurrentControl_Last12MonthsAedOrHospLast3Months]\').on(\'ifChanged\',function(){agc_set_DatePicker();});\r',NULL,NULL,'Hidden','N',NULL,0,'',NULL),(2231,2127,'NonPharmaRx','DiseaseEducationDownloadDate','Date','Calc','function 