\n 			if (currentMedicationLevel.val() == 0 || newOrKnown.val() == \'New\') {\n 				outputString = \'Standard Track\';\n			// Existing patient\n 			} else {\n				if (currentMedicationLevel.val() >= 1 && currentMedicationLevel.val() <= 3) {\n					outputString = \'Fast Track\';\n				} else if (currentMedicationLevel.val() == 4 || currentMedicationLevel.val() == 5) {\n					outputString = \'Standard Track\';\n				} else {\n					outputString = \'Error\';\n				}\n			}\n 		\n 			$(\'input[name=FirstAssessment_FastOrStandardTrack]\').val(outputString);\n \n 		} else { \n			$(\'input[name=FirstAssessment_FastOrStandardTrack]\').val(\'Error\'); 		\n 		}\n 	}\n}\n \n $(\'input[name=CurrentMedication_CurrentMedicationLevel]\').on(\'ifChanged\',function(){agc_calc_FastOrStandardTrack();});\n $(\'input[name=FirstAssessment_NewOrKnown]\').on(\'ifChanged\',function(){agc_calc_FastOrStandardTrack();});\n $( document ).ready(function(){agc_calc_FastOrStandardTrack();});\n',NULL,NULL,'TextBox','N',NULL,0,NULL,NULL),(2236,NULL,'FirstAssessment','NewPatientFirstVisit','Char(1)','Calc','function agc_calc_NewPatientFirstVisit()\r {\r 		assessmentType = $(\'input[name=AssessmentDetails_AssessmentType]\');\r 		newOrKnown = $(\'input[name=FirstAssessment_NewOrKnown]:checked\');\r 		step13OrNew = $(\'input[name=FirstAssessment_Step13OrNew]:checked\');\r 		currentMedication = $(\'input[name=CurrentMedication_CurrentMedicationLevel]\');\r \r 		if (assessmentType.val() == \'1A\' && (newOrKnown.val() == \'New\' || step13OrNew.val() == \'New\' || currentMedication.val() == 0)) {\r 			outputString = \'Y\';\r 		} else if (assessmentType.val() != \'1A\' || (newOrKnown.val() != \'New\' && step13OrNew.val() != \'New\') || currentMedication.val() != 0 ) {\r 			outputString = \'N\';\r 		} else {\r 			outputString = \'E\';\r 		}\r 	\r 		$(\'input[name=FirstAssessment_NewPatientFirstVisit]\').val(outputString);\r \r }\r \r $( document ).ready(function(){agc_calc_NewPatientFirstVisit();});\r',NULL,NULL,'TextBox','N',NULL,0,NULL,NULL),(2237,NULL,'Audit','Flow1108Result','Int',NULL,'fn_PreTherapy45Flow(\"FirstAssessment,ConfidentToProceedTherapy\",\"FirstAssessment,UnderHospitalCare\",\"CurrentMedication,CurrentMedicationLevel\",1109,1010,20000)',NULL,NULL,'Hidden','N',NULL,0,NULL,NULL),(2238,2131,'FirstAssessment','SecondaryCareAsthmaReferral','Char(1)',NULL,'\"Y\",\"N\"','\"Yes\",\"No\"',NULL,'RadioButton','Y',NULL,0,'FirstAssessment_SecondaryCareAsthmaReferralLastTime',NULL),(2239,2132,'FirstAssessment','SecondaryCareAsthmaReferralDetails','Varchar(255)',NULL,NULL,NULL,NULL,'TextBox','Y',NULL,0,'FirstAssessment_SecondaryCareAsthmaReferralDetailsLastTime',NULL),(2240,NULL,'FirstAssessment','DiagnosticConfirmation45','Varchar(50)',NULL,NULL,NULL,NULL,'TextBox','N',NULL,0,'FirstAssessment_DiagnosticConfirmation45',NULL),(2241,2135,'FirstAssessment','NextReviewWeeks','Varchar(50)','Calc','\nfunction agc_calc_NextReviewWeeks(){\n  	\n  /*\n  RULE 1 - IF NEW PATIENT STARTING THERAPY THEN 4 WEEKS\n  RULE 2 - IS PATIENT STEP 1-3 OR 4-5?\n  	RULE 3 (STEP 1-3): VARIOUS THERAPY STREAMS AS BEFORE, AND S(MART) - \n  		IF Therapy Stream IN (FTC,FTJ) THEN therapyStreamReviewWeeks = 13 WEEKS\n  		IF Therapy Stream IN (FTH,FTI,FTK) THEN therapyStreamReviewWeeks = 26 WEEKS\n  		IF Therapy Stream IN (FTD,FTE,FTF,FTG,FTL,FTM) THEN therapyStreamReviewWeeks = 52 WEEKS       \n  		IF Therapy Stream IN (FTO1,FTP1,FTQ1) AND on s(mart) regime THEN therapyStreamReviewWeeks = 13 WEEKS\n  		IF Therapy Stream IN (FTO1,FTP1,FTQ1) AND NOT on s(mart) regime THEN therapyStreamReviewWeeks = 26 WEEKS            \n  		ELSE therapyStreamReviewWeeks = 52 WEEKS\n  \n  	RULE 4 (STEP 4-5) -\n  		EXACERBATION IN LAST 3 MONTHS - 13 WEEKS\n  	RULE 5 (STEP 4-5) -\n  		WHAT IS THE LEVEL OF RECORDED CONTROL?\n  		GOOD = 52 WEEKS \n  		PARTIAL = 26 WEEKS\n  		POOR = 13 WEEKS\n  */\n    \n    agc_calc_TherapyChanges.call();\n	\n	/*\n	Non-Pharma Flows (Therapy NOT changed) - 1110,2013\n	Education Flows (Therapy changed) - 1112,2012\n	*/\n	\n	/*var flow1009Result = $(\'input[name=Audit_Flow1009Result]\');	\n	var flow1010Result = $(\'input[name=Audit_Flow1010Result]\');	\n	var flow2009Result = $(\'input[name=Audit_Flow2009Result]\');	\n	var flow2010Result = $(\'input[name=Audit_Flow2010Result]\');	\n	\n	var flowResult = flow1009Result.val() || flow1010Result.val() || flow2009Result.val() || flow2010Result.val();\n	\n	var therapyChanged = \'\';\n	\n	if(flowResult == \'1110\' || flowResult == \'2013\') {\n		therapyChanged = \'N\';\n	} else {\n		therapyChanged = \'Y\';\n	}\n	\n	//console.log(flow1009Result.val());\n	//console.log(flow1010Result.val());\n	//console.log(flow2009Result.val());\n	//console.log(flow2010Result.val());\n	console.log(\'flowResult: \' + flowResult);\n	console.log(\'therapyChanged: \' + therapyChanged);*/\n	\n	var therapyChanges = $(\'input[name=MedicationReview_TherapyChanges]\');\n	var therapyChanged = \'\';\n	\n	asthmaReferral = $(\'input[name=FirstAssessment_SecondaryCareAsthmaReferral]:checked\'); //2238\n	asthmaNoReferralReason = $(\'select[name=FirstAssessment_ReasonForNoReferral] option:selected\'); //2722\n	\n	if(therapyChanges.val() == 0){\n		therapyChanged = \'N\';\n	} else if(therapyChanges.val() == 1){\n		therapyChanged = \'1\';\n	} else {\n		therapyChanged = \'>1\';\n	}\n	   \n    var therapyStream = $(\'input[name=Therapy_TherapyStream]\');	\n  	var currentMedicationLevel = $(\'input[name=CurrentMedication_CurrentMedicationLevel]\');\n  \n    var reviewWeeks;\n    var defaultReviewWeeks = 52; 	\n  	var reviewWeeksText = \'\';\n  	var recentExacerbationText;\n   	var messageOption;\n  	var message = \'\';\n    	\n  	// S(MART) THERAPY\n  	var comboNewUsage = $(\'select[name=MedicationReview_ReviewDrugCombNewUsage] option:selected\');\n  	var smartTherapy;\n  	\n  	if(comboNewUsage.val() == \'(s)mart\'){\n    	smartTherapy = \'Y\';\n    }\n    	\n  	// EXACERBATIONS\n  	var recentExacerbation1 = $(\'input[name=CurrentControl_Last12MonthsOralSteroidsLast3Months]:checked\');\n	var recentExacerbation2 = $(\'input[name=CurrentControl_Last12MonthsAntibioticsLast3Months]:checked\');\n	var recentExacerbation3 = $(\'input[name=CurrentControl_Last12MonthsCallOutLast3Months]:checked\');\n	var recentExacerbation4 = $(\'input[name=CurrentControl_Last12MonthsAedOrHospLast3Months]:checked\');\n  	var recentExacerbation;\n  	\n	if(recentExacerbation1.val() == \'Y\' || recentExacerbation2.val() == \'Y\' || recentExacerbation3.val() == \'Y\' || recentExacerbation4.val() == \'Y\'){\n		recentExacerbation = \'Y\';\n	}\n  	\n  	// CURRENT CONTROL\n  	var currentControl13 = $(\'input[name=FirstAssessment_CurrentControl13]\');\n    var currentControl45 = $(\'input[name=FirstAssessment_CurrentControl45]\');\n  	var currentControl = currentControl45.val() || currentControl13.val();\n  	\n  	\n  	// RULE 1: New Patient	\n  	if(currentMedicationLevel.val() == 0){\n  		reviewWeeks = 4;\n  		messageOption = \'A\';\n  	// RULE 2: Step 1-3\n  	} else if(currentMedicationLevel.val() >= 1 && currentMedicationLevel.val() <= 3) {\n  		// RULE 3: Therapy 1-3 Section  \n  		switch(therapyStream.val()){\n  			case \'FTC\':\n  				reviewWeeks = 13;\n  				messageOption = \'C\';\n  				break;\n  			case \'FTH\':\n  				reviewWeeks = 26;\n  				messageOption = \'D\';\n  				break;\n  			case \'FTI\':\n  				reviewWeeks = 26;\n  				messageOption = \'D\';\n  				break;\n  			case \'FTJ\':\n  				reviewWeeks = 26;\n  				messageOption = \'D\';\n  				break;\n  			case \'FTK\':\n  				reviewWeeks = 26;\n  				messageOption = \'D\';\n  				break;\n  			case \'FTM\':\n  				reviewWeeks = 52;\n  				messageOption = \'E\';\n  				break;\n  			case \'FTN1\':\n  				reviewWeeks = 26;\n  				messageOption = \'F\';\n  				break;\n  			case \'FTN2\':\n  				reviewWeeks = 26;\n  				messageOption = \'D\';\n  				break;\n  			case \'FTO\':\n  				if(smartTherapy == \'Y\'){\n  					reviewWeeks = 13;\n  					messageOption = \'G\';\n  				} else {\n  					reviewWeeks = 26;\n  					messageOption = \'D\';\n  				}\n  				break;\n  			case \'FTQ\':\n  				if(smartTherapy == \'Y\'){\n  					reviewWeeks = 13;\n  					messageOption = \'G\';\n  				} else {\n  					reviewWeeks = 26;\n  					messageOption = \'H\';\n  				}\n  				break;\n  			default: //FTA, FTB, FTD, FTE, FTF, FTG, FTL\n  				reviewWeeks = defaultReviewWeeks;\n  				messageOption = \'B\';\n  		}\n  	// RULE 2: Step 4-5\n  	} else if(currentMedicationLevel.val() >= 4 && currentMedicationLevel.val() <= 5) {\n  		// RULE 4: Recent Exacerbation\n  		if(recentExacerbation == \'Y\'){\n  			reviewWeeks = 13;\n  			messageOption = \'I\';\n  		} else {\n  			// RULE 5: Current Control  	\n  			switch(currentControl){\n  				case \'Good\':\n  					reviewWeeks = 52;\n  					messageOption = \'J\';\n  					break;\n  				case \'Partial\':\n  					reviewWeeks = 26;\n  					messageOption = \'K\';\n  					break;\n  				case \'Poor\':\n  					reviewWeeks = 13;\n  					messageOption = \'L\';\n  					break;\n  			}\n  		}\n  	} else {\n  		reviewWeeks = defaultReviewWeeks;\n  		messageOption = \'B\';\n  	}\n	\n	switch(reviewWeeks) {\n		case 4:\n			reviewWeeksText = \'one month\';\n			break;\n		case 13:\n			reviewWeeksText = \'three months\';\n			break;\n		case 26:\n			reviewWeeksText = \'six months\';\n			break;\n		case 52:\n			reviewWeeksText = \'one year\';\n			break;\n	}\n	\n	// Set field\n  	$(\'input[name=FirstAssessment_NextReviewWeeks]\').val(reviewWeeksText);\n	\n	if(therapyChanged == \'1\'){\n		message = \'<p><b>You have made a change to the medication regimen. The usual review would be at \' + reviewWeeksText + \'. Consider whether the change you have made justifies an earlier review.</b></p><p>\';\n	} else if(therapyChanged == \'>1\'){\n		message = \'<p><b>You have made some changes to the medication regimen. The usual review would be at \' + reviewWeeksText + \'. Consider whether the changes you have made justify an earlier review.</b></p><p>\';\n	}\n  	\n  	if((therapyStream.val() == \'STD8\' || therapyStream.val() == \'STD10\') && asthmaReferral.val() != \'Y\'){\n		message += \'<p>A referral to secondary care was recommended but not made, with the reason: <i>\"\' + asthmaNoReferralReason.text() + \'</i>\". The standard review would be in \' + reviewWeeksText + \' time. Do you wish to make this sooner?</p>\';\n	} else {\n   		\n		  switch (messageOption) {\n		  //Starting therapy for first time (1 month)\n			case \'A\':\n				message += \'As this patient is being started on asthma therapy for the first time, an early follow up is recommended so that a) their response to therapy can be assessed b) their use of medications checked and c) that their understanding of their condition is good. Suggested follow up: \' + reviewWeeksText + \'.\';\n				break;\n		  //DEFAULT: No change in therapy, well controlled (12 months)\n			case \'B\':\n				message += \'As there has been no increase in therapy and the patient is well controlled, it is suggested that a follow up appointment be scheduled for \' + reviewWeeksText + \'s time.\';\n				break;\n		  //Change up in therapy, poor / partial control (3 months)\n			case \'C\':\n			  message += \'As there has been a change in therapy and the patient is not well controlled, it is suggested that a follow up appointment be scheduled for \' + reviewWeeksText + \' time to check response.\';\n				break;\n		  //Change up in therapy, poor / partial control (3 / 6 months)\n			case \'D\':\n				message += \'As there has been a change in therapy and the patient is not well controlled, it is suggested that a follow up appointment be scheduled for three to six months time to check response.\';\n				break;\n		  //Possible change down in therapy, well controlled\n			case \'E\':\n				message += \'As this patient is well controlled and a possible step down in drug therapy was recommended, it is suggested that a follow up appointment be scheduled for three to six months time if there was a change in therapy, to check response, otherwise 12 months.\';\n				break;\n		  //No change in therapy, partially controlled (6 months)\n			case \'F\':\n				message += \'As there has been no increase in therapy but the patient is only partially controlled, it is suggested that a follow up appointment be scheduled for \' + reviewWeeksText + \' time to assess if an increase may be needed.\';\n			  break;\n		  //Change in therapy, poor control, SMART therapy (3 months)\n			case \'G\':\n				message += \'As the patient has just started a S(MART) therapy and is poorly controlled, it is suggested that a follow up appointment be scheduled for \' + reviewWeeksText + \' time to check response.\';\n			  break;\n		  //Poor control, poor adherence to therapy (3 months)\n			case \'H\':\n				message += \'As the patient is reporting poor adherence to therapy and is poorly controlled, it is suggested that a follow up appointment be scheduled for \' + reviewWeeksText + \' time.\';\n			  break;\n		  //Step 4-5 and recent exacerbation (3 months)\n			case \'I\':\n				message += \'This patient has been noted to have had a recent asthma exacerbation which means they are potentially at risk of another one regardless of level of control today. Thus an earlier follow up is recommended to ensure that control has been effectively established. Suggested follow up: \' + reviewWeeksText + \'.\';\n			  break;\n		  //Step 4-5 and Good control (12 months)\n			case \'J\':\n				message += \'This patient has good asthma control and thus the next review should be scheduled as the next annual review.\';\n			  break;\n		  //Step 4-5 and Partial control (6 months)\n			case \'K\':\n				message += \'This patient has partial control of their asthma and so it may be wise to plan to review earlier than the next annual asthma review. Suggested follow up: \' + reviewWeeksText + \'.\';\n			  break;\n		  //Step 4-5 and Poor control (3 months)\n			case \'L\':\n				message += \'This patient has poor control of their asthma and thus an early review is advised to see if changes are working and if not to adjust therapy further. Suggested follow up: \' + reviewWeeksText + \'.\';\n			  break; 			\n		}\n	\n	}\n	\n	message += \'</p>\';\n   	\n   	//Set text on page to message\n   	$(\'#text-2103\').html(message);\n   	\n   	//Set selected on dropdown\n   	//$(\'select[name=FirstAssessment_NextReviewWeeksHCP]\').val(newReviewWeeks);\n   	\n 	if (typeof console !== \'undefined\' & typeof console.log !== \'undefined\'){\n 		console.log(\'Therapy Stream: \' + therapyStream.val());\n		console.log(\'therapyChanged: \' + therapyChanged);\n		console.log(\'asthmaReferral: \' + asthmaReferral.val());\n		console.log(\'asthmaNoReferralReason: \' + asthmaNoReferralReason.val());\n 		console.log(currentMedicationLevel.val());\n 		console.log(messageOption);\n 		console.log(message);\n 	}\n   \n}\n\n$( document ).ready(function(){agc_calc_NextReviewWeeks();});\n',NULL,NULL,'TextBox','N',NULL,0,NULL,NULL),(2242,NULL,'MedicationReview','TherapyChanges','Int','Calc','\nfunction agc_calc_TherapyChanges(){\n \n 	var c1 = $(\'input[name=MedicationReview_ReviewDrugISABAChangeType]\').val();\n 	var c2 = $(\'input[name=MedicationReview_ReviewDrugICSChangeType]\').val();\n 	var c3 = $(\'input[name=MedicationReview_ReviewDrugILABAChangeType]\').val();\n 	var c4 = $(\'input[name=MedicationReview_ReviewDrugCombChangeType]\').val();\n 	var c5 = $(\'input[name=MedicationReview_ReviewDrugILAAChangeType]\').val();\n 	var c6 = $(\'input[name=MedicationReview_ReviewDrugLTRAChangeType]\').val();\n 	var c7 = $(\'input[name=MedicationReview_ReviewDrugTheophyllineChangeType]\').val();\n 	var c8 = $(\'input[name=MedicationReview_ReviewDrugPDE4InhibitorChangeType]\').val();\n 	var c9 = $(\'input[name=MedicationReview_ReviewDrugMucolyticChangeType]\').val();\n 	var c10 = $(\'input[name=MedicationReview_ReviewDrugISAAChangeType]\').val();\n 	var c11 = $(\'input[name=MedicationReview_ReviewDrugOBAChangeType]\').val();\n 	var c12 = $(\'input[name=MedicationRev