_BDPEquivalent_ICS_Review() {\n      DrugSelected = $(\'select[name=MedicationReview_ReviewDrugICSNewDrug] option:selected\');\n      Usage = $(\'select[name=MedicationReview_ReviewDrugICSNewUsage] option:selected\');\n      \n    \n      if (Usage.val() == \'od\') {\n      UsageNo = 1;\n      } else if (Usage.val() == \'bd\'){\n      UsageNo = 2;\n      } else if (Usage.val() == \'tds\'){\n      UsageNo = 3;\n      } else if (Usage.val() == \'od - 1 puff\'){\n      UsageNo = 1;\n      } else if (Usage.val() == \'bd - 1 puff\'){\n      UsageNo = 2;\n      } else if (Usage.val() == \'tds - 1 puff\'){\n      UsageNo = 3;\n      } else if (Usage.val() == \'od - 2 puffs\'){\n      UsageNo = 2;\n      } else if (Usage.val() == \'bd - 2 puffs\'){\n      UsageNo = 4;\n      } else if (Usage.val() == \'tds - 2 puffs\'){\n      UsageNo = 6;\n      } else {\n      UsageNo = 0;\n      }\n      \n    \n    \n         if (DrugSelected.attr(\'data-agcbdpequivvalue\') >= 0) {\n          finalDose = UsageNo * DrugSelected.attr(\'data-agcbdpequivvalue\');\n         } else {\n          finalDose = \'\';           \n         }\n         \n  \n         $(\'input[name=MedicationReview_IcsBdpEquivIncUse]\').val(finalDose);\n     }\n             \n     $(\'select[name=MedicationReview_ReviewDrugICSNewDrug]\').on(\'change\', function(){agc_calc_BDPEquivalent_ICS();});\n     $(\'select[name=MedicationReview_ReviewDrugICSNewUsage]\').change(function(){agc_calc_BDPEquivalent_ICS();});',NULL,NULL,'Hidden','N',NULL,0,'MedicationReview_IcsBdpEquivIncUse',NULL),(2556,2174,'Spirometry','SpirometryNotPerformedReason','Varchar(255)',NULL,NULL,NULL,NULL,'TextBox','N',NULL,0,NULL,NULL),(2557,2175,'Spirometry','SummarySoFarOptions','Varchar(255)',NULL,'\"Continue\",\"BookTestsContinue\",\"ReferralContinue\",\"End\"','\"Are you happy with the diagnosis, and to proceed to assess control and treat patient yourself today?\",\"Have you some doubts about diagnosis that warrant extra tests, whilst continuing 