LastFluVaccinationDate\').prop(\'disabled\', true);\n   			$(\'#NonPharmaRx_LastFluVaccinationNever\').iCheck(\'check\');\n   			$(\'#NonPharmaRx_LastFluVaccinationNever\').iCheck(\'enable\');\n   			bookFluVaccinationSet = 0;\n   		} else {\n   			$(\'#NonPharmaRx_LastFluVaccinationDate\').prop(\'disabled\', false);\n   			$(\'#NonPharmaRx_LastFluVaccinationNever\').iCheck(\'uncheck\');\n   			$(\'#NonPharmaRx_LastFluVaccinationNever\').iCheck(\'disable\');\n   			bookFluVaccinationSet = 0;\n   		}\n   	}*/\n   	\n   	/*********************************************************************/	\n   	//	PNEUMOCOCCAL\n   	/*********************************************************************/	\n   	\n   	if(bookPneumococcalVaccinationSet != 1){\n   		\n   		$(\'#layout-holder-2867\').show();\n   		$(\'#layout-holder-2869\').show();\n   		\n   		//Pneumococcal Vaccine up to date and not due in next 12 months\n   		if(pneumococcalVaccinationDate >= pneumococcalValidStartDate && pneumococcalVaccinationDate >= pneumococcalValidRecentDate){\n   			messageOptionPneumococcal = \'A\';\n   			$(\'#layout-holder-2869\').hide();\n   		//Pneumococcal Vaccine up to date and is due in next 12 months\n   		} else if(pneumococcalVaccinationDate >= pneumococcalValidStartDate && pneumococcalVaccinationDate < pneumococcalValidRecentDate){\n   			messageOptionPneumococcal = \'B\';\n   			$(\'#layout-holder-2869\').show();\n   		//Pneumococcal Vaccine not up to date\n   		} else if(pneumococcalVaccinationNever.val() == \'Y\' || pneumococcalVaccinationDate < pneumococcalValidStartDate){\n   			messageOptionPneumococcal = \'C\';\n   			$(\'#layout-holder-2869\').show();\n   		//Default\n   		} else {\n   			$(\'#layout-holder-2867\').hide();\n   			$(\'#layout-holder-2869\').hide();\n   		}\n   		\n   		switch (messageOptionPneumococcal) {\n   		  case \'A\':\n   			  messagePneumococcal = \'Based on the information provided, above, this patient\\\'s pneumococcal vaccination is up to date and i