empted to correct inhaler technique</li>\';\n			}\n			\n			if(ChangeDeviceLastTime.val() == \'Y\'){\n				message += \'<li>The device was changed</li>\';\n			}\n			\n			if(AddSpacerLastTime.val() == \'Y\'){\n				message += \'<li>A spacer was added</li>\';\n			}\n			\n			if(OtherLastTime.val() == \'Y\'){\n				message += \'<li>The following other solution was attempted: <i>\"\' + DetailsLastTime.val() + \'\"</i></li>\';\n			}\n			message += \'</ul>\';\n		} else {\n			message += \'</p>\';\n		}\n	}\n	\n	$(\'#text-2180\').html(message);\n	\n}\n\n$( document ).ready(function(){agc_calc_SetInhalerTechniqueText();});\n$(\'input[name=NonPharmaRx_InhalerTechniqueAdequateLastTime]\').on(\'ifChanged\', function () {agc_calc_SetInhalerTechniqueText();}); \n$(\'input[name=NonPharmaRx_TechniqueCorrectedLastTime]\').on(\'ifChanged\', function () {agc_calc_SetInhalerTechniqueText();}); \n$(\'input[name=NonPharmaRx_ChangeDeviceLastTime]\').on(\'ifChanged\', function () {agc_calc_SetInhalerTechniqueText();}); \n$(\'input[name=NonPharmaRx_AddSpacerLastTime]\').on(\'ifChanged\', function () {agc_calc_SetInhalerTechniqueText();}); \n$(\'input[name=NonPharmaRx_OtherLastTime]\').on(\'ifChanged\', function () {agc_calc_SetInhalerTechniqueText();}); \n\n',NULL,NULL,'TextBox','N',NULL,0,NULL,NULL),(2593,NULL,'NonPharmaRx','CheckInhalerTechniqueNowLastTime','Char(1)',NULL,'\"Y\",\"N\"','\"Yes\",\"No\"',NULL,'RadioButton',NULL,NULL,0,NULL,NULL),(2594,NULL,'Audit','Flow2011Result','Int',NULL,'fn_FUEducationFlow(\"CurrentMedication,CurrentMedicationLevel\",\"FirstAssessment,CurrentControl13\",\"FirstAssessment,CurrentControl45\",\"AssessmentDetails,AssessmentType\",5004,5001)',NULL,NULL,'Hidden',NULL,NULL,0,NULL,NULL),(2595,NULL,'ProgressReview','AdherenceToTherapyAdequateLastTime','Char(1)',NULL,'\"Y\",\"N\"','\"Yes\",\"No\"',NULL,'RadioButton','Y',NULL,0,NULL,NULL),(2596,NULL,'ProgressReview','AdherenceToTherapyText','Varchar(255)','Calc','\nfunction agc_calc_SetAdherenceToTherapyText() {\n    \