age Locally\",\"Under Specialist Clinic\",\"Patient Refused\"','\"I am happy to continue management locally\",\"The patient is already under the specialist clinic\",\"This patient does not wish to be referred to hospital clinic\"',NULL,'DropDown',NULL,NULL,0,NULL,NULL),(2723,NULL,'PEF','PEFCodeAttached','Varchar(255)','Calc',' \nfunction agc_calc_PEF()\n{\n\n	age = $(\'input[name=InitialPatientDetails_Age]\');\n	sex = $(\'select[name=InitialPatientDetails_Sex]\');\n	height = $(\'input[name=ClinicalExam_HeightM]\'); \n	\n	PEF1 = $(\'input[name=PEF_PreviousPEF1]\');\n   	currentPef = $(\'input[name=PEF_CurrentPEF]\');\n	bestPEFLastTime = $(\'input[name=FirstAssessment_BestPEFLastTime]\');\n	\n	bestOrPredicted = $(\'input[name=PEF_BestOrPredicted]:checked\');\n	bestOrPredictedLastTime = $(\'input[name=PEF_BestOrPredictedLastTime]:checked\');\n	bestPef = $(\'input[name=FirstAssessment_BestPEF]\');\n	predPef = $(\'input[name=FirstAssessment_PredictedPEFValue]\');\n	\n	bestPEFCharts = $(\'input[name=TestsAndResults_PefCharts_BestPef]\');\n\n	//Calculated Predicted PEF\n	if (age.val() !== \'\' && sex.val() !== \'\' && height.val() !== \'\' && strScreenName != \'E2\'){\n\n		if (parseInt(age.val()) < 16) {\n			predictedPef = 543.3794446 + (parseFloat(height.val()) * -415.1345996) + ((parseFloat(height.val()) * parseFloat(height.val())) * 665.7294331) + (Math.exp(-0.5087062 + parseFloat(height.val())) * -415.546444);\n		} else if (parseInt(age.val()) >= 16){\n			if(sex.val() == \'M\'){\n				predictedPef = (((parseFloat(height.val()) * 5.48) + 1.58) - (parseFloat(age.val()) * 0.041)) * 60;\n			} else if (sex.val() == \'F\'){\n				predictedPef = (((parseFloat(height.val()) * 3.72) + 2.24) - (parseFloat(age.val()) * 0.03)) * 60;    \n			} else {\n				predictedPef =  \'Error\';\n			}\n		} else {\n			predictedPef =  \'Error\';\n		}\n\n		$(\'input[name=FirstAssessment_PredictedPEFValue]\').val(predictedPef.toFixed(0));\n\n	}\n    \n 	//Calculate Best PEF	\n   	if (PEF1.val() == \'\' || typeof PEF1.val() == \'undefined\') {\n   		pef1val = 0;\n   	} else {\n   		pef1val = parseInt(PEF1.val());\n   	}\n   \n   	if (currentPef.val() == \'\' || typeof currentPef.val() == \'undefined\') {\n   		currentPefVal = 0;\n   	} else {\n   		currentPefVal = parseInt(currentPef.val());\n   	}\n	\n	if (bestPef.val() == \'\' || typeof bestPef.val() == \'undefined\') {\n   		bestPefVal = 0;\n   	} else {\n   		bestPefVal = parseInt(bestPef.val());\n   	}\n	\n	if (bestPEFLastTime.val() == \'\' || typeof bestPEFLastTime.val() == \'undefined\') {\n   		bestPefLastTimeVal = 0;\n   	} else {\n   		bestPefLastTimeVal = parseInt(bestPEFLastTime.val());\n   	}\n     \n   	if (pef1val == 0 == \'\' && currentPefVal == 0 && bestPefVal == 0 && bestPefLastTimeVal == 0){\n   		best = \'\';\n   	} else {\n   		best = Math.max(pef1val,currentPefVal,bestPefVal,bestPefLastTimeVal);\n   	}\n \n 	if(best != \'\'){\n 		$(\'input[name=FirstAssessment_BestPEF]\').val(best);\n 	}\n \n	//Set Best or Predicted: if blank (i.e. new patient) default to Predicted, otherwise use previous answer\n	if (bestOrPredicted.val() == \'\' || bestOrPredicted.val() == null || typeof bestOrPredicted === \'undefined\'){\n		if (bestOrPredictedLastTime.val() == \'\' || bestOrPredictedLastTime.val() == null || typeof bestOrPredictedLastTime === \'undefined\'){\n			$(\'#PEF_BestOrPredicted_1\').iCheck (\'check\');\n			bestOrPredicted = $(\'input[name=PEF_BestOrPredicted]:checked\');\n		} else {\n			bestOrPredicted = bestOrPredictedLastTime;\n			if(bestOrPredictedLastTime.val() == \'Best\'){\n				$(\'#PEF_BestOrPredicted_0\').iCheck (\'check\');\n			} else {\n				$(\'#PEF_BestOrPredicted_1\').iCheck (\'check\');\n			}\n		}\n	}\n\n	//Calculate percentage of Best or Predicted\n	if (currentPef.val() != \'\' && bestOrPredicted.val() != \'\' && (bestPef.val() != \'\' || predPef.val() != \'\')){\n\n		if (bestOrPredicted.val() == \'Best\') {\n			percentPef = parseFloat(currentPef.val()) / parseFloat(bestPef.val()) * 100.0;\n		}\n		else if (bestOrPredicted.val() == \'Predicted\'){\n			percentPef = parseFloat(currentPef.val()) / parseFloat(predPef.val()) * 100.0;\n		}\n		else {\n			percentPef =  0;\n		}\n		\n		$(\'input[name=PEF_CurrentPEFPctPredicted]\').val(percentPef.toFixed(2));\n		\n	} else {\n		percentPef = \'\';\n		$(\'input[name=PEF_CurrentPEFPctPredicted]\').val(percentPef);\n	}\n\n	/*console.log(\'predictedPef: \' + predictedPef);\n	console.log(\'currentPef: \' + currentPef.val());\n	console.log(\'bestPef: \' + bestPef.val());\n	console.log(\'bestPefLastTimeVal: \' + bestPefLastTimeVal);\n	console.log(\'bestOrPredicted: \' + bestOrPredicted.val());\n	console.log(\'percentPef: \' + percentPef);*/\n	\n	if(strScreenName == \'PEF\'){\n		agc_calc_LungFunctionPerformedOutcome();\n	}\n	\n}\n\n$(\'input[name=PEF_BestOrPredicted]\').on(\'ifChanged\',function(){agc_calc_PEF();});\n$(\'input[name=FirstAssessment_BestPEF]\').change(function(){agc_calc_PEF();});\n$(\'input[name=FirstAssessment_PredictedPEFValue]\').change(function(){agc_calc_PEF();});\n$(\'input[name=Exacerbation_PEFDeclined]\').on(\'ifChanged\',function(){agc_calc_PEF();});\n$(\'input[name=PEF_PreviousPEF1]\').change(function(){agc_calc_PEF();});\n$(\'input[name=PEF_CurrentPEF]\').change(function(){agc_calc_PEF();}); \n$(\'input[name=InitialPatientDetails_DateOfBirth]\').change(function(){agc_calc_PEF();});\n$(\'select[name=InitialPatientDetails_Sex]\').change(function(){agc_calc_PEF();});\n$(\'input[name=ClinicalExam_HeightM]\').change(function(){agc_calc_PEF();});\n$(document).ready(function(){agc_calc_PEF()});\n',NULL,NULL,'Hidden',NULL,NULL,0,NULL,NULL),(2724,NULL,'Exacerbation','PEFNotAvailable','Binary',NULL,NULL,'PEF declined by patient  / not available',NULL,'CheckBox','N',NULL,0,NULL,NULL),(2725,NULL,'Exacerbation','ExacerbationRecommendations','Varchar(255)',NULL,'\"ContinueEarlyReview\",\"ContinuePlusAntibiotic\",\"IncreaseSteroidOrAddAnother\",\"OneOrMorePlusOralSteroid\"','\"Continue same medication 