art Rate\n	Exacerbation2Message += \'<span style=\\\'color:\'+PulseBpmColour+\';\\\'>&bull;&nbsp;&nbsp;&nbsp;&nbsp;</span>\';\n	Exacerbation2Message += \'Today\\\'s Heart Rate: <b>\' + PulseBpm.val() + \'</b> beats per minute\';\n	Exacerbation2Message += \'</p>\';\n\n	//SaO2\n	if (Sa02Declined.val() != \'Y\') {\n		Exacerbation2Message += \'<p><span style=\\\'color:\'+CurrentSaO2Colour+\';\\\'>&bull;&nbsp;&nbsp;&nbsp;&nbsp;</span>\';\n		Exacerbation2Message += \'Today\\\'s SaO2: <b>\' + CurrentSaO2.val() + \'%</b>\';\n		Exacerbation2Message += \'</p>\';\n	}\n\n	$(\'#text-2222\').html(Exacerbation2Message);\n	\n}\n\n$(document).ready(function(){agc_calc_Exacerbation2Message()});\n',NULL,NULL,'Hidden','N',NULL,0,NULL,NULL),(2787,NULL,'Audit','Flow4005Result','Int',NULL,'fn_PlaceholderExitFlow(20000)',NULL,NULL,'Hidden','N',NULL,0,NULL,NULL),(2788,NULL,'Exacerbation','RelieverNoPerDay','Int','Range','0-20',NULL,NULL,'TextBox','Y',NULL,0,NULL,NULL),(2789,NULL,'Exacerbation','AddOralSteroids','Char(1)',NULL,'\"Y\",\"N\"','\"Yes\",\"No\"',NULL,'RadioButton','Y',NULL,0,NULL,NULL),(2790,NULL,'Exacerbation','AddAntibiotics','Char(1)',NULL,'\"Y\",\"N\"','\"Yes\",\"No\"',NULL,'RadioButton','Y',NULL,0,NULL,NULL),(2791,NULL,'ProgressReview','ShowAcuteReason','Char(1)',NULL,NULL,NULL,NULL,'Hidden','N',NULL,0,NULL,NULL),(2792,NULL,'ProgressReview','ShowTherapyOptionsN2','Char(1)',NULL,NULL,NULL,NULL,'Hidden','N',NULL,0,NULL,NULL),(2793,NULL,'ProgressReview','ShowTherapyOptionsO1','Char(1)',NULL,NULL,NULL,NULL,'Hidden','N',NULL,0,NULL,NULL),(2794,NULL,'ProgressReview','ShowTherapyOptionsQ','Char(1)',NULL,NULL,NULL,NULL,'Hidden','N',NULL,0,NULL,NULL),(2795,NULL,'ProgressReview','ShowTherapyOptionsD9','Char(1)',NULL,NULL,NULL,NULL,'Hidden','N',NULL,0,NULL,NULL),(2796,NULL,'ProgressReview','ShowTherapyOptionsD11','Char(1)',NULL,NULL,NULL,NULL,'Hidden','N',NULL,0,NULL,NULL),(2797,NULL,'ProgressReview','ShowDiagnosisDefiniteOptions','Char(1)',NULL,NULL,NULL,NULL,'Hidden','N',NULL,0,NULL,