INSERT INTO `Table` VALUES (1,'data_json','table','\n  \n  function BTP_start_spiro ()\n      {\n          //console.log(\'BTP_start_spiro:go!\');\n   	   \n   	  // previousLungFunctionsReturned = $(\'input[name=LungFunction_PreviousLungFunctionsReturned]\');\n   	   \n   	   $.ajaxSetup({ cache: false });\n          $.getJSON(strDataURLStart+\'/getpreviouspefscores/\'+intPatientID, function( data ) {    \n   \n              //   check datalength!\n              if (data.length >0)\n              {\n   			   \n   			   //console.log(data);\n                      \n   				   //Checks the visible question \'Are there previous lung function tests?\' and sets the behind the scenes marker so it becomes not visible\n   				   $(\'#LungFunction_PreviousLungFunctionsReturned\').val(\'Y\');\n				   \n                    data.forEach(function(d) {\n                       if(d.Historic == \'-\'){\n							$(\'#LungFunction_PreviousLungFunctionsReturnedNotHistoric\').val(\'Y\');\n					   };\n					}); \n				   \n				   \n				   \n  				   $(\'#layout-holder-786\').hide();\n  				   $(\'#layout-holder-765\').hide();\n  				   $(\'#LungFunction_AreTherePreviousLfTests_0\').iCheck (\'check\');\n   				   \n   				   agc_TAB_BuildTable_Pro(strTargetTable,data,false);\n      \n                      agc_TAB_BuildTableColumn(strTargetTable,{title:\'Best FEV1\',data:agc_TAB_CalculateBestFEV1(strTargetTable)},3);\n                      agc_TAB_BuildTableColumn(strTargetTable,{title:\'Best SVC\',data:agc_TAB_CalculateBestSVC(strTargetTable)},4);\n      \n                      arrPercentPred = agc_TAB_CalculatePercentPredicted(strTargetTable);\n      \n                      agc_TAB_BuildTableColumn(strTargetTable,{title:\'% Predicted\',data:arrPercentPred,suffix:\'%\'},agc_TAB_getColumnPositionOf(strTargetTable,\'PEF\')+1);\n                      arrColumnsToHide = [\n                                       agc_TAB_getColumnPositionOf(strTargetTable,\'PreFEV1\'),\n                                       agc_TAB_getColumnPositionOf(strTargetTable,\'PreFVC\'),\n                                       agc_TAB_getColumnPositionOf(strTargetTable,\'PreSVC\'),\n                                       agc_TAB_getColumnPositionOf(strTargetTable,\'PostFEV1\'),\n                                       agc_TAB_getColumnPositionOf(strTargetTable,\'PostFVC\'),\n                                       agc_TAB_getColumnPositionOf(strTargetTable,\'PostSVC\'),\n                                       agc_TAB_getColumnPositionOf(strTargetTable,\'PredFEV1\'),\n                                       agc_TAB_getColumnPositionOf(strTargetTable,\'PredFVC\'),\n                                       agc_TAB_getColumnPositionOf(strTargetTable,\'PredPEF\'),\n                                      agc_TAB_getColumnPositionOf(strTargetTable,\'ConsultationId\')\n                                       ];\n                      agc_TAB_hideColumn(strTargetTable,arrColumnsToHide);\n                      floStandardDeviationPEF = agc_TAB_getStandardDeviation(arrPercentPred);\n                       objTitleCell = {\n                                              class:\'text-right\'\n                                              ,html:\'<strong>Coefficient<br/>of Variation</strong>\'\n                                              };\n                      objContentCell = {\n                                              class:\'text-right\'\n                                              ,html: floStandardDeviationPEF +\'%\'				};\n      \n                      if (floStandardDeviationPEF !== \'NaN\')\n                      {\n                              agc_TAB_BuildFooterRow(strTargetTable,{title:objTitleCell,content:objContentCell,column:agc_TAB_getColumnPositionOf(strTargetTable,\'% Predicted\')});\n                      }\n                      agc_TAB_BuildTableColumn(strTargetTable,{\n                                                      title: \'Reversibility\'\n                                                      ,data: agc_TAB_CalculateReversibility(strTargetTable)\n                                                      });\n                      agc_TAB_BuildTableColumn(strTargetTable,{\n                                                      title: \'Airway Obstruction\'\n                                                      ,data: agc_TAB_CalculateAirwayObstruction(strTargetTable)\n                                                      });\n                      agc_TAB_hideRowsOfNoUse(strTargetTable,[\'Best FEV1\', \'Best SVC\', \'PEF\']);\n    				   agc_TAB_colourHistoricValues(strTargetTable,[\'Historic\']);\n    				  \n                      agc_TAB_alignColumn(strTargetTable,\'right\',\'Best FEV1\');\n                      agc_TAB_alignColumn(strTargetTable,\'right\',\'Best SVC\');\n                      agc_TAB_alignColumn(strTargetTable,\'right\',\'PEF\');\n                      agc_TAB_alignColumn(strTargetTable,\'right\',\'% Predicted\');\n                      agc_TAB_alignColumn(strTargetTable,\'center\',\'Reversibility\');\n                      agc_TAB_alignColumn(strTargetTable,\'center\',\'Airway Obstruction\');\n      \n                      if(agc_TAB_FEV1Variability(strTargetTable))\n                      {\n                              $(\'#Spirometry_VariabilityFev1BetweenOccasions\').val(\'Y\');\n                      }\n                      else\n                      {\n                              $(\'#Spirometry_VariabilityFev1BetweenOccasions\').val(\'N\');\n                      }\n              } else {\n  \n  			}\n  			\n  			\n  				\n           });\n  \n      }\n      \n      //BTP_start_spiro();\n      $(document).ready(function(){BTP_start_spiro();});\n      \n      /*  Chart   */\n      \n      \n      /*\n      lungfunction_data_old = JSON.parse(\'[{\'ConsultationId\':\'177\',\'Date\':\'12/01/2013\',\'PreFEV1\':\'0\',\'PreFVC\':\'0\',\'PreSVC\':\'0\',\'PostFEV1\':\'3.6\',\'PostFVC\':\'4.1\',\'PostSVC\':\'4.5\',\'PredFEV1\':\'90\',\'PredFVC\':\'110\',\'PEF\':\'0\',\'PredPEF\':\'0\'},{\'ConsultationId\':\'179\',\'Date\':\'13/03/2013\',\'PreFEV1\':\'0\',\'PreFVC\':\'0\',\'PreSVC\':\'0\',\'PostFEV1\':\'3.6\',\'PostFVC\':\'4\',\'PostSVC\':\'0\',\'PredFEV1\':\'86\',\'PredFVC\':\'98\',\'PEF\':\'0\',\'PredPEF\':\'0\'},{\'ConsultationId\':\'180\',\'Date\':\'13/04/2013\',\'PreFEV1\':\'0\',\'PreFVC\':\'0\',\'PreSVC\':\'0\',\'PostFEV1\':\'0\',\'PostFVC\':\'0\',\'PostSVC\':\'0\',\'PredFEV1\':\'72\',\'PredFVC\':\'0\',\'PEF\':\'0\',\'PredPEF\':\'0\'},{\'ConsultationId\':\'181\',\'Date\':\'13/07/2013\',\'PreFEV1\':\'0\',\'PreFVC\':\'0\',\'PreSVC\':\'0\',\'PostFEV1\':\'0\',\'PostFVC\':\'0\',\'PostSVC\':\'0\',\'PredFEV1\':\'74\',\'PredFVC\':\'0\',\'PEF\':\'552\',\'PredPEF\':\'0\'},{\'ConsultationId\':\'190\',\'Date\':\'13/09/2013\',\'PreFEV1\':\'0\',\'PreFVC\':\'0\',\'PreSVC\':\'0\',\'PostFEV1\':\'3.6\',\'PostFVC\':\'4\',\'PostSVC\':\'0\',\'PredFEV1\':\'0\',\'PredFVC\':\'98\',\'PEF\':\'0\',\'PredPEF\':\'64\'},{\'ConsultationId\':\'191\',\'Date\':\'13/10/2013\',\'PreFEV1\':\'0\',\'PreFVC\':\'0\',\'PreSVC\':\'0\',\'PostFEV1\':\'0\',\'PostFVC\':\'0\',\'PostSVC\':\'0\',\'PredFEV1\':\'0\',\'PredFVC\':\'0\',\'PEF\':\'0\',\'PredPEF\':\'72\'},{\'ConsultationId\':\'192\',\'Date\':\'13/12/2013\',\'PreFEV1\':\'0\',\'PreFVC\':\'0\',\'PreSVC\':\'0\',\'PostFEV1\':\'0\',\'PostFVC\':\'0\',\'PostSVC\':\'0\',\'PredFEV1\':\'0\',\'PredFVC\':\'0\',\'PEF\':\'552\',\'PredPEF\':\'84\'},{\'ConsultationId\':\'193\',\'Date\':\'13/01/2014\',\'PreFEV1\':\'0\',\'PreFVC\':\'0\',\'PreSVC\':\'0\',\'PostFEV1\':\'3.6\',\'PostFVC\':\'4\',\'PostSVC\':\'0\',\'PredFEV1\':\'60\',\'PredFVC\':\'98\',\'PEF\':\'0\',\'PredPEF\':\'0\'},{\'ConsultationId\':\'194\',\'Date\':\'13/02/2014\',\'PreFEV1\':\'0\',\'PreFVC\':\'0\',\'PreSVC\':\'0\',\'PostFEV1\':\'0\',\'PostFVC\':\'0\',\'PostSVC\':\'0\',\'PredFEV1\':\'0\',\'PredFVC\':\'0\',\'PEF\':\'0\',\'PredPEF\':\'69\'},{\'ConsultationId\':\'195\',\'Date\':\'13/06/2014\',\'PreFEV1\':\'0\',\'PreFVC\':\'0\',\'PreSVC\':\'0\',\'PostFEV1\':\'0\',\'PostFVC\':\'0\',\'PostSVC\':\'0\',\'PredFEV1\':\'72\',\'PredFVC\':\'0\',\'PEF\':\'552\',\'PredPEF\':\'0\'}]\');\n      \n      control_data_old = JSON.parse(\'[{\'AsthmaControlId\':1,\'PatientId\':20,\'ConsultationId\':177,\'MedicationStep\':3,\'Control13\':\'Partial\',\'Control45\':\'\',\'DateCreated\':\'12/01/2013\'},{\'AsthmaControlId\':2,\'PatientId\':20,\'ConsultationId\':179,\'MedicationStep\':4,\'Control13\':\'\',\'Control45\':\'Partial\',\'DateCreated\':\'13/03/2013\'},{\'AsthmaControlId\':3,\'PatientId\':20,\'ConsultationId\':180,\'MedicationStep\':4,\'Control13\':\'\',\'Control45\':\'Good\',\'DateCreated\':\'13/04/2013\'},{\'AsthmaControlId\':4,\'PatientId\':20,\'ConsultationId\':181,\'MedicationStep\':3,\'Control13\':\'Partial\',\'Control45\':\'\',\'DateCreated\':\'13/07/2013\'},{\'AsthmaControlId\':5,\'PatientId\':20,\'ConsultationId\':190,\'MedicationStep\':3,\'Control13\':\'Good\',\'Control45\':\'\',\'DateCreated\':\'13/09/2013\'},{\'AsthmaControlId\':6,\'PatientId\':20,\'ConsultationId\':191,\'MedicationStep\':2,\'Control13\':\'Partial\',\'Control45\':\'\',\'DateCreated\':\'13/10/2013\'},{\'AsthmaControlId\':7,\'PatientId\':20,\'ConsultationId\':192,\'MedicationStep\':2,\'Control13\':\'Good\',\'Control45\':\'\',\'DateCreated\':\'13/12/2013\'},{\'AsthmaControlId\':8,\'PatientId\':20,\'ConsultationId\':193,\'MedicationStep\':2,\'Control13\':\'Partial\',\'Control45\':\'\',\'DateCreated\':\'13/01/2014\'},{\'AsthmaControlId\':9,\'PatientId\':20,\'ConsultationId\':194,\'MedicationStep\':3,\'Control13\':\'Good\',\'Control45\':\'\',\'DateCreated\':\'13/02/2014\'},{\'AsthmaControlId\':10,\'PatientId\':20,\'ConsultationId\':195,\'MedicationStep\':3,\'Control13\':\'Good\',\'Control45\':\'\',\'DateCreated\':\'13/06/2014\'}]\');\n      \n      console.log(lungfunction_data_old);\n      console.log(control_data_old);\n      \n      */\n      \n      \n      /// Packaged as BCP: Build Chart Pro\n      \n      function BCP_start_spiro ()\n      {\n          //console.log(\'BCP_start_spiro:go!\');\n          $(\'#\'+strTargetChart).html(\'\');\n          \n          \n          \n          \n          Date.prototype.addDays = function(days)\n          {\n              var dat = new Date(this.valueOf());\n              dat.setDate(dat.getDate() + days);\n              return dat;\n          }\n      \n      \n          if (!Array.prototype.joinWith) {\n              +function () {\n                  Array.prototype.joinWith = function(that, by, select, omit) {\n                      var together = [], length = 0;\n                      if (select) select.map(function(x){select[x] = 1;});\n                      function fields(it) {\n                          var f = {}, k;\n                          for (k in it) {\n                              if (!select) { f[k] = 1; continue; }\n                              if (omit ? !select[k] : select[k]) f[k] = 1;\n                          }\n                          return f;\n                      }\n                      function add(it) {\n                          var pkey = \'.\'+it[by], pobj = {};\n                          if (!together[pkey]) together[pkey] = pobj,\n                              together[length++] = pobj;\n                          pobj = together[pkey];\n                          for (var k in fields(it))\n                              pobj[k] = it[k];\n                      }\n                      this.map(add);\n                      that.map(add);\n                      return together;\n                  }\n              }();\n          }\n      \n      \n          $.getJSON(strDataURLStart+\'/getpreviouspefscores/\'+intPatientID, function( lungfunction_data ) {\n              //console.log(\'HERE\');\n              //console.log(lungfunction_data);\n     		 if(lungfunction_data.length > 1)\n     		 {\n     			$.getJSON(strDataURLStart+\'/getpreviouscontrolscores/\'+intPatientID, function( control_data ) {\n                  //console.log(control_data);\n                  //all_data = lungfunction_data_old.joinWith(control_data_old, \'ConsultationId\');\n                  all_data = lungfunction_data;\n                  //console.log(all_data);\n      \n                      var lfCodes = [\'FEV1\',\'PEF\',\'NONE\'];\n                      var lfColours = [\'#3366FF\',\'#009933\',\'#ffffff\'];\n      \n      \n                      var parseDate = d3.time.format(\'%d/%m/%Y\').parse;\n                      var formatPercent = d3.format(\'.0%\');\n      \n                      function brushed() {\n                        x.domain(brush.empty() ? x2.domain() : brush.extent());\n                        focusCircle.attr(\'cx\', function(d, i) { return x(d.Date); });\n                        focus.select(\'.x.axis\').call(xAxis);\n                      };\n      \n      \n                      all_data = all_data.filter(function(d){return d.PredFEV1 > 0 || d.PredPEF > 0 ;});\n      \n      \n      \n                        all_data.forEach(function(d) {\n                          d.ConsultationId = d.ConsultationId;\n                          d.Date = parseDate(d.Date);\n                          d.PreFEV1 = +d.PreFEV1;\n                          d.PreFVC = +d.PreFVC;\n                          d.PreSVC = +d.PreSVC;\n                          d.PostFEV1 = +d.PostFEV1;\n                          d.PostFVC = +d.PostFVC;\n                          d.PostSVC = +d.PostSVC;\n                          d.PredFEV1 = +d.PredFEV1;\n                          d.PredFVC = +d.PredFVC;\n                          d.PEF = +d.PEF;\n                          d.PredPEF = +d.PredPEF;\n                          d.test = +d.PredPEF;\n                          \n                          d.TestVal = d.PostFEV1 || d.PredPEF;\n                          /*d.MedicationStep = d.MedicationStep;\n                          d.Control13  = d.Control13;\n                          d.Control45 =  d.Control45;\n                          */\n                          if(d.PostFEV1 > 0 || d.PreFEV1 > 0){\n                              d.lfType = \'FEV1\';\n 							 \n 							 if(d.PostFEV1 == null || d.PostFEV1 < d.PreFEV1) {\n 								d.combPercPred = (d.PreFEV1/+d.PredFEV1) * 100;\n 							 } else {\n 								d.combPercPred = (d.PostFEV1/+d.PredFEV1) * 100;\n 							 }\n 							 \n                          } else if(d.PEF > 0){\n                              d.lfType = \'PEF\';\n 							 d.combPercPred = (d.PEF/+d.PredPEF)*100;\n 							 \n                          } else {\n                              d.lfType = \'NONE\';\n 							 d.combPercPred = 0.0*100;\n                          };\n                          /*\n                          d.combControl = d.Control13 || +d.Control45;\n                          */\n                        }); \n      \n      \n                      meanav = d3.mean(all_data,function(d) { return d.combPercPred/100; });\n                      stdev = d3.deviation(all_data,function(d) { return d.combPercPred/100; });\n      \n                      plus2sd = meanav + stdev * 2;\n                      plus3sd = meanav + stdev * 3;\n                      minus2sd = meanav - stdev * 2;\n                      minus3sd = meanav - stdev * 3;\n      \n                      var color = d3.scale.ordinal()\n                          .domain(lfCodes)\n                          .range(lfColours);\n      \n                      var margin = {top: 10, right: 10, bottom: 100, left: 50},\n                          margin2 = {top: 530, right: 10, bottom: 20, left: 50},\n                          width = 960 - margin.left - margin.right,\n                          height = 600 - margin.top - margin.bottom,\n                          height2 = 600 - margin2.top - margin2.bottom;\n      \n                      var x = d3.time.scale().range([0, width]),\n                          x2 = d3.time.scale().range([0, width]),\n                          y = d3.scale.linear().range([height, 0]),\n                          y2 = d3.scale.linear().range([height2, 0]);\n      \n                      var xAxis = d3.svg.axis().scale(x).orient(\'bottom\'),\n                          xAxis2 = d3.svg.axis().scale(x2).orient(\'bottom\'),\n                          yAxis = d3.svg.axis().scale(y).orient(\'left\').tickFormat(formatPercent);\n      \n                      var brush = d3.svg.brush()\n                          .x(x2)\n                          .on(\'brush\', brushed);\n      \n                      mindate = d3.min(all_data,function(d) { return d.Date; });\n                      maxdate = d3.max(all_data,function(d) { return d.Date; });\n      \n                      mindate = mindate.addDays(-30)\n                      maxdate = maxdate.addDays(30)\n      \n                      ymin = Math.min(d3.min(all_data,function(d) {return d.combPercPred/100-0.05;}), minus3sd - 0.05);\n                      ymin = Math.max(0, ymin);\n                      ymax = Math.max(1.0, plus3sd + 0.05)\n      \n                        /*x.domain(d3.extent(all_data.map(function(d) { return d.Date; })));*/\n                          x.domain([mindate,maxdate]);\n                        /*y.domain(d3.extent(all_data.map(function(d) {if(d.combPercPred/100 == 0) {return 0.9} else {return d.combPercPred/100-0.01 };})));;*/\n                          y.domain([ymin,ymax]);\n                        x2.domain(x.domain());\n                        y2.domain(y.domain());\n      \n      \n                      /*\n                      var svg = d3.select(\'#\'+strTargetChart).append(\'svg\')\n                          .attr(\'width\', width + margin.left + margin.right)\n                          .attr(\'height\', height + margin.top + margin.bottom)\n                          .append(\'g\')\n                          .attr(\'transform\', \'translate(\' + margin.left + \',\' + margin.top + \')\');	\n                      */\n      \n                      var div = d3.select(\'#\'+strTargetChart).append(\'div\')   \n                          .attr(\'class\', \'tooltip\')               \n                          .style(\'opacity\', 0);	\n      \n                      var svg = d3.select(\'#\'+strTargetChart).append(\'svg\')\n                          .attr(\'width\', width + margin.left + margin.right)\n                          .attr(\'height\', height + margin.top + margin.bottom);\n      \n                      svg.append(\'defs\').append(\'clipPath\')\n                          .attr(\'id\', \'clip\')\n                        .append(\'rect\')\n                          .attr(\'width\', width)\n                          .attr(\'height\', height)\n      \n      \n                      var focus = svg.append(\'g\')\n                          .attr(\'transform\', \'translate(\' + margin.left + \',\' + margin.top + \')\');\n      \n                      var hevents = focus.append(\'g\')\n                          .attr(\'clip-path\', \'url(#clip)\');\n      \n                      var context = svg.append(\'g\')\n                          .attr(\'transform\', \'translate(\' + margin2.left + \',\' + margin2.top + \')\');\n      \n      \n                      focus.append(\'g\')\n                            .attr(\'class\', \'x axis\')\n                            .attr(\'transform\', \'translate(0,\' + height + \')\')\n                            .call(xAxis);\n      \n                      focus.append(\'g\')\n                            .attr(\'class\', \'y axis\')\n      \n                            .call(yAxis);  \n      \n      \n                      // Average and SD\n                      var lines = focus.append(\'g\');\n      \n                      lines.append(\'line\')          // attach a line\n                          .style(\'stroke\', \'green\')  // colour the line\n                          .style(\'stroke-dasharray\', (\'3, 7\'))\n                          .attr(\'x1\', x(mindate))     // x position of the first end of the line\n                          .attr(\'y1\', y(meanav))      // y position of the first end of the line\n                          .attr(\'x2\', x(maxdate)-40)     // x position of the second end of the line\n                          .attr(\'y2\', y(meanav));\n      \n                      lines.append(\'text\')\n                          .text(\'Mean\')\n                          .attr(\'x\', x(maxdate)-40)     \n                          .attr(\'y\', y(meanav))\n                          .attr(\'dy\', \'.3em\')\n                          .attr(\'fill\', \'green\'); \n      \n      \n                      lines.append(\'line\')          // attach a line\n                          .style(\'stroke\', \'orange\')  // colour the line\n                          .style(\'stroke-dasharray\', (\'3, 7\'))\n                          .attr(\'x1\', x(mindate))     // x position of the first end of the line\n                          .attr(\'y1\', y(plus2sd))      // y position of the first end of the line\n                          .attr(\'x2\', x(maxdate)-40)     // x position of the second end of the line\n                          .attr(\'y2\', y(plus2sd));\n      \n                      lines.append(\'text\')\n                          .text(\'+2SDs\')\n                          .attr(\'x\', x(maxdate)-40)     \n                          .attr(\'y\', y(plus2sd))\n                          .attr(\'dy\', \'.3em\')\n                          .attr(\'fill\', \'orange\'); \n      \n                      lines.append(\'line\')          // attach a line\n                          .style(\'stroke\', \'red\')  // colour the line\n                          .style(\'stroke-dasharray\', (\'3, 7\'))\n                          .attr(\'x1\', x(mindate))     // x position of the first end of the line\n                          .attr(\'y1\', y(plus3sd))      // y position of the first end of the line\n                          .attr(\'x2\', x(maxdate)-40)     // x position of the second end of the line\n                          .attr(\'y2\', y(plus3sd));\n      \n                      lines.append(\'text\')\n                          .text(\'+3SDs\')\n                          .attr(\'x\', x(maxdate)-40)     \n                          .attr(\'y\', y(plus3sd))\n                          .attr(\'dy\', \'.3em\')\n                          .attr(\'fill\', \'red\'); \n      \n                      lines.append(\'line\')          // attach a line\n                          .style(\'stroke\', \'orange\')  // colour the line\n                          .style(\'stroke-dasharray\', (\'3, 7\'))\n                          .attr(\'x1\', x(mindate))     // x position of the first end of the line\n                          .attr(\'y1\', y(minus2sd))      // y position of the first end of the line\n                          .attr(\'x2\', x(maxdate)-40)     // x position of the second end of the line\n                          .attr(\'y2\', y(minus2sd));\n      \n                      lines.append(\'text\')\n                          .text(\'-2SDs\')\n                          .attr(\'x\', x(maxdate)-40)     \n                          .attr(\'y\', y(minus2sd))\n                          .attr(\'dy\', \'.3em\')\n                          .attr(\'fill\', \'orange\'); \n      \n                      lines.append(\'line\')          // attach a line\n                          .style(\'stroke\', \'red\')  // colour the line\n                          .style(\'stroke-dasharray\', (\'3, 7\'))\n                          .attr(\'x1\', x(mindate))     // x position of the first end of the line\n                          .attr(\'y1\', y(minus3sd))      // y position of the first end of the line\n                          .attr(\'x2\', x(maxdate)-40)     // x position of the second end of the line\n                          .attr(\'y2\', y(minus3sd));\n      \n      \n                      lines.append(\'text\')\n                          .text(\'-3SDs\')\n                          .attr(\'x\', x(maxdate)-40)     \n                          .attr(\'y\', y(minus3sd))\n                          .attr(\'dy\', \'.3em\')\n                          .attr(\'fill\', \'red\'); \n      \n                      focusCircle = hevents.selectAll(\'circle\')\n                            .data(all_data)\n                          .enter().append(\'circle\')\n                            //.text( function (d) { return \'?\' //d.MedicationStep\n                            //          ; })\n                            .attr(\'cx\', function(d) { return x(d.Date); })\n                            .attr(\'cy\', function(d) { return y(d.combPercPred / 100); })\n                            //.attr(\'font-size\', \'30px\')\n                            //.attr(\'text-anchor\', \'middle\')\n                            //.style(\'font-weight\', \'bold\')\n                            .style(\'fill-opacity\', 0.75)\n                            //.attr(\'dy\', \'.3em\')\n                            .attr(\'fill\',\'#993399\')\n                            .attr(\'r\',5)\n                            .attr(\'fill\',function(d) {return color(d.lfType);})\n                            .on(\'mouseover\', function(d) {\n                                  d3.select(this).transition()\n                                                 .style(\'fill-opacity\', 1)\n                                                 //.attr(\'font-size\', \'50px\')\n                                                  .attr(\'r\',10);\n                                  div.transition()        \n                                      .duration(200)      \n                                      .style(\'opacity\', 0.8);      \n                                  div.html(\'<h4>\'+d.lfType+\'</h4>\'\n                                              + \'<p><b>Date: </b>\' +  d.Date.getDate() + \'/\' + (d.Date.getMonth() + 1) + \'/\' + d.Date.getFullYear() + \'</p>\'\n                                              //+ \'<br/>\'\n                                              + \'<p><b>Percent Predicted:</b> \' + (Math.round(d.combPercPred * 10)/10).toFixed(1)  + \'%</p>\'\n                                              //+ \'<br/>\'\n                                              + \'<p><b>\'+d.lfType+\' Value: </b>\' + d.TestVal  + \'</p>\'\n                                              //+ \'<br/>\'	\n                                              //+ \'<p><b>Control: </b>\' \n                                              //+ \'O\'\n                                              //+ d.combControl  \n      \n                                              + \'</p>\'\n                                              //+ \'<br/>\'	\n                                              //+ \'<p><b>Medication Step: </b>\' + d.MedicationStep  + \'</p>\'\n                                              )  \n                                      .style(\'left\', (d3.event.pageX - 380) + \'px\') \n                                      .style(\'background\', color(d.lfType))				\n                                      .style(\'top\', (d3.event.pageY - 380) + \'px\'); \n      \n      \n                                })   \n                            .on(\'mouseout\', function(d) {  \n                                  d3.select(this).transition()\n                                                 .style(\'fill-opacity\', 0.75)\n                                                  .attr(\'r\',5);\n                                                 //.attr(\'font-size\', \'30px\');\n                                  div.transition()        \n                                      .duration(500)      \n                                      .style(\'opacity\', 0);   \n      \n                                });\n      \n      \n      \n                      context.selectAll(\'circle\')\n                            .data(all_data)\n                          .enter().append(\'circle\')\n                            .attr(\'cx\', function(d) { return x2(d.Date); })\n                            .attr(\'cy\', function(d) { return y2(d.combPercPred / 100); })\n                            .attr(\'r\', \'2\')\n                            .attr(\'fill\',function(d) {return color(d.lfType);});\n      \n                      context.append(\'g\')\n                            .attr(\'class\', \'x axis\')\n                            .attr(\'transform\', \'translate(0,\' + height2 + \')\')\n                            .call(xAxis2);\n      \n                      context.append(\'g\')\n                            .attr(\'class\', \'x brush\')\n                            .call(brush)\n                          .selectAll(\'rect\')\n                            .attr(\'y\', -6)\n                            .attr(\'height\', height2 + 7);\n      \n              });\n     		} else {\n   			$(\'#\'+strTargetChart).html(\'<div style=text-align:center><p><br>Insufficient data points to plot a chart<br><br></p></div>\');\n   		}\n          });\n      }\n      \n      \n      BCP_start_spiro ();\n  '),(2,'data_json','table-striped','$.getJSON(strDataURLStart+\'/getpreviouspefscores/\'+intPatientID, function( data ) {    \n     var tbl_head = \'\';\n     var tbl_body = \'\';\n     var tbl_row = \'\';\n     \n     $.each(data[0], function(k , v) {\n         tbl_row += \'<th>\'+k+\'</th>\';\n     })\n     tbl_head += \'<thead><tr>\'+tbl_row+\'</tr></thead>\';                 \n \n     $.each(data, function() {\n         var tbl_row = \'\';\n         \n         $.each(this, function(k , v) {\n      \n             if (v == \'\')\n   {\n    v= \'-\';\n   }\n         if ($.isNumeric(v))\n             {\n   tbl_row += \'<td class=\'text-right\'>\';\n             }\n             else\n      {\n   tbl_row += \'<td class=\'\'>\';\n      }\n             tbl_row += v+\'</td>\';\n         })\n         tbl_body += \'<tr>\'+tbl_row+\'</tr>\';                 \n     })\n     tbl_body=\'<tbody>\'+tbl_body+\'</tbody>\';\n     $(\'#\'+strTargetTable).html(tbl_head+tbl_body);\n     agc_BuildCanvasChart($(\'#\'+$(\'#\'+strTargetTable).attr(\'data-agc_chartref\')),data);\n });');
