INSERT INTO `Text` VALUES (2,'In the last 12 months, have you had any exacerbations that needed:','Raw','font-weight:bold;'),(4,'Inspiratory wheeze is often part asthma, but if there is a possibility of inspiratory stridor, please consider a chest xray and/or other investigations','Alert','alert-danger'),(28,'Please record the best of 3:','Raw','font-weight:bold;'),(29,'Test','Raw','font-weight:bolder;'),(30,'Prebronchodilator','Raw','font-weight:bolder;'),(31,'Postbronchodilator','Raw','font-weight:bolder;'),(32,'Predicted','Raw','font-weight:bolder;'),(33,'% of Predicted','Raw','font-weight:bolder;'),(34,'FEV1 (L)','Raw','font-weight:bolder;'),(35,'FVC (L)','Raw','font-weight:bolder;'),(36,'SVC (L)','Raw','font-weight:bolder;'),(37,'FEV1/FVC','Raw','font-weight:bolder;'),(38,'NA','Raw',NULL),(39,NULL,'Alert','alert-info'),(41,'Please select tests ordered','Raw','font-weight:bolder;'),(56,'The PEF reading today is normal (>80%)','Alert','alert-info'),(57,'The PEF reading today is moderately abnormal (65-80%)','Alert','alert-warning'),(58,'The PEF reading today is abnormal (<65%)','Alert','alert-danger'),(2001,'Please consider if bronchiecatsis might be present!','Alert','alert-warning'),(2002,'If Sputum is coloured, i.e. yellow or green, please send off sample for culture!','Alert','alert-warning'),(2017,'The data supporting the asthma diagnosis is not strong','Alert','alert-warning'),(2018,'There is moderate support for the diagnosis in this person','Alert','alert-info'),(2019,'This patient has a well supported diagnosis and it is appropriate to consider another of the Step 4/5 medication options since they are poorly controlled','Alert','alert-info'),(2020,'If you have a record of this patients Best PEF from the last 12 months, please record:',NULL,NULL),(2023,'GMS contract and NICE standards and QOF require that to enter an asthma register the diagnosis is confirmed formally at some point. Please record basis for diagnosis (please tick the ones that apply for this person):','Alert','alert-info'),(2024,'This patient has been assessed as having Good Control','Alert','alert-info'),(2025,'This patient has been assessed as having Partial Control','Alert','alert-info'),(2026,'This patient has been assessed as having Poor Control, please proceed to the Clinical Examination','Alert','alert-info'),(2027,'As this patient appears uncomfortable, please proceed to the Clinical Examination','Alert','alert-info'),(2028,'The abnormal examination findings are not typical of asthma. These must be checked out and either confirmed to be longstanding and of no import (so that you may continue with routine asthma therapy today) or appropriately investigated.','Alert','alert-info'),(2029,'This patient has a raised Heart Rate or Respiratory Rate. It is not OK to complete a routine examination when these are abnormal, since they may indicate a possible exacerbation. The next few screens will assess whether to manage as an exacerbation or return to continue with a routine review.','Alert','alert-info'),(2030,'The Clinical Examination has shown no cause for alarm, please proceed to the Therapy Module.','Alert','alert-info'),(2031,'This is the end of the consultation. Please click \"Finish\" to end this consultation and return to the start.','Alert','alert-info'),(2032,'Please test the patient\'s current Peak Expiratory Flow. For adults use full size PEF meter and for children under 16 use the low values PEF meter.','Alert','alert-info'),(2033,'Current PEF (% of Predicted)',NULL,NULL),(2034,'Current PEF (% of Best)',NULL,NULL),(2035,'This page is currently under construction!','Alert','alert-warning'),(2036,'According to the 2014 BTS / SIGN Asthma Guidelines, this patient is at Treatment Step 1, based on current therapy','Alert','alert-info'),(2037,'According to the 2014 BTS / SIGN Asthma Guidelines, this patient is at Treatment Step 2, based on current therapy','Alert','alert-info'),(2038,'According to the 2014 BTS / SIGN Asthma Guidelines, this patient is at Treatment Step 3, based on current therapy','Alert','alert-info'),(2039,'According to the 2014 BTS / SIGN Asthma Guidelines, this patient is at Treatment Step 4, based on current therapy, and should proceed down the Standard Track consultation','Alert','alert-info'),(2040,'According to the 2014 BTS / SIGN Asthma Guidelines, this patient is at Treatment Step 5, based on current therapy, and should proceed down the Standard Track consultation','Alert','alert-info'),(2041,'This patient is not currently on any asthma therapy','Alert','alert-info'),(2042,'Select solutions chosen:','Raw',NULL),(2043,'It seems as if this patient has problems using inhaled therapy. Please discuss with the medical team and consider if a specialist review is required.','Alert','alert-danger'),(2045,'This patient presents with a possible asthma exacerbation . The following screens collect the data upon which to make a decision a) whether it is an exacerbation and b) how severe.','Alert','alert-info'),(2046,'In the last couple of weeks:','Raw','font-weight:bold;'),(2047,'This patient reports no recent increase in asthma symptoms and that makes it unlikely they have an asthma exacerbation. It is suggested you do not continue on this pathway today, but instead explore other reasons for them coming today and manage accordingly.   If after that, you wish to return to conduct a regular review asthma visit, please re-enter the program and select routine review or annual review as appropriate. ','Alert','alert-info'),(2054,'Abnormal',NULL,NULL),(2059,'It is unusual for a mild exacerbation not to be settling. Suggest re examine patient and ensure there is no other explanation. Choices include allowing more time or referring to hospital.','Alert','alert-warning'),(2060,'The PEF is relatively preserved suggesting only mild airway obstruction yet there are markers (shown above) that are abnormal. Treat with additional doses of inhaled beta-agonist paying attention to inhaler technique. Look for other non asthma causes for this; if none found continue on asthma therapy.','Alert','alert-warning'),(2061,'This is a mild exacerbation and you should expect to be able to treat this without hospital help. Offer short term increase in bronchodilators and increase dose of inhaled steroids. Offer a course of rescue steroids and or antibiotics for use if above not sufficient. Ensure has a personal action plan to manage this and care in recovery. Plan to review in clinic in 4 weeks.','Alert','alert-info'),(2063,NULL,'Alert','alert-info'),(2064,'<a id=\"LinkDiseaseEducation\" href=\"http://www.google.com\" target=\"_blank\">Placeholder Download Link 1</a>',NULL,NULL),(2065,'<a id=\"LinkMedicationEducation\" href=\"http://www.google.com\" target=\"_blank\">Placeholder Download Link 2</a>',NULL,NULL),(2066,'<a id=\"LinkPersonalActionPlan\" href=\"http://www.google.com\" target=\"_blank\">Placeholder Download Link 3</a>',NULL,NULL),(2067,'Please indicate which items are felt by this patient to be specific triggers of their asthma, and discuss possible avoidance / reduction strategies','Alert','alert-info'),(2068,'This patient has symptoms of rhinitis or hay fever but is not currently on any nasal steroids or antihistamines. Please prescribe appropriate therapy and provide details below in the Non-respiratory Drugs section and review next time.','Alert','alert-info'),(2069,'This patient has poor asthma control and rhinitis that persists despite therapy. Discuss with GP re other treatment or referal to ENT / Allergy clinic','Alert','alert-warning'),(2074,'Fumes / Perfumes','Raw','font-weight:bold;'),(2075,'Pets / Animals','Raw','font-weight:bold;'),(2076,'Passive Smoking','Raw','font-weight:bold;'),(2077,'Certain Seasons','Raw','font-weight:bold;'),(2078,'Pollen','Raw','font-weight:bold;'),(2079,'Dust Mites','Raw','font-weight:bold;'),(2080,'Mould','Raw','font-weight:bold;'),(2081,'Other','Raw','font-weight:bold;'),(2082,'As this patient is a smoker, please refer to smoking cessation and review next visit.','Alert','alert-info'),(2083,'Occupational asthma should be investigated by an expert. Refer to secondary care for advice but continue current care package.','Alert','alert-info'),(2084,'You previously said you were a non-smoker','Alert','alert-info'),(2085,'You previously said you were a ex-smoker','Alert','alert-info'),(2086,'You previously said you were a recent ex-smoker','Alert','alert-info'),(2087,'You previously said you were a current smoker','Alert','alert-info'),(2088,'As control is poor, consider giving the patient a PEF meter and teaching them to record PEF to ascertain need for SABA rescue','Alert','alert-info'),(2089,'A reminder has been added to the appointments list in this program, and will be noted on the patient report at the end of the consultation','Alert','alert-info'),(2090,'This patient has declined to have the influenza vaccination, despite advice, and this will be noted on the patient report at the end of the consultation','Alert','alert-warning'),(2091,'N/A',NULL,NULL),(2092,'In the absence of an objective measure of airflow limitation the software package is not able to make recommendations','Alert','alert-warning'),(2097,'In the last week:','Raw','font-weight:bold;'),(2098,'Received Offline','Raw','font-weight:bold;'),(2099,'As Spirometry has not been performed today, please record the patients PEF instead and book a spirometry test','Alert','alert-info'),(2100,'The Clinical Examination has shown no cause for alarm, please proceed to the Lung Function Module.','Alert','alert-info'),(2103,NULL,'Alert','alert-info'),(2104,'<p>It is unsafe to continue with a computer guided consultation because the algorithms depend on there being no other causes present to explain the symptoms. This consultation will exit after this screen.</p><p>If a doctor is able to exclude other explanations and confirm that it is appropriate to manage asthma in a standard manner then its appropriate to re -enter the patient into the computer-guided programme. Today’s data will be saved, and if re-entry is within a short period, the data already entered can be added to.</p>','Alert','alert-info'),(2105,NULL,'Alert','alert-info'),(2106,'Influenza','Raw','font-weight:bold;'),(2107,'Pneumococcal','Raw','font-weight:bold;'),(2108,NULL,'Raw',NULL),(2109,'This patient has declined to have the pneumococcal vaccination, despite advice, and this will be noted on the patient report at the end of the consultation','Alert','alert-warning'),(2110,'Test Date','Raw',NULL),(2111,'This patient has reported they are currently taking nasal steroids / antihistamines','Alert','alert-info'),(2119,'Please tick all that apply',NULL,NULL),(2120,NULL,'Alert','alert-info'),(2121,'Is the pulse really this slow? Check and if confirmed please consult with a doctor before continuing.','Alert','alert-warning'),(2122,'Is the respiratory rate really this slow? Check and if confirmed please consult with a doctor before continuing.','Alert','alert-warning'),(2123,'Is the pulse really this fast? A pulse over 110 will redirect to an Exacerbation Review. Check and if confirmed please consult with a doctor before continuing.','Alert','alert-warning'),(2124,'Is the respiratory rate really this fast? A rate over 25 will redirect to an Exacerbation Review. Check and if confirmed please consult with a doctor before continuing.','Alert','alert-warning'),(2125,'Is the pulse really this fast? Check and if confirmed please consult with a doctor before continuing.','Alert','alert-warning'),(2126,'Is the respiratory rate really this fast? Check and if confirmed please consult with a doctor before continuing.','Alert','alert-warning'),(2151,'Date of last attendance (if known)','Raw',NULL),(2152,'A record of this vaccination has been added to the patient report at the end of the consultation','Alert','alert-info'),(2154,'Checking inhaler technique is a requirement for QOF. Please ensure that inhaler technique is checked at a future date if it is not being checked today.','Alert','alert-warning'),(2156,'Home Peak Flow Meter','Raw','font-weight:bold;'),(2157,'ENT Referral','Raw','font-weight:bold;'),(2158,'Secondary Care Asthma Specialist Referral','Raw','font-weight:bold;'),(2159,'Smoking Cessation Referral','Raw','font-weight:bold;'),(2160,'Sputum Sample','Raw','font-weight:bold;'),(2161,'Occupational Asthma Referral','Raw','font-weight:bold;'),(2162,'The following \'flags\' were set during the last consultation. Please review them now and record details as appropriate.','Alert','alert-info'),(2163,'Please record the results of any tests ordered during the last consultation (these are flagged below) and / or any other tests results that are currently available. If results are not available, please check the \"Results not yet available\" box and there will be an opportunity to enter them in future consultations.','Alert','alert-info'),(2164,'No follow up flags were set during the last consultation. Proceed to the next screen.','Alert','alert-info'),(2165,'Changed Drug','Alert','alert-info'),(2166,'Changed Dose/Device','Alert','alert-info'),(2167,'Stopped','Alert','alert-danger'),(2168,'Started','Alert','alert-warning'),(2169,'Maintained','Alert','alert-success'),(2170,'GMS contract and NICE standards and QOF require that to enter an asthma register the diagnosis is confirmed formally at some point. Last time this patient presented with only weak support for a diagnosis of asthma. In the last 12 months, have any of the following events occured that could strengthen the basis for diagnosis (please tick the ones that apply for this person):','Alert','alert-info'),(2171,'As this patient has recently stepped up from a Step 1-3 therapy to a Step 4-5 therapy, additional information needs to be collected in order to ensure there is an accurate basis for a diagnosis. Please complete the following questions relating to the patient\'s history.','Alert','alert-info'),(2172,'','Alert','alert-info'),(2173,'Please enter all the patient\'s current medication','Alert','alert-info'),(2174,'This patient should have been booked in for a flu vaccination last time. Did this vaccination occur? Please update as appropriate.','Alert','alert-info'),(2175,'This patient declined to have the flu vaccination last time, but have they had the flu vaccination since the last visit, arranged outside of the Asthma programme? Please update as appropriate.','Alert','alert-warning'),(2176,'A flu vaccination was not available last time, but have they had the flu vaccination since the last visit, arranged outside of the Asthma programme? Please update as appropriate.','Alert','alert-info'),(2177,'This patient should have been booked in for a pneumococcal vaccination last time. Did this vaccination occur? Please update as appropriate.','Alert','alert-info'),(2178,'This patient declined to have the pneumococcal vaccination last time, but have they had the pneumococcal vaccination since the last visit, arranged outside of the Asthma programme? Please update as appropriate.','Alert','alert-warning'),(2179,'A pneumococcal vaccination was not available last time, but have they had the pneumococcal vaccination since the last visit, arranged outside of the Asthma programme? Please update as appropriate.','Alert','alert-info'),(2180,NULL,'Alert','alert-info'),(2181,NULL,'Raw',NULL),(2182,NULL,'Alert','alert-info'),(2183,'As this patient has good or partial control and appears comfortable, a clinical exam is not required today.','Alert','alert-info'),(2184,'As there has been a change in therapy, please re-check inhaler technique, if appropriate','Alert','alert-info'),(2185,'Previous Therapy','Raw','font-weight:bold;'),(2186,'Current Therapy','Raw','font-weight:bold;'),(2187,'Ask the patient about concordance with treatment and if there are doubts its worth checking the last year\'s prescription collection - many patients do not collect enough to take the recommended dose','Alert','alert-info'),(2188,'Some test results above point away from a diagnosis of asthma. Consider whether a referral to secondary care is appropriate at this stage.','Alert','alert-warning'),(2189,'Side One','Raw','font-weight:bold;'),(2193,'for','Raw',NULL),(2194,'mg for','Raw',NULL),(2195,'days','Raw',NULL),(2196,'No tests were requested during the last consulation, but do you have any recent test results that would help to support a diagnosis of asthma?','Alert','alert-info'),(2197,'As bone prophylaxis is required, please prescribe appropriately and note in the non-respiratory drugs section below','Alert','alert-info'),(2198,'There is a significant anaemia present. Complete today\'s asthma consultation, but please also arrange to investigate the anaemia appropriately, it may explain some of the breathlessness.','Alert','alert-warning'),(2204,'<p>Increase the dose of inhaled steroid to the equivalent of 800mcg standard beclomethasone and add two of</p>\n<ul>\n<li>a long acting beta agonist</li>\n<li>long acting anti cholinergic</li>\n<li>slow- release theophylline</li>\n<li>Leukotrine R agonist</li>\n<li>PDE4 inhibitor</li>\n</ul>','Alert','alert-warning'),(2205,'<p>(S)MART therapy is based on a rapid action long acting bronchodilator in a combination inhaler with a steroid. A regular dose once or twice daily with extra doses (instead of a short acting bronchodilator) for symptom control as required.</p>\n<p>Initial doses are either:</p>\n<ul> \n	<li>two inhalations twice daily (Symbicort,DuoResp) and then extra doses up to a maximum of an extra 8 puffs (total 12) per day or</li> \n	<li>one inhalation daily (Fostair) with extra doses up to a maximum of 6 puffs (total 8) per day</li>\n</ul>\n<p>Thus when a patient is well no further doses are needed but when asthma control is less good, the dose of inhaled steroid is titrated upwards until control is regained. Many patients find this an easier way of remembering their therapy needs. Combinations licensed for this use include:</p>\n<ul>\n <li>Symbicort 200</li>\n <li>Fostair 100</li>\n <li>DuoResp 200</li>\n</ul>\n<p>Detailed instructions should be written on the patients management plan</p>','Alert','alert-warning'),(2206,'In the last couple of weeks are your symptoms worse than usual:','Raw','font-weight:bold;'),(2208,'This patient\'s therapy includes two long acting bronchodilator preparations, please re consider and stop one of them','Alert','alert-danger'),(2209,'This patient\'s therapy includes two long-acting anticholinergic preparations, please re consider and stop one of them','Alert','alert-danger'),(2210,'This patient\'s treatment includes bronchodilator therapy, but without an inhaled steroid. It is strongly recommended that these preparations are NOT prescribed without the anti-inflammatory benefits of an inhaled steroid','Alert','alert-danger'),(2211,'<p>A low PEF and a low SaO2 suggests this is potentially life threatening attack. Plan to refer to hospital urgently and in the mean time:</p><p><ul><li>Arrange high flow Oxygen (if available)</li><li>Administer 40-50mg oral prednisilone</li><li>Administer either nebulised beta agonist or 10 puffs of MDI via a spacer if no nebuliser</li><li>Monitor response by changing HR/RR/Breathsounds/ PEF</li></ul></p><p>Plan to review in 3-4 weeks post admission</p>','Alert','alert-danger'),(2212,'<p>A low SaO2 but only modestly affected PEF suggests there may be more than merely asthma present. Check for signs of pneumonia and heart failure. The low SaO2 makes hospitalisation the wise choice.</p><p><ul><li>Arrange high flow Oxygen (if available)</li><li> Administer  40-50mg oral prednisilone</li><li>Administer either nebulised beta agonist or 10 puffs of MDI via a spacer if no nebuliser</li><li>Monitor response by changing HR/RR/Breathsounds/ PEF</li></ul></p><p>Plan to review in 3-4 weeks post admission</p>','Alert','alert-danger'),(2213,'<p>A PEF of less than 50% of predicted or best is often an indication for hospitalisation unless there is a dramatic and rapid response:</p><p><ul><li>Arrange high flow Oxygen (if available)</li><li> Administer  40-50mg oral prednisilone</li><li>Administer either nebulised beta agonist or 10 puffs of MDI via a spacer if no nebuliser</li><li>Monitor response by changing HR/RR/PEF and ability to talk and O2</li></ul></p><p>Unless there is a dramatic response i.e. PEF >75% and speaking in sentences will need hospital referral </p>','Alert','alert-danger'),(2214,'<p>The PEF suggests a moderate exacerbation but the abnormal markers (shown above) are a danger sign that may indicate it\'s more severe</p><p><ul><li> Administer  40-50mg oral prednisilone</li><li>Administer either nebulised beta agonist or via a spacer give 4 puffs initially and 2 more every 10 mins (up to 10 puffs)</li><li>Give O2 if available</li><li>Monitor response by changing HR/RR/ PEF and ability to talk and O2</li></ul></p>','Alert','alert-warning'),(2215,'Its not appropriate to resume the planned asthma assessment today. Arrange to see the patient in 4 weeks or so after the hospitalisation. It will be necessary to start the program assessment again at that time or when symptoms are again stable.','Alert','alert-info'),(2216,'This situation is not covered by the software. It is inappropriate to use this software for this particular patient and better that you continue with care based on your clinical skills and the patient’s wishes.','Alert','alert-info'),(2218,'The good response to high dose bronchodilator is encouraging and home management with a short course of oral steroids with higher doses of inhaled bronchodilators has been selected. Antibiotics are indicated if you think there is a bacterial infection.','Alert','alert-info'),(2219,'Although the PEF was not alarmingly low, the presence of other serious markers and the lack of response to high dose bronchodilators is concerning','Alert','alert-warning'),(2220,'<p>A low PEF that has not responded well to high dose bronchodilators is a significant asthma attack. Make the urgent referral to hospital and in the mean time:</p><p><ul><li>Arrange high flow Oxygen (if available)</li><li>Monitor response by changing HR / RR / Breathsounds / PEF</li></ul></p><p>Plan to review in 3-4 weeks post admission</p>','Alert','alert-danger'),(2221,'The good response to extra bronchodilators is encouraging and home management with a short course of oral steroids with higher doses of inhaled bronchodilators has been selected. Antibiotics are indicated if you think there is a bacterial infection.','Alert','alert-info'),(2222,NULL,'Alert','alert-info'),(2223,'To monitor progress over the next few days / weeks please record the following. Ask the patient to record home PEF and give advice on actions if it\'s not improving.','Alert','alert-info'),(2224,'Please record your prescribing actions in the secion below','Alert','alert-info'),(2225,NULL,'Alert','alert-info'),(2226,'You have identified a possible reason for poor control and it may be enough to correct this and continue to monitor progress.  However at this level of therapy poor control is often associated with bad outcome.','Alert','alert-info'),(2227,'This patient has not responded as well as expected to Step 4/5 therapy and is  reporting poor control.  In the absence of obvious remedial factors the choices open to you are to reconsider the diagnosis (with or without more tests), and then either to refer for (further) specialist advice or perform more investigations yourself.','Alert','alert-info'),(2228,'This patient’s asthma control has not been good despite step 4 asthma guidelines therapy, and checks on concordance and inhaler technique suggest its being used properly. Its appropriate to consider stepping up therapy.','Alert','alert-info'),(2229,'WORDS TO BE ADDED (LABA Alone)','Alert','alert-warning'),(2230,'This patient appears to have stopped all medication, having previous been on a high dose. This is not a normal situation, and should be handled individually without using the computerised package. When you click Next the data will save and the package will exit. Please manage the unusual situation using your own clinical expertise.','Alert','alert-warning'),(2231,'This patient is not currently on any asthma therapy, however for the rest of this consultation they will be managed according to the medication step they were on last time','Alert','alert-info'),(2232,NULL,'Alert','alert-info'),(2233,'Please ensure that the trigger factors you have noted have been fully addressed','Alert','alert-info'),(2234,'As Spirometry has not been performed today, please record the patients PEF instead','Alert','alert-info'),(2235,'This patient has no recorded lung function (spirometry or PEF) and because the computer guided package needs that data, it is not possible to continue in the program today','Alert','alert-warning'),(2236,'Click Next to exit the program today. Re-book a new consultation in a few weeks time.','Alert','alert-info'),(2237,'It is most unusual not to be able to perform even a PEF measurement and as this can often be associated with diagnostic issues, its recommended that this patient should have a specialist referral. They can be re-entered to the package in future once the reasons for this inability have been elucidated. In the meantime manage their care in the usual way without the assistance of the package.','Alert','alert-warning'),(2238,'This patient is not on a short acting reliever drug','Alert','alert-danger'),(2239,'As spirometry is not available today, you will be given the opportunity to record a PEF on the next screen instead and consider spirometry at a future visit.','Alert','alert-info'),(2240,'Recent abdominal, thoracic, or eye surgery is a contraindication to performing spirometry today. You will be given the opportunity to record a PEF on the next screen instead, and consider spirometry at a future visit.','Alert','alert-warning'),(2241,'A recent pneumothorax is a contraindication to performing spirometry today. You will be given the opportunity to record a PEF on the next screen instead, and consider spirometry at a future visit.','Alert','alert-warning'),(2242,'As spirometry cannot be performed today, you will be given the opportunity to record a PEF on the next screen instead and consider spirometry at a future visit.','Alert','alert-info'),(2243,'<a id=\"LinkOnlineAdvice\" href=\"https://www.asthma.org.uk/advice/understanding-asthma/\" target=\"_blank\">Asthma UK Online Advice</a>',NULL,NULL),(2244,'<a id=\"LinkOnlineResources\" href=\"https://www.asthma.org.uk/advice/resources/#adults\" target=\"_blank\">Asthma UK Online Resources for Adults</a>',NULL,NULL),(2245,'This patient is on no therapy for asthma','Alert','alert-warning'),(2246,'The normal FEV1/FVC ratio with a low FVC (ie restrictive pattern) may indicate there is more than asthma present but the rise in FEV1 post bronchodilators of >0.4l or 12% justifies continuing with asthma therapy.','Alert','alert-info');
