INSERT INTO `Text_deletedrows` VALUES (13,'Consider a withdrawal of therapy - discuss with patient. Asthma is variable - most will stop using but keep inhalers available in case of URTI or other trigger in the future','Alert','alert-info'),(14,'Maintain but reconsider diagnosis at next visit if still very well controlled','Alert','alert-info'),(15,'Consider Inhaled corticosteroid in low dose. Follow up in 3 months to check response','Alert','alert-info'),(16,'Consider Inhaled corticosteroid in medium dose. Follow up in 3 months to check response','Alert','alert-info'),(17,'Consider a withdrawal/decrease of therapy or else same SABA and low dose Inhaled corticosteroid','Alert','alert-info'),(18,'Maintain same SABA and low dose Inhaled corticosteroid','Alert','alert-info'),(19,'Offer SABA and  Inhaled corticosteroid/long-acting beta agonist. Follow up in 3 months to check response','Alert','alert-info'),(20,'Offer SABA and medium dose Inhaled corticosteroid/long-acting beta agonist. Follow up in 1 months to check response','Alert','alert-info'),(21,'Maintain current medication','Alert','alert-info'),(22,'Consider step down to low dose Inhaled corticosteroid','Alert','alert-info'),(23,'Consider switch to a (s)MART approach to therapy. Follow up in 3 months to check response.','Alert','alert-info'),(24,' Patient needs to either\n a) try using same drugs in a (s)MART regime or \n b) move to step 4 therapy\n Patient would benefit from an expert review – please arrange appointment with specialist asthma clinic','Alert','alert-info'),(25,'Maintain same regime but arrange extra education/support and review','Alert','alert-info'),(43,'This patients asthma control has been good for more than 3 months and so it is recommended to step down therapy',NULL,NULL),(44,'This patients asthma control has been good for more than 3 months and its known that previous attempts to step down were not successful.   Maintain same level of therapy.','Alert','alert-info'),(45,'This patients asthma control has been good for more than 3 months and its known that previous attempts to step down were not successful.   Maintain same level of therapy .','Alert','alert-info'),(46,'This patients asthma control has been adequate.  Maintain same level of therapy ','Alert','alert-info'),(47,'This patients asthma control has not been good despite step 4 / 5 asthma guidelines therapy.    Looking at the prescription record it seems that this person has not collected the no of scripts necessary for full dosage.   Give advice on the importance of regular daily treatment doses and the current prescription level has been maintained ','Alert','alert-info'),(48,'This patients asthma control has not been good despite step 4/5 asthma guidelines therapy.    A check of inhaler technique suggests that not all the inhaled drugs have been reaching the airways.    Advice has been given and it is recommended to  continue  the current prescription level ','Alert','alert-info'),(49,'This patients asthma control has not been good despite step 4/5 asthma guidelines therapy, and checks on concordance and inhaler technique suggest its being used properly.    Its appropriate to consider stepping up therapy but first they are being referred for a specialist asthma clinic assessment.','Alert','alert-info'),(50,'This patients asthma control has not been good despite step4/5 asthma guidelines therapy, and checks on concordance and inhaler technique suggest its being used properly.    Its appropriate to consider stepping up therapy.','Alert','alert-info'),(51,'This patients asthma control has not been good despite step4/5 asthma guidelines therapy, and checks on concordance and inhaler technique suggest its being used properly.    Its appropriate to consider stepping up therapy but the next step is to consider regular oral steroids or one of the new agents eg anti IgE therapy.     Referral to a specialist clinic should be made ','Alert','alert-info'),(52,'D10','Alert','alert-info'),(53,'This patient presents for the first time with symptoms that are compatible with asthma. Step 1 therapy is recommended','Alert','alert-info'),(54,'This patient presents for the first time with symptoms that are compatible with asthma.  Referral for specialist assessment has been made. It is recommended that PEF record for 2 weeks prior to that appointment. Step 1 therapy could be concidered','Alert','alert-info'),(55,'C','Alert','alert-info'),(2009,'Proceed to the therapy section and consider a short term step up of therapy','Alert','alert-info'),(2010,'Discuss managementand choices of drugs with patient. Reconstruct the written action plan. Proceed to therapy and institute changes.','Alert','alert-info'),(2011,'This is a patient with poorly controlled asthma despite good compliance and proven inhaler techique. Plan to step up pharma therapy in the next section.','Alert','alert-info'),(2012,'Order tests and record on the next screen, and book to review with results.','Alert','alert-info'),(2013,'Make a referral but meanwhile consider a temporary step of therapy in next section','Alert','alert-info'),(2014,'Offer short term changes but maintain usual therapy','Alert','alert-info'),(2015,'Please refer to secondary care for a more detailed investigation and diagnosis. Meanwhile continue with current meds and standard measures.','Alert','alert-info'),(2016,'Proceed to the treatment section with intent to concentrate on and correct that specific item.','Alert','alert-info'),(2048,'This is likely to be a severe or very severe exacerbation','Alert','alert-warning'),(2049,'This could be a life threatening exacerbation. Plan to refer to hospital urgently. Arrange high flow Oxygen (if available), administer 40-50mg oral prednisilone. Administer either nebulised beta agonist or 10 puffs of MDI via a spacer if no nebuliser. Monitor response by changing HR / RR / Breathsounds / PEF. Plan to review in 3-4 weeks post admission.','Alert','alert-danger'),(2050,'This is a severe exacerbation and the low SaO2 suggests hospitalisation is likely to be needed. Arrange high flow Oxygen (if available), Administer  40-50mg oral prednisilone. Administer either nebulised beta agonist or 10 puffs of MDI via a spacer if no nebuliser. Monitor response by changing HR / RR / PEF and ability to talk and O2. Unless there is a dramatic response i.e. PEF > 75% AND SaO2 > 92 and speaking in sentences, will need hospital referral.','Alert','alert-warning'),(2051,'As there has been a limited response to exacerbation treatment, arrange for patient to be sent immediately to hospital. Plan to review in 3-4 weeks post admission.','Alert','alert-danger'),(2052,'Repeat nebulised bronchodilator if necessary and monitor response. If any one of PEF, talking in sentences or SaO2 deteoriorate, or one or more are off after one hour, then arrange for patient to be sent to hospital. Plan to review in 3-4 weeks post admission.','Alert','alert-warning'),(2056,'The reduced PEF suggests a moderate exacerbation and with the abnormal observation(s) above are a sign that it should not be ignored. Consider giving 40-50mg oral prednisilone and a high dose beta agonist either via a nebuliser or via a spacer (4 puffs initially and 2 more every 10 mins (up to 10puffs)). Assess response.','Alert','alert-warning'),(2057,'<p>This is a moderate exacerbation that has responded to acute therapy. Plan to manage patient at home and to review in 2-3 weeks\' time.</p>\n<p>First complete and document Clinical Examination including wheeze diffuse / bilateral / expiratory and / or inspiratory, presence or not of crackles (and where), heart sounds, and any other abnormality. If examination is abnormal is an ECG or CXR required? If yes order one.</p>\n<p>To monitor progress over the next few days / weeks suggest:</p>\n<ul>\n    <li>Record the RCP3Q score (ADD)</li>\n    <li>Record how many times a day patient is using extra reliever therapy</li>\n    <li>Ask patient to monitor and record home PEF and give advice on actions if it is not improving</li>\n</ul>\n<p>Ensure patient has a WRITTEN management plan including what do to in a CRISIS and check inhaler technique is effective.</p>','Alert','alert-info'),(2058,'This is a moderate exacerbation without alarm signs. Administer  40-50mg oral prednisilone. Administer either nebulised beta agonist or via a spacer give 4 puffs initially and 2 more every 10 mins (up to 10 puffs) and give O2 if available.','Alert','alert-info'),(2062,'Treat other cause and leave asthma therapy unchanged.','Alert','alert-info'),(2093,'\n<p>This is a moderate exacerbation that has responded to acute therapy. Plan to manage patient at home and to review in 2-3 weeks\' time.</p>\n <p>To monitor progress over the next few days / weeks suggest:</p>\n <ul>\n     <li>Record the RCP3Q score (ADD)</li>\n     <li>Record how many times a day patient is using extra reliever therapy</li>\n     <li>Ask patient to monitor and record home PEF and give advice on actions if it is not improving</li>\n </ul>\n <p>Ensure patient has a WRITTEN management plan including what do to in a CRISIS and check inhaler technique is effective.</p>\n','Alert','alert-info'),(2094,'You have now the patients past  history, their current symptom control and their lung function test (PEF at least)','Alert','alert-info'),(2095,'Suggest refer to secondary care for a more definitive opinion. Send a copy of the report with the patient and if possible ask the patient to record two weeks of PEF data before they are seen (and take it with them). Unless there are compelling reasons, do not treat immediately pending the outcome.','Alert','alert-warning'),(2096,'You have said this patient is not on inhalers but you entered some in the earlier screen. Please clarify which you mean and edit accordingly.','Alert','alert-warning'),(2101,'Asthma requiring continued oral prednisolone is rare and often complex and so is usually best managed from secondary care. Sugest referral if not already in place. Send a copy of the report with the patient and if possible ask the patient to record two weeks of PEF data before they are seen (and take it with them). Unless there are compelling reasons, do not alter treatment immediately pending the outcome.','Alert','alert-warning'),(2102,'This patient is poorly controlled on Step 5 therapy and should probably be managed in a secondary care setting. Suggest referral probably with perhaps an increased dose of daily oral predinisilone in the meantime.','Alert','alert-warning'),(2190,'This is a severe exacerbation. Administer  40-50mg oral prednisilone. Arrange high flow Oxygen (if available), administer either nebulised beta agonist or 10 puffs of MDI via a spacer if no nebuliser. Monitor response by changing HR / RR / PEF and ability to talk and O2. Unless there is a dramatic response i.e. PEF > 75% and speaking in sentences, will need hospital referral.','Alert','alert-warning'),(2191,'The guided management program depends on having an objective measure of airflow limitation and if it\'s not available the package cannot provide realistic guidance. Please manage as you would have done pre-computer package and make the judgements re acute therapy and or acute referral to hospital.','Alert','alert-warning'),(2192,'weeks','Raw',NULL),(2199,'Hospital Referral or Alternative Treatment','Raw','font-weight:bold;'),(2200,'(Placeholder during testing; replace this with Text 2172 if this doesn\'t work)','Alert','alert-info'),(2201,'Step 5 patient on Oral Prednisolone for more than 4 weeks','Raw','font-weight:bold;'),(2202,'New patient on First Visit for Asthma','Raw','font-weight:bold;'),(2203,'Progress Review Questions','Raw','font-weight:bold;'),(2207,'This patient reports no significant change in asthma symptoms and that makes it unlikely they have an asthma exacerbation. Suggest you do not continue on this pathway today. Explore other reasons for them coming today and manage accordingly. If after that, you wish to return to conduct a regular review asthma visit  please re enter the program and select routine review or annual review as appropriate.','Alert','alert-info'),(2217,'<p>A low PEF that has not responded well to high dose bronchodilators is a severe asthma attack. Make the urgent referral to hospital and in the mean time:</p><p><ul><li>Arrange high flow Oxygen (if available)</li><li>Monitor response by changing HR / RR / Breathsounds / PEF</li></ul></p><p>Plan to review in 3-4 weeks post admission</p>','Alert','alert-danger');
