CREATE DEFINER=`root`@`%` PROCEDURE `UpdateConsultationValuesWithPrevious`(IN ReviewIDCurrent int, ReviewIDPrevious int)
BEGIN
	
	DECLARE Iteration INT;
	DECLARE NoIterations INT;
	SET Iteration= 1;   
	SET NoIterations = (SELECT MAX(MappingFieldInsertOrder) FROM Field);

	WHILE Iteration  <= NoIterations DO
           	UPDATE ConsultationValues CV
								JOIN Field FLD ON CV.FieldName = FLD.MappingFieldName 
								JOIN ConsultationValuesPrevious CVP ON CVP.FieldName =  concat(FLD.DbTableName,"_",FLD.dBFieldName)
							SET CV.FieldValue = CVP.FieldValue
							WHERE CV.ReviewID = ReviewIDCurrent AND CVP.ReviewID = ReviewIDPrevious 
								AND COALESCE(FLD.MappingFieldInsertOrder,1) =  Iteration
								AND CVP.FieldValue != '';
			SET  Iteration = Iteration + 1;                 
	END WHILE;

	
	
	UPDATE ConsultationValues CV
	JOIN
		(
		SELECT ReviewID, REPLACE(fieldName, 'CurrentMedication_', 'CurrentMedicationLastVisit_') AS fieldName, FieldValue
		FROM ConsultationValuesPrevious CVP
		WHERE CVP.FieldName like "CurrentMedication_%"
			AND CVP.ReviewID = ReviewIDPrevious
		) CVP ON CV.FieldName =  CVP.FieldName
	SET CV.FieldValue = CVP.FieldValue
	WHERE CV.ReviewID = ReviewIDCurrent ; 
	

	
	UPDATE ConsultationValues CV
	JOIN
		(
		SELECT ReviewID, REPLACE(fieldName, 'MedicationReview_', 'CurrentMedicationLastVisit_') AS fieldName, FieldValue
		FROM ConsultationValuesPrevious CVP
		WHERE CVP.FieldName like "MedicationReview%ChangeType"
			AND CVP.ReviewID = ReviewIDPrevious
		) CVP ON CV.FieldName =  CVP.FieldName
	SET CV.FieldValue = CVP.FieldValue
	WHERE CV.ReviewID = ReviewIDCurrent ; 

	
	UPDATE ConsultationValues CT
	LEFT JOIN (SELECT *, REPLACE(REPLACE(fieldName, 'CurrentMedicationLastVisit_CurrentDrug', ''),'NewDrug','') AS Drug
				FROM ConsultationValues
				WHERE FieldName Like "CurrentMedicationLastVisit_%NewDrug"
				AND ReviewID = ReviewIDCurrent) CMLV ON REPLACE(REPLACE(CT.fieldName, 'CurrentMedicationLastVisit_ReviewDrug', ''),'ChangeType','')  = 
										   REPLACE(REPLACE(CMLV.fieldName, 'CurrentMedicationLastVisit_CurrentDrug', ''),'NewDrug','')
	LEFT JOIN (SELECT *,  REPLACE(REPLACE(fieldName, 'CurrentMedication_CurrentDrug', ''),'NewDrug','') AS Drug
				FROM ConsultationValues
				WHERE FieldName Like "CurrentMedication_CurrentDrug%NewDrug"
				AND ReviewID = ReviewIDCurrent) CM ON REPLACE(REPLACE(CT.fieldName, 'CurrentMedicationLastVisit_ReviewDrug', ''),'ChangeType','')  = 
										 REPLACE(REPLACE(CM.fieldName, 'CurrentMedication_CurrentDrug', ''),'NewDrug','')
	SET CT.FieldValue = CASE WHEN CT.FieldValue > '' THEN CT.FieldValue
							 WHEN CMLV.FieldValue > '' AND CM.FieldValue > '' THEN 'maintained'
							 WHEN CM.FieldValue > '' THEN 'start'
							 ELSE 'notused'
						END
	WHERE CT.FieldName Like "CurrentMedicationLastVisit_%ChangeType"
	AND CT.ReviewID = ReviewIDCurrent;


	
	UPDATE ConsultationValues CM
	JOIN (SELECT *, REPLACE(REPLACE(fieldName, 'CurrentMedicationLastVisit_ReviewDrug', ''),'ChangeType','') AS Drug
				FROM ConsultationValues
				WHERE FieldName Like "CurrentMedicationLastVisit_%ChangeType" AND FieldValue = "stop"
				AND ReviewID = ReviewIDCurrent) CMLV ON REPLACE(REPLACE(CMLV.fieldName, 'CurrentMedicationLastVisit_ReviewDrug', ''),'ChangeType','')  = 
														REPLACE(REPLACE(CM.fieldName, 'CurrentMedication_CurrentDrug', ''),'NewDrug','')
														OR
														REPLACE(REPLACE(CMLV.fieldName, 'CurrentMedicationLastVisit_ReviewDrug', ''),'ChangeType','')  = 
														REPLACE(REPLACE(CM.fieldName, 'CurrentMedication_CurrentDrug', ''),'NewUsage','')
	SET CM.FieldValue = NULL
	WHERE (CM.FieldName Like "CurrentMedication_CurrentDrug%NewDrug" OR CM.FieldName Like "CurrentMedication_CurrentDrug%NewUsage")
	AND CM.ReviewID = ReviewIDCurrent;

	
	UPDATE ConsultationValues CV
		JOIN
			(
			SELECT ReviewID, CONCAT(fieldName, 'LastTime') AS fieldName, FieldValue
			FROM ConsultationValuesPrevious CVP
			WHERE CVP.FieldName like "DiagnosisBasis_%"
				AND CVP.ReviewID = ReviewIDPrevious
			) CVP ON CV.FieldName =  CVP.FieldName
		SET CV.FieldValue = CVP.FieldValue
		WHERE CV.ReviewID = ReviewIDCurrent ;
				
	
	UPDATE ConsultationValues CV
		JOIN
			(
			SELECT ReviewID, "CurrentControl_ControlLastTime" AS fieldName, CASE WHEN FastOrStandardTrack = "Standard Track" COLLATE utf8_general_ci THEN COALESCE(CurrentControl45,CurrentControl13) ELSE COALESCE(CurrentControl13,CurrentControl45) END AS FieldValue
			FROM (
				SELECT FT.*,ST.CurrentControl45,T.FastOrStandardTrack
					FROM (
						SELECT ReviewID, FieldValue AS CurrentControl13
						FROM ConsultationValuesPrevious
						WHERE fieldName = "FirstAssessment_CurrentControl13" COLLATE utf8_general_ci
						) FT
					JOIN (
						SELECT ReviewID, FieldValue AS CurrentControl45
						FROM ConsultationValuesPrevious
						WHERE fieldName = "FirstAssessment_CurrentControl45" COLLATE utf8_general_ci
						) ST
					JOIN (
						SELECT ReviewID, FieldValue AS FastOrStandardTrack
						FROM ConsultationValuesPrevious
						WHERE fieldName = "FirstAssessment_FastOrStandardTrack" COLLATE utf8_general_ci
						) T
					ON FT.ReviewID = ST.ReviewID
					AND FT.ReviewID = T.ReviewID
				) CVP
			WHERE CVP.ReviewID = ReviewIDPrevious
			) CVP ON CV.FieldName =  CVP.FieldName COLLATE utf8_general_ci
		SET CV.FieldValue = CVP.FieldValue
		WHERE CV.ReviewID = ReviewIDCurrent;


	
END ;;
DELIMITER ;
